INSERT INTO `pt_blog` (`post_id`, `post_title`, `post_slug`, `post_desc`, `post_category`, `post_meta_keywords`, `post_meta_desc`, `post_order`, `post_related`, `post_img`, `post_status`, `post_created_at`, `post_updated_at`, `post_visits`) VALUES
(17, 'Where to Eat in Rome During Holidays', 'Where-to-Eat-in-Rome-During-Holidays', '<p>UPDATED FOR 2014! There is a widely held misconception that during the Christmas and New Year&rsquo;s holidays, Rome&rsquo;s restaurants shut down and people who don&rsquo;t have the luxury of eating at home are left to scavenge for food wherever they can get it. While one should expect some venues to be closed and many to embrace limited hours and prix fixe menus, visitors to Rome can eat very well during the holidays. It just requires a bit of planning.</p>\r\n\r\n<p>To partake in the traditional Christmas Eve fish feast, head to Il Sanlorenzo, the best place in central Rome to find fresh, local and relatively sustainable fish. Il Sanlorenzo is open at lunch and dinner on Christmas Eve and New Year&rsquo;s Eve.</p>\r\n\r\n<p>A short stroll away on via dei Giubbonari, Roscioli will be open for lunch only on Christmas Eve and on New Year&rsquo;s Eve.</p>\r\n\r\n<p>For fine dining options, try Metamorfosi, which will be open at dinner on New Year&rsquo;s Eve and on New Year&rsquo;s Day, Pipero al Rex, which will be open at lunch and dinner on December 24, 25, 31, and at lunch only on January 1, or All&rsquo;Oro, which will be open throughout the holidays.</p>\r\n\r\n<p>For Roman fare, Cesare al Casaletto will be open for lunch only on December 25th, 26th and January 1st. Near the Vatican, Romeo will be open for lunch only on December 24 and for lunch and dinner on December 31. Flavio al Velavevodetto will be open for lunch on December 24, 25 and 31. Also in Testaccio, La Torricella is open for lunch on December 24. It is open December 24 for lunch, December 25 at lunch and dinner, and for lunch and dinner on New Year&rsquo;s Eve and New Year&rsquo;s Day.</p>\r\n\r\n<p>For international cusine, try Mesob, which will be open throughout the holidays</p>\r\n\r\n<p>A special event will take place at Vino Roma on December 25th at 6:00pm; Hande Leimer is offering a Christmas edition of her new tasting type Wine &amp; Cheese Dinner, with an even more interesting wine selection. For booking and details, visit the Vino Roma site.</p>\r\n\r\n<p>For craft beer check out Birra + in Pigneto, which will always be open, but will close at 8:30pm on Christmas Eve and on New Year&rsquo;s Eve, and Ma Che Siete Venuti a Fa&rsquo; in Trastevere, which will be open from the late afternoon every day this holiday season. These two watering holes are the only places on the list where reservations are not accepted and no food is served.</p>\r\n\r\n<p>It is also worth noting that most Kosher restaurants in the Ghetto will be open on Christmas Eve and Christmas Day.</p>\r\n\r\n<p>You can get the portable version of this list by purchasing my app &ldquo;Katie Parla&rsquo;s Rome&rdquo;, details here and be sure to call all venues in advance before turing up. While the aforementioned openings have been confirmed multiple times, non si sa mai (you never know what can happen!). Buone feste!</p>', 15, 'Where to Eat in Rome During Holidays', 'For Roman fare, Cesare al Casaletto will be open for lunch only on December 25th, 26th and January 1st. Near the Vatican, Romeo will be open for lunch only on', 1, '21,25,30,33', '619903_18.jpg', 'Yes', 1418754834, 1434658979, 28),
(18, 'Flavio Al Velavevodetto in Testaccio', 'Flavio-Al-Velavevodetto-in-Testaccio', '<p>Waaaay back in December 2012, I wrote&nbsp;<a href=\"http://www.parlafood.com/5-places-in-rome-that-need-to-step-up-their-game-in-2013/\" style=\"color: rgb(0, 128, 128); text-decoration: none; font-family: Georgia, \'Times New Roman\', Times, serif; font-size: 15px; line-height: 21px;\" target=\"_blank\">a post</a>&nbsp;in which I put&nbsp;<a href=\"http://www.ristorantevelavevodetto.it/\" style=\"color: rgb(0, 128, 128); text-decoration: none; font-family: Georgia, \'Times New Roman\', Times, serif; font-size: 15px; line-height: 21px;\" target=\"_blank\">Flavio al Velavevodetto</a>(and few other places) on notice. That year, Flavio, a Testaccio-based restaurant specializing in traditional Roman fare, had gone from being&nbsp;completely satisfying to wildly inconsistent, a change that was likely linked to opening a second restaurant, Velavevodetto ai Quiriti in Prati. Service glitches and food failures became increasingly common, which isn&rsquo;t unusual for a restaurant to suffer following expansion. Many readers and app users reported negative experiences&ndash;so I was concerned&ndash;but I remained optimistic that things would turn around.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Fast forward to December 2014 and Flavio al Velavevodetto has more than just rebounded. It has surpassed its earlier reputation and is one of the few places in Rome that manages to maintain an extremely high level of quality, both in its raw ingredients and its final dishes. Meat comes from the restaurant&rsquo;s own herds and flocks, while seasonal vegetables are cultivated on their land in northern Lazio. Ingredients are transformed into superb Roman classics like&nbsp;<em>polpette di bollito</em>&nbsp;(fried disks of shredded beef),&nbsp;<em>tonnarelli cacio e pepe</em>&nbsp;(fresh pasta with Pecorino Romano cheese and black pepper),&nbsp;<em>rigatoni alla carbonara, rigatoni alla gricia</em>&nbsp;(pasta with guanciale, Pecorino Romano cheese and black pepper),&nbsp;<em>fettucine con rigaglie di pollo</em>(fettucine with chicken innards),&nbsp;<em>coda alla vaccinara</em>&nbsp;(oxtail braised with tomato and celery),&nbsp;<em>coratella di manzetta maremanna</em>&nbsp;(veal heart, lungs and liver), and&nbsp;<em>trippa alla romana</em>&nbsp;(tripe cooked with tomato, Roman mint and Pecorino Romano), just to name a few of the menu&rsquo;s many highlights. The wine selection is wonderful, with a healthy number of quality organic wines from Lazio, plus some interesting natural wines from other Italian regions, which are well-suited to the cucina romana.</p>\r\n\r\n<p>Throw in a historic setting (the restaurant is based inside the&nbsp;<a href=\"http://www.turismoroma.it/cosa-fare/monte-dei-cocci?lang=en\" style=\"color: rgb(0, 128, 128); text-decoration: none;\" target=\"_blank\">Monte dei Cocci</a>, an ancient Roman archeological site) and Flavio al Velavevodetto is pretty close to perfect. There&nbsp;<em>are</em>&nbsp;still occasional missteps, especially regarding the service. As a regular, I don&rsquo;t experience many of the shortcomings app users and readers have cited in recent emails to me, but last week, a &euro;6 vegetable side dish, which was aggressively over-salted, appeared on the final bill after we reported it was inedible. Regardless of these occasional service glitches, the food and atmosphere are stellar and Flavio and his team are doing some of the finest&nbsp;<em>cucina romana</em>&nbsp;anywhere. Bump it to the top of your Rome dining list, if it&rsquo;s not already there.</p>\r\n\r\n<p><a href=\"http://www.ristorantevelavevodetto.it/\" style=\"color: rgb(0, 128, 128); text-decoration: none;\" target=\"_blank\">Flavio al Velavevodetto</a><br />\r\nVia Monte di Testaccio 97<br />\r\n+3906 574 4194<br />\r\nOpen: Daily, including holidays</p>', 15, 'Flavio Al Velavevodetto in Testaccio', 'Waaaay back in December 2012, I wrote a post in which I put Flavio al Velavevodetto(and few other places) on notice. That year, Flavio, a Testaccio-basedTestaccio میں فلاویو امام Velavevodetto', 2, '17,25,30,35', '321137_17.jpg', 'Yes', 1418755395, 1434659265, 27),
(19, 'The Tiber River’s Last Eel Fishermen', 'The-Tiber-River-s-Last-Eel-Fishermen', '<p>Cesare and Alfredo Bergamini have been fishing for eels in the Tiber since 1947. Now 74 and 77, respectively, the brothers learned the profession from their grandfather. In post-war Rome, they shared the water with other eel fishermen&ndash;and a great deal more eels. But falling eel stock caused by pollution coupled with spiraling profitability due to collapsed demand has driven others away from the trade.</p>\r\n\r\n<p>On a recent visit to the Bergamini brothers&rsquo; dock in Mezzocamino in southwestern Rome, Cesare recounted his daily routine while repairing his handmade nets. He goes out in his dinghy (water conditions permitting) at 7:00 each morning to check his eel traps, around 300 hand-crafted funnel-like nets. He said the quantity of eels they catch depends on the river level. Last week, the Tiber had risen more than 4 meters due to heavy rains, which meant Cesare couldn&rsquo;t lay his nets and it was impossible to catch anything.</p>\r\n\r\n<p>Decades ago, his haul on a good day would have been several hundred kilos, while today the catch is severely diminished. Cesare explained that the eels he catches are healthy and adapt to the Tiber&rsquo;s conditions. But the use of acidic compounds to purify the water upriver have decimated the eel&rsquo;s food stock, dramatically decreasing their number. He ponders this ecological crime while darning a net with a homemade needle. It&rsquo;s just one offense of many against the river, he explains. He gestures to a collapsed embankment downriver, cursing the expensive public work that was doomed to fail due to its location and currents. Local authorities mismanage the Tiber and make decisions about its maintenance that affect the river&rsquo;s ecosystem without consulting the very people who know the river best. It&rsquo;s an often told tale of the city&rsquo;s exploitation of its resources and people. The balance of the river is constantly threatened, but the Bergamini brothers and their eels bear witness to this harsh reality and survive.</p>', 16, 'The Tiber River’s Last Eel Fishermen', 'Cesare and Alfredo Bergamini have been fishing for eels in the Tiber since 1947. Now 74 and 77, respectively, the brothers learned the profession from their', 3, '17,18,32,33', '545166_16.jpg', 'Yes', 1418755562, 1434658746, 40),
(20, 'Hotel Review: DOM Hotel In Rome', 'Hotel-Review-DOM-Hotel-In-Rome', '<p><small>A very pricey cocktail in progress on the roof of the new-ish DOM Hotel.</small></p>\r\n\r\n<p>The DOM Hotel, a five-star luxury retreat, opened on Via Giulia in central Rome a little less than a year ago. The place is a good value, in relation to its category, and the location is hard to beat. I weigh DOM&rsquo;s pros and cons in this Sunday&rsquo;s NYT Travel section (or read online&nbsp;<a href=\"http://www.nytimes.com/2014/11/30/travel/hotel-review-dom-hotel-in-rome.html?ref=travel\" style=\"color: rgb(0, 128, 128); text-decoration: none;\" target=\"_blank\">here</a>).</p>', 15, 'Hotel Review: DOM Hotel In Rome', 'A very pricey cocktail in progress on the roof of the new-ish DOM Hotel.', 4, '17,18,19,33', '59021_15.jpg', 'Yes', 1418755821, 1434658449, 25),
(21, 'Mordi e Vai in the Testaccio Market', 'Mordi-e-Vai-in-the-Testaccio-Market', '<p>Sergio Esposito preparing a panino all&rsquo;allesso.</p>\r\n\r\n<p>When the new Mercato di Testaccio opened in July 2012, vendors and shoppers did not universally rejoice. Higher rents, a less convenient location, a sterile atmosphere and a competing weekend farmers&rsquo; market nearby were among the complaints. But in the two and a half years since the structure&rsquo;s inauguration, the market has proven to be a success on many counts, especially for the new opportunities it has created for vendors: Da Aretnio (Box 90) sells biodynamic wines selected by Jonathan Nossiter and wood fired baked goods from Lariano; Dess&rsquo;art (Box 66) sells Sicilian sweets and savory snacks, including cannoli filled to order and panelle, generously salted. But the single most important innovation can be found at Mordi e Vai (Box 15), where Sergio Esposito, a retired butcher, serves sandwiches and side dishes made from family recipes.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><small><em>Panino con l&rsquo;allesso alla picchiap&ograve;</em></small></p>\r\n\r\n<p>Visit Sergio in the Testaccio Market from Monday through Friday from 8:00am until 2:30pm. Get all the meaty things and whatever you do, don&rsquo;t wear white.</p>\r\n\r\n<p><a href=\"http://www.mordievai.it/\" style=\"color: rgb(0, 128, 128); text-decoration: none;\" target=\"_blank\">Mordi e Vai</a><br />\r\nMercato di Testaccio Box 15<br />\r\nVia Beniamino Franklin 12E<br />\r\nTel: +39 3391343344<br />\r\nOpen: Mon-Sat 8:00am-2:30pm</p>', 15, 'Mordi e Vai in the Testaccio Market', 'Sergio Esposito preparing a panino all’allesso.', 5, '18,19,23,24', '188111_14.JPG', 'Yes', 1418755976, 1434658342, 8),
(22, 'Gluten Dining & Food Shopping in Rome', 'Gluten-Dining-Food-Shopping-in-Rome', '<p>Pastries at Sans de Bl&eacute; in San Paolo.</p>\r\n\r\n<p>In spite of Rome&rsquo;s reputation as an epicenter of gluten consumption, the Italian capital is actually very in tune to celiac needs and a growing number of businesses are dedicated to providing gluten free food and beverages. A handful of gelato shops (including all Fatamorgana locations) are certified gluten free and there is plenty of gluten free pasta, pizza, beer and pastries to be found if you know where to look.</p>\r\n\r\n<p>The Lazio branch of the Italian Celiac Association has created this map, which is regularly updated and lists gluten free venues, from restaurants and gelato shops to hotels and highway rest stops. Additionally, all pharmacies and many supermarket and grocery chains (including Conad, Carrefour, SMA, Coop, Auchan, Castroni, and La Capra Rampante) sell gluten free food and ingredients. Here&rsquo;s a round up of some gluten free shopping and dining options in Rome:</p>\r\n\r\n<p>Celiachiamo: Grocery Store<br />\r\nVia Giulio Venticinque 32 (Trionfale)<br />\r\nTel: 0639754621<br />\r\nOpen: Tues-Fri 9:30am-1:30pm &amp; 3:30-7:30pm, Sat 9:30am-7:30pmo</p>\r\n\r\n<p>Celiachiamo: Bakery<br />\r\nVia Carlo Caneva 40 (Trionfale)<br />\r\nTel: +39 0664260188<br />\r\nOpen: Mon 3:30-8pm, Tues-Thurs 10:00am-8:00pm, Fri-Sat 10:00am-9:30pm</p>\r\n\r\n<p>Celidoc: Grocery Store<br />\r\nVia Livorno 27 (Piazza Bologna)<br />\r\nTel: +39 0644243749<br />\r\nOpen: Mon-Fri 9:30am-1:30pm &amp; 4:30-8:00pm, Sat 9:30am-1:00pm &amp; 4:30-7:00pm</p>\r\n\r\n<p>New Food: Bread &amp; sweets bakery<br />\r\nLargo Alberto Pepere 25/26 (Monteverde)<br />\r\nTel: +39 0658230394<br />\r\nOpen: Mon-Fri 8:30am-8:30pm, Sat 8:30am-1:30pm</p>\r\n\r\n<p>Sans de Ble&rsquo;: Pastry shop<br />\r\nVia G. Chiabrera 58/C (San Paolo)<br />\r\nTel +39 0664650277<br />\r\nOpen: Tues 2:00-7:30pm, Wed-Sat 9:00am-7:30pm &amp; Sun 9:00am-1:30pm</p>', 15, '', '', 6, '18,19,20,21', '476685_13.jpg', 'Yes', 1418756045, 1434658198, 28),
(23, 'Trapizzino, Rome’s OG Street Food', 'Trapizzino-Rome-s-OG-Street-Food', '<p>Rome&rsquo;s rapidly growing trend,&nbsp;<em>&ldquo;lo street food,</em><em>&rdquo;&nbsp;</em>seems unstoppable. I&rsquo;m not talking about food trucks, which really really don&rsquo;t work or exist here the way the do in other cities, nor the ubiquitous pizza by the slice joints. I&rsquo;m referring to a different approach to marketing food in which takeaways, cafes and restaurants&nbsp;peddle (relatively) inexpensive, portable snacks.</p>\r\n\r\n<p>Of course, Rome has a long history of pizza by the slice,&nbsp;<em>panini, suppl&igrave;</em>&nbsp;and other small bites that might be collectively called&nbsp;<em>cibo da strada</em>. But&nbsp;<em>&ldquo;lo street food&rdquo;</em>&nbsp;is something else&ndash;a new impulse in food production and distribution. Even its English moniker sets it apart from Rome&rsquo;s established, indigenous models.</p>\r\n\r\n<p>While the city&rsquo;s street food movement is in full swing, even its pioneer is getting in on the action. Stefano Callegari invented the&nbsp;<em>trapizzino</em>&nbsp;at his pizza by the slice joint, 00100, in 2008. 00100 shuttered this past winter and reopened and rebranded under the name Trapizzino, referring to its main offering.</p>\r\n\r\n<p>The name&nbsp;<em>trapizzino</em>&nbsp;is a play on words, combining&nbsp;<em>tramezzino</em>&nbsp;(a triangular sandwich served in cafes) and&nbsp;<em>pizza</em>. Unlike the&nbsp;<em>calzone</em>&nbsp;or&nbsp;<em>calzoncino</em>, the bread for a<em>trapizzino</em>&nbsp;is baked separately, then stuffed with the requested filling to order. The fillings are mainly rooted in the Roman classics, but the concept takes cues from other Italian cities where street food culture is strong. &ldquo;Florence has its many tripe stalls, and Palermo is famous for spleen sandwiches,&rdquo; Mr. Callegari said. &ldquo;I think this way of eating tripe and oxtail in Rome can eventually become a local custom like those.&rdquo;</p>\r\n\r\n<p>Back in the days of 00100, the bread was toasted before being filled but now that&rsquo;s not always the case. This is an unfortunate change. So is the purely industrial beer selection. While the&nbsp;<em>trapizzino</em>&nbsp;experience was a bit better back then, they are still pretty delicious. Fillings are more numerous than ever and Roman classics like tongue in parsley sauce and chicken with bell peppers have been joined by burrata and anchovies and&nbsp;<em>zighini</em>, welcome innovations in the realm of Rome&rsquo;s OG street food.</p>\r\n\r\n<p><br />\r\nVia Giovanni Branca 88 (Testaccio)<br />\r\nPiazzale di Ponte Milvio 13 (Ponte Milvio)</p>\r\n\r\n<p>More on Trapizzino in</p>', 15, 'Trapizzino, Rome’s OG Street Food', 'Rome’s rapidly growing trend, “lo street food”, seems unstoppable. I’m not talking about food trucks, which really really don’t work or exist here the way the do in', 7, '19,20,21,22', '637421_12.jpg', 'Yes', 1418756419, 1482834324, 42),
(24, 'Kinda 2,000 Years After His Death', 'Kinda-2-000-Years-After-His-Death', '<p>Today marks the 2,000th anniversary of the Augustus&rsquo; death. In a city in which more than a few great leaders have drawn on the lessons of the emblematic first Emperor, you might expect some actual fanfare. But this is 21st century Rome, and for a myriad of reasons, the city has chosen a predictable path and undertaken a series of underwhelming and poorly publicized events to commemorate Augustus two millenia after his demise. Tonight at the Ara Pacis Museum (a controversial but totally spectacular building), the original colors of the first century BC altar within will be projected onto the monument. Pretty cool, I guess. But it&rsquo;s been done before. What would Augustus think about recycling an old exhibit for this occasion?</p>\r\n\r\n<p>I doubt he&rsquo;d be pleased to know that his Mausoleum, the massive monument that he invested quite a lot of effort building, and where his ashes where ultimately interred, was open to a mere 90 people this morning. That&rsquo;s right, three visits of 30 people each were all the city could muster in the very place where the Emperor&rsquo;s remains were laid to rest 2000 years ago.</p>\r\n\r\n<p>There are a handful of other events taking place throughout the year: The Art of Command: The Legacy of Augustus is at the Ara Pacis Museum through September 7; there is a night-time &ldquo;show&rdquo; in the Forum of Augustus that uses lights and projections to recreate the space as it looked during the Emperor&rsquo;s reign; Trajan&rsquo;s Markets will host Augustan era Latin poetry readings on August 30 and 31 and the Keys to Rome: The City of Augustus exhibition from September though early 2015.</p>\r\n\r\n<p>The role of Augustus in shaping Imperial Rome and the city we experience today cannot be understated. His reign had a lasting impact almost unparalleled in ancient history, with his name becoming synonymous with the Empire. On the 2000 year anniversary of this great icon&rsquo;s death, the city of Rome had a tremendous opportunity to celebrate the magnificent cultural patrimony inherited from the Augustan age. They blew it, of course, along with the potential to draw millions of tourists (and their euros) to Augustan monuments and museums. Such a number is not inconceivable; Mussolini attracted a million people to Rome for Augustus&rsquo; 2000th birthday celebration long before mass tourism and budget airlines. But instead (and predictably), the legacy of Augustus is overshadowed by apathy and laurel resting.</p>', 16, 'Kinda 2,000 Years After His Death', 'Today marks the 2,000th anniversary of the Augustus’ death. In a city in which more than a few great leaders have drawn on the lessons of the emblematic first', 8, '21,22,23,35', '929748_11.jpg', 'Yes', 1418757280, 1434657922, 25),
(25, 'Things To Do This Weekend', 'Things-To-Do-This-Weekend', '<p>Listen to two different forms of fusion concerts that make up this year&#39;s One World Many Musics, the annual Indian contemporary music concert series organized by the National Center for the Performing Arts, on Friday October 17 and Saturday, 18 October. Stringstruck, the band-fusion classic of India headed by Purbayan Chatterjee, will be presented at the NCPA Tata Theatre on Friday, from 19:00. Chatterjee plays the DWO, amended the sitar in the band, which also features percussionist Taufiq Qureshi, surfer Fazal Qureshi, Manas Chakrabarty bassist, keyboardist Atul Raninga, Tapas and oud player and guitarist Sanjoy Das rabab. Assamese folk-fusion band singer Papon and the East India Company will perform at the same venue on Saturday from 19:00. Tickets are priced at 300 rupees, 600 rupees and 900 per head each day. National Center for the Performing Arts, NCPA Marg, Nariman Point. Tel: 2282 022 4567.</p>\r\n\r\n<p>&bull; Move to the next heartbeat, the series of concerts organized by electronic Bhavishyavani Future Soundz in Bonobo, on Friday, October 17, at 22:00. Troja aka Roy and own Spacejams Trideep BFS aka Yohann Jamsandekar play sets. The registration fee is 300 rupees per head. Bonobo, Second Floor, Kenilworth Mall, off Linking Road, near KFC, Bandra (West). Tel: 2605 022 5050.</p>\r\n\r\n<p>&bull; Dance at the 13th edition of the Bass Camp, regular series of concerts of electronic dance music-heavy bass organized by Krunk in the Blue Frog on Friday October 17, 22:30. The line-up, with headquarters in the city of Sickflip aka DJ-producers Sarvesh Shrivastava, Ox7gen Aditya aka aka Ashok and EZ Riser Sohail Arora, is headed by Symbiz Sound (read our Q &amp; A with the duo here) Berlin . There is a registration fee of 600 rupees or 1,500 RIP cover charge per head for men; admission is free for women. Return to the place on Saturday October 18 from 22:30 for a little more courtesy clubbing Blot, the Delhi-based duo of electronic music producer and visual jockey Gaurav Malaker Avinash Kumar, at a promotional concert VH1 Supersonic, the festival of electronic dance music to be held in Goa in December. There is a registration fee of 600 rupees per head. Blue Frog, Mathuradas Mills Compound, Tulsi Pipe Road, Lower Parel. Tel: 6158 022 6158.</p>\r\n\r\n<p>&bull; capture sets Pentagram, The Raghu Dixit Project, Bhayanak Maut, SKRAT, Ankur Tewari and Sidd Coutto, Madboy / Mink and Avatar Sound vs DJ Sa when making the top of the Red Bull Tour Bus in Richardson and Cruddas on Saturday, October 18 from 17:00. See here for details.</p>\r\n\r\n<p>ART<br />\r\n&bull; Hey artist Sunil Gawde talk about how nature and socio-political issues inform their facilities in Mumbai weekly Junoon local event on Friday October 17 at 17:30. The talk is free. Kitab Khana, Ground Floor, Somaiya Bhavan, Mahatma Gandhi Road near Flora Fountain, Fort. Tel: 2288 022 8041.</p>', 18, 'Things To Do This Weekend', 'Listen to two different forms of fusion concerts that make up this year\'s One World Many Musics, the annual Indian contemporary music concert series organized', 9, '20,21,22,24', '298065_10.jpg', 'Yes', 1418760023, 1434657601, 15),
(26, 'The Art Of Fashion', 'The-Art-Of-Fashion', '<p>Designer Payal Khandwala, who launched her self-titled fashion label in 2012, will open her first store on Thursday, October 16. The 1,600 square foot place in Colaba&rsquo;s art gallery-filled Grants Building is split into a store and a studio where Khandwala and her team will work and where she will paint. While she&rsquo;s now more famous as a fashion designer who makes voluminous clothes in bold colours, forty-year-old Khandwala began her career as an artist. We interviewed the designer over email about her transition from art to fashion, her new store and how she likes to wear a sari and white shirt. Edited excerpts:</p>\r\n\r\n<p><strong>Why did you move from art to fashion?</strong><br />\r\nI think the seeds had been sown a long time ago. My mum used to sew my clothes and my grandmother hers, plus both painted very well but were never trained in either. Also, I studied fashion at SNDT (University) many years ago, before I jumped ship to art with a Bachelor in Fine Arts and Illustration from the Parsons School for Design, New York. And then just overnight an opportunity arose to show at Lakme Fashion Week in 2012. I agreed and it grew from there!</p>\r\n\r\n<p><strong>There are a lot of rich colours in your collection but no prints. Will we see something new at the store?</strong><br />\r\nYes, we&rsquo;ve worked on and developed prints, a first for the label. We kept them very simple, geometric and dramatic &ndash; an extension of the house aesthetic and easy to team with our signature separates. We also have a line of limited edition clothes, our classic shapes but in rich hand-woven silks and brocades, which we will stock only at the store.</p>\r\n\r\n<p><strong>Your collection stands out for comfortable silhouettes and ethnic fabrics and design. Is this your personal style?</strong><br />\r\nYes. It all started because I could never quite find the right combination of things I wanted in clothing &ndash; comfort, colour, proportions, drama. Something was always missing. Now I&rsquo;m more mindful of what I design, keeping in mind what other women want &ndash; different sizes and shapes within our design DNA. I love the dichotomy in things so I find fabrics that we attribute to India work perfectly in western silhouettes.</p>\r\n\r\n<p><strong>How have you designed your store?</strong><br />\r\nThe store also houses our studio and an area where I will paint, so in time my art work will most likely spill into the space. In addition to this, I&rsquo;m working on a mural that will alter and grow as time goes by. I designed the store space to be the opposite of the studio space, to echo that push and pull that I hope the clothing communicates, the masculine structured shapes with the lush jewel tones, the drapes and pleats. And because I designed the space and the clothes I think there&rsquo;s a synergy between both.</p>\r\n\r\n<p><strong>What&rsquo;s your favourite contemporary method of wearing a sari?</strong><br />\r\nI don&rsquo;t like messing with the sari too much; I think it&rsquo;s best in its original form. I like it belted sometimes and pleated flat and ironed for more structure if I&rsquo;m in that sort of a mood. Otherwise just a beautiful men&rsquo;s shirt in white or in any colour (worn as a blouse) can do the trick!</p>', 17, 'The Art Of Fashion', 'Designer Payal Khandwala, who launched her self-titled fashion label in 2012, will open her first store on Thursday, October 16. The 1,600 square foot place in', 10, '17,20,22,23', '319519_9.jpg', 'Yes', 1418760268, 1434657320, 13),
(27, 'Paradise Search Villa Extramoros', 'Paradise-Search-Villa-Extramoros', '<p>emember when I first saw pictures of Villa Extramuros. I thought they were so inspiring, like a contemporary house made into a home and finally into a hotel. Soon enough the pictures were all over internet, and abused by the name and the decor I thought of it as a faraway place, somewhere deep in South America. It was a very pleasing surprise to find out that it was in fact in the South of Portugal, which is next door to me in plane-language.</p>\r\n\r\n<p>It&rsquo;s always a strange experience, when you&rsquo;ve seen dozens of pictures of a place and you finally get to see it in person. In the case of Villa Extramuros it turned out to be so much more than these picture-perfect interiors. Until I had been there I hadn&rsquo;t grasped&nbsp;the surreal contrast between the architecture and its rural surroundings and I had no idea of the warm welcome I was going to receive.</p>\r\n\r\n<p>We&rsquo;re in the middle of the Alentejo, the heartland of Portugal. A peaceful and almost virgin place dotted with tiny white towns, flocks of sheep and olive trees. Lively Lisbon isn&rsquo;t so far geographically, but it does seem a million years away. You have to truly envision this sleepy countryside to imagine how bold does the white shape of the villa feels in these surroundings. But wait, because it is not&nbsp;<em>that kind</em>&nbsp;of modern, the one that&rsquo;s crushing everything around it. You soon find out that, in its own personal way, it&rsquo;s a part of its environment.</p>', 16, 'Paradise Search Villa Extramoros', 'emember when I first saw pictures of Villa Extramuros. I thought they were so inspiring, like a contemporary house made into a home and finally into a hotel', 11, '18,19,23,24', '85297_8.jpg', 'Yes', 1418760883, 1434657125, 19),
(29, 'Masra Matruh Egypt', 'Masra-Matruh-Egypt', '<p>always impressed by the slender silhouette of the minarets. They seem to add grace to even the most chaotic skyline (a common denominator for Egyptian cities!).<br />\r\nEven here, in Marsa Matruh, a small town on the Mediterranean coast, the white towers of the mosque seem impossibly tall and slim next to the waterfront buildings.</p>', 16, 'Masra Matruh Egypt', 'always impressed by the slender silhouette of the minarets. They seem to add grace to even the most chaotic skyline (a common denominator for Egyptian cities!).', 13, '17,20,21,24', '405518_7.jpg', 'Yes', 1418761039, 1434656986, 14),
(30, 'Graphic Tour Sri Lanka', 'Graphic-Tour-Sri-Lanka', '<p>sri Lanka doesn&rsquo;t have the same head-to-toe attitude to decor than India, it still holds surprising treasures if you take the time to look.<br />\r\nFrom the ancient frescoes of Sigiriya to Geoffrey Bawa&rsquo;s drawings, exotic woods patterns and whimsical traditional textiles, it&rsquo;s the same delicate and playful touch.</p>', 16, '', '', 13, '17,18,24,27', '791534_6.jpg', 'Yes', 1418761548, 1434656731, 24),
(31, 'It Wasn’t Supposed to Rain', 'It-Wasn-t-Supposed-to-Rain', '<p>It isn&#39;t supposed to rain in Ko Samui this time of year.&nbsp;</p>\r\n\r\n<p>I did a little research about Ko Samui before I decided to spend the end of the year here. December is supposed to be warm &ndash; make that hot &ndash; and mostly sunny. Typical afternoon rain storms, but not bad beach weather. I looked forward to lazy days in the sun, reading cheap novels and swimming in azure waters.&nbsp;</p>\r\n\r\n<p>However, Typhoon Hagupit apparently didn&rsquo;t read the same sources as I did. It parked itself over the Phillipines about a week before I arrived in Ko Samui, causing untold destruction and taking the lives of at least 27 people. After the typhoon had had its way with the Philippines, it moved off to the west, slowly losing power as it did so.&nbsp;</p>\r\n\r\n<p>Guess what is directly in the westward path of what is now Tropical Depression Hagupit? Yep, Ko Samui and me.&nbsp;</p>\r\n\r\n<p>Now this isn&rsquo;t some wimpy remnants of a storm. The wind was strong enough to knock over a half-full beer mug and break the glass. I watched a young man who worked at the hotel take a surfboard out and come back in less<br />\r\nWat Bo PhutWat Bo Phut<br />\r\nWat Bo Phut<br />\r\nthan five minutes with half a surfboard, never having gotten past the first line of breakers. This was surf that tossed around whole tree trunks, broke mooring balls from their anchorage and never apologized. I am NOT going swimming in that. At least not yet.&nbsp;</p>\r\n\r\n<p>I know a retired Anglican priest who tells me (with a certain amount of un-priestly glee) &ldquo;Man plans, God laughs.&rdquo; However, I am nothing if not adaptable, and I learned long ago that I won&rsquo;t melt in the rain, so I headed to the north side of the island to poke around.&nbsp;</p>\r\n\r\n<p>I went to the main road to flag down a songthaew, which is a pick-up truck with two bench seats fixed along either side of the bed. It is cheap transport and fairly reliable. As I was waiting in the drizzle for one to come along, a guy on a motorbike pulled up and offered to take where I wanted to go. Now riding on the back of a motorbike with a stranger on twisting roads and no helmet is challenge enough, but to do it in the rain for double the cost of a songthaew &ndash; well, that was easy&nbsp;<br />\r\nBo Phut stupaBo Phut stupa<br />\r\nBo Phut stupa<br />\r\nto turn down.&nbsp;</p>\r\n\r\n<p>The other cool thing about songthaews &ndash; other than the price &ndash; is the passengers. In the songthaew I flagged down there was a Thai lady with a basket of four Samoyed puppies. Samoyed puppies look like they belong in a toy store, they are so cute and fluffy. In addition to the puppies there was a Hungarian lady who wanted to practice her English, and six young men who could have passed for Muay Thai fighters.&nbsp;</p>\r\n\r\n<p>I was headed to Bo Phut on the northern coast. This is home to the Buddhist temple Wat Bo Phuttharem, Fisherman&rsquo;s Village, and, a bit to the east, Wat Phra Yai, also known as the Big Buddha Temple.&nbsp;</p>\r\n\r\n<p>At the Hungarian lady&rsquo;s urging, I got off at the Bo Phut wet market. There was lots of lovely fruit and one stall selling Good Wife cakes. This is a flaky pastry filled with wintermelon or lotus paste, and since this is one of my favorite pastries, I bought one. (I&rsquo;d show you a picture, but I ate it. It was good.) From there it was a short walk to Wat Bo Phuttharem.&nbsp;</p>\r\n\r\n<p>I like visiting Buddhist temples;&nbsp;<br />\r\ndetail of temple buildingdetail of temple building<br />\r\ndetail of temple building<br />\r\nthey are generally very calm and accepting places. Wat Bo Phuttharem confused me, though, and I haven&rsquo;t been able to find out much about it. The temple grounds are very spacious, and it looks like new buildings are going up. It is obviously not set up for tourists, no signs in any language other than Thai, and, while there were pavilions with Buddha images, none of the temple buildings were open like they are in the northern part of the country.&nbsp;</p>\r\n\r\n<p>I put a donation in the box for my birth year, and was startled when a pre-recorded chant came out. I&rsquo;m guessing that the weight of the coins set off the recording. Donation boxes are pretty common in temples, but I have never had one chant for me before&nbsp;</p>\r\n\r\n<p>There were elaborate tombstones lining the walls of the compound, something else I have never seen in a Buddhist temple. I&rsquo;ve been told that most Thais are cremated and their ashes commingled in concrete stupas around the temple. I&rsquo;ve seen name plaques in temples, so if a person has no offspring to pray for them they will have the prayers of the monks. I had never seen memorials&nbsp;<br />\r\nrevered monksrevered monks<br />\r\nrevered monks<br />\r\nsuch as these, each dedicated to a particular individual.&nbsp;</p>\r\n\r\n<p>Maybe it was my state of mind &ndash; well, probably it was my state of mind &ndash; but I failed to find my peace here. I walked up the road to Fisherman&rsquo;s Village, which is definitely a tourist area. Amidst the bars, T-shirt shops, and lots of mass-produced tat featuring elephants and Buddhas you may be able to find a whisper of the old fishing town, but I didn&rsquo;t see it.&nbsp;</p>\r\n\r\n<p>About five kilometers further down the road is Wat Phra Yai, more commonly known as the Big Buddha Temple. Big Buddha deserves an entry all its own, so that will be up next.&nbsp;</p>\r\n\r\n<p>In the meantime, here is the legend of the Good Wife Cake:&nbsp;</p>\r\n\r\n<p>Once upon a time, there was a very poor couple living in imperial China. They loved each other and lived in a small village. Suddenly, a mysterious disease spread through their village, and the husband&#39;s father became very sick.&nbsp;</p>\r\n\r\n<p>The couple spent all of their money in order to treat the man&#39;s father, but he was still sick. The wife sold herself as a slave in exchange for money&nbsp;<br />\r\ntemple buildingtemple building<br />\r\ntemple building<br />\r\nto buy medicine for her father-in-law. Once the husband learned about what his wife did, he made a cake filled with sweetened wintermelon and almond. He dedicated this pastry to his wife, whom he could never forget, and sold it in the street. His cake became so popular that he was able to earn enough money to buy his wife back.</p>', 16, 'It Wasn’t Supposed to Rain', 'It isn\'t supposed to rain in Ko Samui this time of year.', 14, '17,18,21,22', '835693_5.jpg', 'Yes', 1418761682, 1434656106, 45),
(32, 'South Africa: A Terminal Tyre', 'South-Africa-A-Terminal-Tyre', '<p>Jaap&rsquo;s tyre was not only down to the canvas, but through a couple of layers. As a result the 120km ride to Springbok was a rather tentative one. We did however arrive safely around lunchtime, and were hopeful of being able to track down a tyre for Jaap. However it was a Sunday and the day of Nelson Mandela&rsquo;s funeral, and the tyre outfit was of course closed. Miraculously we met someone who knew the owner and called him for us, but less miraculously he did not hold the tyre size we needed. We spent that afternoon and the Monday phoning around trying to find some way to get a tyre to Springbok urgently. I was running out of time before my flight to NZ, and was keen to explore the back roads on the way to Cape Town, rather than having to rush down. Unfortunately locating a tyre proved difficult, and it looked as if Jaap would get his tyre on Wednesday at the earliest. As Jaap was staying longer than me in South Africa and would have time to explore after Christmas, I decided to head off for an explore with him catching up so we could hit Cape&nbsp;<br />\r\nTerminal tyreTerminal tyre<br />\r\nTerminal tyre<br />\r\nAgulhas together.&nbsp;</p>\r\n\r\n<p>Someone a month or so previous had suggested that I head into the hills southeast of Clanwilliam, so I stopped there for petrol and got into a chat with a dreadlocked guy with a ute filled with children&rsquo;s toys that he was travelling around the country trying to sell. He suggested that I head for Wupperthal and then south from there. This proved to be an excellent suggestion. After winding my way up and over a pass I reached Wupperthal, an incongruous Germanic village in the middle of the Cederberg Mountains that had been founded by missionaries in 1830. After stopping for a snack from the town store, and then feeling quite out of place while I ate it, I followed a track on the GPS that looked interesting, but was slightly concerning in its ruggedness. I wanted to explore, but time was tight, and I didn&rsquo;t want to be stuck by myself in the middle nowhere. However, my concern faded away after making it over another pass and encountering the spectacular scenery of the Matjiesrivier Nature Reserve. Wow. Riding by yourself in isolated unfamiliar areas can sometimes be a bit nerve-wracking, but the thrill of having<br />\r\nThey went all out on the design and materials for this sign.They went all out on the design and materials for this sign.<br />\r\nThey went all out on the design and materials for this sign.<br />\r\na spectacular landscape to yourself, without encountering anyone else on the road for an afternoon makes up for what-ifs like: &ldquo;if I plummeted over that cliff no one would find me for days&rdquo;.&nbsp;</p>\r\n\r\n<p>I emerged later in the afternoon onto a larger gravel road, and soon after stumbled across the Cederberg Oasis, a guesthouse with camping which was tucked amongst a spectacular landscape of sedimentary hills tilted by intercontinental tectonic forces and eroded by the grinding of ancient glaciers. The landscape, pool, cold beer, hospitality, wrist-thick steaks, and massive KTM banner behind the bar, meant that even after the thrill of the day&rsquo;s ride, it truly felt like an oasis.&nbsp;</p>\r\n\r\n<p>The next morning I left with Werner, a biker from Cape Town, and we headed down through the arid environment of the Great Karoo and Little Karoo towards Cape Agulhas. Even with my blown rear shock the gravel roads were great fun, and I found that I would regularly end up being many minutes ahead of Werner &ndash; three months on the bike had meant that we had started to work pretty well together. This difference in pace was good, as it gave me a chance to stop,&nbsp;<br />\r\nNear the Cederbarg Oasis.Near the Cederbarg Oasis.<br />\r\nNear the Cederbarg Oasis.<br />\r\nturn off the bike, take my helmet off, and soak in the landscape.&nbsp;</p>\r\n\r\n<p>Farmland greeted us as we approached the coast, and we stopped for a beer with one of Werner&rsquo;s mates in Bredasdorp. Many a &ldquo;lekker&rdquo; was uttered before we left for a backpackers near Cape Agulhas. We shared an excellent burger dinner with an Icelandic couple on their honeymoon, and then washed it down with some impressive craft beer. The Icelander rode enduro competitively, and explained how they made ice tyres by drilling hundreds of screws through the tyres from the inside. I then received confirmation from Jaap that he would meet us there the next morning at around 10am for the ride to Cape Agulhas - brilliant.&nbsp;</p>\r\n\r\n<p>Jaap arrived as planned mid-morning. In tow was Kev, an Irishman on a BMW GS1200 who had chased us down the continent, asking questions as he went via the Horizons Unlimited forum and then Facebook. A bottle of bubbly was purchased in town before setting off for the cape, something that for me had grown in significance during the trip. On a trip like this you spend quite a bit of time within the confines of your helmet&nbsp;<br />\r\nCape AgulhasCape Agulhas<br />\r\nCape Agulhas<br />\r\nimagining the arrival at your goal. The trip was always about the journey rather than the destination, but despite the different landscapes, cultures, and climates, our goal remained constant - Cape Agulhas. Regularly my thoughts would drift to imagining the moment our southward progression would come to an end &ndash; at some point we would run out of Africa.&nbsp;</p>\r\n\r\n<p>At lunchtime, on the 19th December we did indeed run out of Africa. With a possibly misplaced sense of entitlement, we ignored the signs forbidding motorbikes from the path leading to the marker for the southern-most point of Africa and the official dividing line between the Atlantic and Indian oceans. Parked up with each of our bikes in front of a different ocean we popped the bubbly and savoured the moment. Rather than being a celebration of a goal, reaching Cape Agulhas allowed me to metaphorically look north and savour the many experiences we had had on the way through Africa: a taste of a new continent in Tunisia; war-torn and extraordinarily friendly Libya; ancient monuments and civil unrest in Egypt; endangered animals 4000m high in the Ethiopian highlands; deserted pyramids in the Martian deserts of Sudan; colourful thirsty tribesmen&nbsp;<br />\r\nChapman&#39;s PeakChapman&#39;s Peak<br />\r\nChapman&#39;s Peak<br />\r\nand the Hell Road in Kenya; Lake Tanganyika leading us from the winding roads of Burundi, through the wildlife of Tanzania, and ending with a Zambia fish feast; the corruption, red dirt road and jungle of the DRC; lightning storms, baobab trees, and a tough afternoon in the saddle in Botswana, mind-blowing landscapes, thrilling riding, a ghost town, and a living desert in Namibia; and finally a solo ride through the Cederberg and Matjiesrivier Nature Reserve here in South Africa.&nbsp;</p>\r\n\r\n<p>It felt good to be at Cape Agulhas, and while I could have easily turned north to head up the west coast of Africa, I was also missing Trace and Finn, and couldn&rsquo;t wait to see them in a few days for Christmas.&nbsp;</p>\r\n\r\n<p>A ride west under the monstrous looming cliffs along the coast got us near Cape Town, and as it was my last day on the bike I took a detour over the spectacular Chapman&rsquo;s Peak. This meant I entered Cape Town from the south, which was strange as for three months Cape Town had been the epitome of &ldquo;south&rdquo;.&nbsp;</p>\r\n\r\n<p>The next day I rode the bike to the shipping company and prepared her for&nbsp;<br />\r\nTable MountainTable Mountain<br />\r\nTable Mountain<br />\r\nthe seaward trip back home. She had been a brilliant steed, as fun and sure-footed on the tarmac as she was off-road. Apart from the blown rear shock and a choked fuel filter, she had tackled a whole continent without missing a beat. Packing her into a crate and leaving her with strangers seemed pretty ungrateful.&nbsp;</p>\r\n\r\n<p>My last full day in Africa was spent walking amongst the unique ecosystem at the top of Table Mountain. Bare-footed on the flat stone of the mountain, with the sun overhead and a spectacular view over Cape Town and the surrounding area made for a fitting way to say goodbye to Africa.&nbsp;</p>', 16, 'South Africa: A Terminal Tyre', 'Jaap’s tyre was not only down to the canvas, but through a couple of layers. As a result the 120km ride to Springbok was a rather tentative one. We did however', 15, '18,19,22,27', '96375_4.jpg', 'Yes', 1418761825, 1434655768, 26);
