(47, 29, 'en', 'FAQ', '<p><strong>Flights</strong><br />\r\nHow can I change my password?<br />\r\nTo change your password please follow the steps below, your new password will be sent to your e-mail address that you entered when you first created your membership account.</p>\r\n\r\n<p>Log into my account on our website.<br />\r\nYou will find on the left side of the page &quot;Change Password&quot;<br />\r\nCarry out the recommended steps then click &quot;submit&quot;<br />\r\nThe new password will be sent to your registered e-mail address immediately.<br />\r\nHow to select my destination?<br />\r\nYour destination can be selected by entering or typing the city name or IATA code in the appropriate box.</p>\r\n\r\n<p>How can I modify/cancel a previous booking?<br />\r\nYou can change/cancel your previous booking at any time, however the change of date or cancellation depends completely upon the terms and conditions of the airlines you have chosen, the fare and availability of your amended booking.</p>\r\n\r\n<p>Log into www.flyin.com<br />\r\nGo to my account and choose the itinerary that need to be cancelled then press cancel button.<br />\r\nWrite down the reason for cancellation<br />\r\nSubmit your request.<br />\r\nOur customer service team will review the terms and conditions that apply to your request and inform you about the cancellation policy.<br />\r\nThere is a possibility that additional service fee may be charged for cancellation/change of date depending upon the terms and conditions of the airlines.<br />\r\nYou can change/cancel your reservation by calling Flyin at<br />\r\nOur customer service agents are available 24 hours a day, 7 days a week.</p>\r\n\r\n<p>How can I access more information about hotels, car rentals and cruise arrangements?<br />\r\nFlyin.com offers hotel, car rental and cruise arrangements. You can reach our customer service team on +966 112246333 and they will gladly extend support regarding bookings, payment and others.</p>\r\n\r\n<p>What does online payment mean?<br />\r\nIt&#39;s the new booking service on Flyin.com that makes it easy and instant to pay and issue your ticket.</p>\r\n\r\n<p>What do I need for making an online payment?<br />\r\nAll that you need is to have a valid credit card.</p>\r\n\r\n<p>Once the payment is done, where can I get my tickets?<br />\r\nThe electronic tickets will be automatically issued; you can view and print the passenger receipt, invoice and e-ticket by</p>\r\n\r\n<p>logging into My account section on flyin.com homepage. It will also be sent to your email.</p>\r\n\r\n<p>What happens if I cancel my booking that I paid for online and collected my tickets?<br />\r\nBy cancelling the booking online, the refunded amount will be automatically deposited into your account; several charges might be applied for each passenger in the booking.</p>\r\n\r\n<p>After paying online, if I did not receive the ticket, what shall I do?<br />\r\nIf you did not receive your e-ticket within 24 hour or your flight is soon, please contact Flyin.com customer service team.</p>\r\n\r\n<p>Electronic ticket, what does it mean?<br />\r\nIt is the electronic form of a paper ticket and a method to document the sale where the e-ticketing record is stored in the airline database and it can be retrieved at any time. The passenger will be provided with an e-ticket receipt instead of the normal paper ticket.</p>\r\n\r\n<p>What&#39;s the value of e-ticketing?<br />\r\nTo provide passengers with the simplest, most efficient and convenient service.</p>\r\n\r\n<p>How is electronic ticket useful?<br />\r\nE-Tickets bring an array of benefits to passengers as no hardcopy tickets to be carried during the trip, no lost tickets, easier modification of ticket itineraries, faster refund process, faster check-in at airports and self-service kiosks. In addition, e-tickets can be purchased through more convenient channels (i.e. internet).</p>\r\n\r\n<p>What&#39;s the value of booking information while issuing an e-ticket?<br />\r\nHaving the proper booking information enables the airline to provide better customer service. Therefore, the passenger shall ensure that his/her name must be spelt as per the passport.</p>\r\n\r\n<p>Are there any additional requirements to issue e-tickets?<br />\r\nAs long as the passenger has spelt his/her name as shown on the passport and receives and maintain the e-ticket receipt, his journey is confirmed.</p>\r\n\r\n<p>Are there any additional requirements to issue e-tickets?<br />\r\nOne of the following identification documents must be presented<br />\r\n- Passport (must be available in all international flights)<br />\r\n- Residency ID<br />\r\n- National ID</p>\r\n\r\n<p>Do I have to carry a copy of the e-ticket receipt to check-in the flight?<br />\r\nWe recommend that you show the e-ticket receipt along with same form of identification. This will facilitate and speed up the check in process.</p>\r\n\r\n<p>Do I have to carry a copy of the e-ticket receipt to step in the airport?<br />\r\nWe recommend the passenger to always have a copy of their e-ticket receipt to be shown to airport security if requested.</p>\r\n\r\n<p><strong>Hotels</strong><br />\r\nDo children receive discounted prices?<br />\r\nThe policy regarding child reductions varies between hotels. Please be assured that whenever child discounts apply, it will be passed onto you.</p>\r\n\r\n<p>What does the total price includes?<br />\r\nThe price displayed is the total cost of the room/s requested for the duration of your trip. The price also includes flyin.com service fees.</p>\r\n\r\n<p>Can I book over the telephone?<br />\r\nYes, our customers should have the choice of either booking on our website or, if they prefer, over the telephone. Click here (contact us) for more information.</p>\r\n\r\n<p>Can I book without email address?<br />\r\nIf you do not have one, please contact our customer services team who will be glad to make a reservation on your behalf.</p>\r\n\r\n<p>Can I book on behalf of my friends or somebody else?<br />\r\nYes you can. You may make the reservation online or via our customer service team.</p>\r\n\r\n<p>Why is the hotel&#39;s rate different to when I last visited?<br />\r\nIn fact, flyin.com uses different hotel suppliers to give you the best prices and ongoing availability. Prices can change regularly based on supply and demand, hotel availability and currency fluctuations. However the price will not change after we receive the payment, thus we encourage you to place your reservation immediately.</p>\r\n\r\n<p>Will the photo of the room displayed on the site be the one I&#39;ll get?<br />\r\nPlease be aware that room size, design, fixtures, furnishings and facilities may vary from those shown on the photographs. Also please note that some hotels don&#39;t make modifications for a while that&#39;s why the photos may differ from the real.</p>\r\n\r\n<p>How late can I check in to a hotel?<br />\r\nMost hotels will allow check in at any time during the day, however check out is usually restricted to a specific time. Please consult your hotel and check their check out policy. However for late check in please contact the hotel directly and inform them with the situation, because some hotels consider it as &quot;No show&quot;.</p>\r\n\r\n<p>How do I know if my hotel booking is confirmed?<br />\r\nOnce you complete your booking payment, we will send the hotel voucher to your email immediately including the booking reference number. You can also access all the bookings you have placed with us online through the &#39;My Account&#39; section accessible via our homepage. After log in, you can review your travel itinerary and print additional copies of your hotel voucher.</p>\r\n\r\n<p>Do I have to re-confirm my booking?<br />\r\nYou do not need to re-confirm your booking either with us or with the hotel directly. If you have any questions related to your booking before your departure please contact our customer services team who will be happy to help.</p>\r\n\r\n<p>What documents do I need to check in at the Hotel?<br />\r\nYou will receive a confirmation email and voucher; print it before your departure and show it to the hotel receptionist to avoid any inconvenience. Some hotels ask for a valid credit card for any optional charges/fees.</p>\r\n\r\n<p>What are the methods of payment?<br />\r\nWe can only accept valid credit cards, debit cards and cash as methods of payment.</p>\r\n\r\n<p>Because your protection against the loss of money, you should review the valid payment methods to understand how you can select a payment method and how protection differs depending on your payment method.</p>\r\n\r\n<p>Should I be afraid to enter my credit/debit card details?<br />\r\nFlyin.com uses HSBC/SABB bank payment page which is fully secured and your credit card details will be encrypted (will be transferred into a secret code) once entered for your privacy.</p>\r\n\r\n<p>Flyin.com uses National bank of Egypt payment page which is fully secured and your credit card details will be encrypted (will be transferred into a secret code) once entered for your privacy.</p>\r\n\r\n<p>I have contacted the hotel and they don&#39;t have my reservation?<br />\r\nGenerally, your name will be sent within 72 hours before your arrival date. Please rest assured that the room is booked and we will be sending the guest names closer to the arrival date.</p>\r\n\r\n<p>What happens if my arrival is delayed?<br />\r\nMost of our hotel rooms will be held until 5am the following morning. However on certain occasions, the hotel will hold your reservation until 00.01 the day after your check in date. If your delay means that you will be arriving later than midnight we recommend you to either contact our customer services team or the hotel directly in order to make arrangements to hold your room for longer.</p>\r\n\r\n<p>How do I reach the hotel?<br />\r\nOnce your booking is complete, we will send the voucher that includes the hotel address, phone number and reference number. It is your responsibility to arrange travel to and from the hotel.</p>\r\n', '', '', NULL, '2021-04-20 04:22:12', 0),
(49, 31, 'en', 'Terms of Use', '<p>This Website is provided solely to assist customers in gathering travel information, determining the availability of travel-related goods and services, making legitimate reservations or otherwise transacting business with travel suppliers, and for no other purposes. the customer visiting the Website and/or booking a reservation through us on this Website, or through our customer service agents.</p>\r\n\r\n<p>This Website is offered to you conditioned upon your acceptance without modification of all the terms, conditions, and notices set forth below (collectively, the &#39;Terms of Use&#39; or &#39;Agreement&#39;). Please read the terms of Use carefully. By accessing or using this Website, booking any travel products or services on this Website, or contacting our call center agents, you agree that the Terms of Use then in force shall apply. If you do not agree to the Terms of Use, please do not use or make bookings through this Website or our call center agents. at any time change these Terms of Use and your continued use of this Website is conditioned upon acceptance of the updated Terms of Use.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>USE OF THE WEBSITE</strong></p>\r\n\r\n<p>As a condition of your use of this Website, you warrant that</p>\r\n\r\n<p>(i) you are at least 18 years of age and are of sound mind,&nbsp;<br />\r\n(ii) you possess the legal authority to create a binding legal obligation,<br />\r\n(iii) you will use this Website in accordance with the Terms of Use,&nbsp;<br />\r\n(iv) you will only use this Website to make legitimate reservations for you or for another person for whom you are legally authorized to act,<br />\r\n(v) you will inform such other persons about the Terms of Use that apply to the reservations you have made on their behalf, including all rules and restrictions;&nbsp;<br />\r\n(v) i all information supplied by you on this Website is true, accurate, current and complete, and<br />\r\n(vii) if you have an online account with this Website, you will safeguard your account information and will supervise and be completely responsible for any use of your account by you and anyone other than you. We retain the right at our sole discretion to deny access to anyone to this Website and the services we offer, at any time without notice and for any reason, including, but not limited to, for violation of these Terms of Use.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>PROHIBITED ACTIVITIES</strong></p>\r\n\r\n<p>use this Website or its contents for any commercial purpose;</p>\r\n\r\n<ul>\r\n	<li>make any speculative, false, or fraudulent reservation or any reservation in anticipation of demand;</li>\r\n	<li>access, monitor or copy any content or information of this Website using any robot, spider, scraper or other automated means or any manual process for any purpose without our express written permission;</li>\r\n	<li>violate the restrictions in any robot exclusion headers on this Website or bypass or circumvent other measures employed to prevent or limit access to this Website;</li>\r\n	<li>take any action that imposes, or may impose, in our discretion, an unreasonable or disproportionately large load on our infrastructure;</li>\r\n	<li>deep-link to any portion of this Website (including, without limitation, the purchase path for any travel services) for any purpose without our express written permission;</li>\r\n	<li>&#39;frame&#39;, &#39;mirror&#39; or otherwise incorporate any part of this Website into any other website without our prior written authorization.</li>\r\n	<li>The content and information on this Website (including, but not limited to, price and availability of travel services), as well as the infrastructure used to provide such content and information, is proprietary to us or our suppliers and providers. While you may make limited copies of your travel itinerary (and related documents) for travel or services booked through this Website, you agree not to otherwise modify, copy, distribute, transmit, display, perform, reproduce, publish, license, create derivative works from, transfer, or sell or re-sell any information, software, products, or services obtained from or through this Website. Additionally, you agree not to:</li>\r\n</ul>\r\n\r\n<p>If your booking or account shows signs of fraud, abuse, or suspicious activity, we may cancel any bookings associated with your name, email address, or account, and close any associated accounts. If you have conducted any fraudulent activity, we reserves the right to take any necessary legal action and you may be liable for monetary losses to, including litigation costs and damages. To contest the cancellation of a booking or freezing or closure of an account, please contact us Customer Service.</p>\r\n', '', '', NULL, '2017-07-04 16:19:46', 0),
(52, 34, 'en', 'How to Book', '<h4><strong>1. SEARCH</strong></h4>\r\n\r\n<p>Select your trip, type your departure and arrival cities, enter your travel dates and number of passengers.</p>\r\n\r\n<h4><strong>2. COMPARE</strong></h4>\r\n\r\n<p>Compare available airfares, sorted by cheapest price and departure time. Click &#39;Select&quot; to continue<br />\r\nOptional features include:<br />\r\n<strong>a)</strong>&nbsp;Search different days by using arrow tabs<br />\r\n<strong>b)</strong>&nbsp;Use filters on the left<br />\r\n<strong>c)</strong>&nbsp;Click on flight price for more flight information</p>\r\n\r\n<h4><strong>3. REVIEW</strong></h4>\r\n\r\n<p>Check and confirm your details, scroll down and select optional extras if required. Enter your email address and click &#39;Book Now&#39; at the bottom of the page to continue<br />\r\nOptional extras include:<br />\r\n<strong>a)</strong>&nbsp;Hotels<br />\r\n<strong>b)</strong>&nbsp;Cars<br />\r\n<strong>c)</strong>&nbsp;Travel Insurance</p>\r\n\r\n<h4><strong>4. CHECKOUT</strong></h4>\r\n\r\n<p>Add passenger information for all travellers in the space provided directly under your summary</p>\r\n\r\n<h4><strong>5. PAYMENT</strong></h4>\r\n\r\n<p>Complete payment with your preferred method, accept terms and conditions, and click &lsquo;Pay Now&rsquo; to finalise your booking</p>\r\n\r\n<h4><strong>6. CONFIRMATION</strong></h4>\r\n\r\n<p>A confirmation page will appear to confirm your booking was successful. You will also be sent a confirmation email within 24 hours which contains all your booking details and important travel information</p>\r\n', '', '', NULL, '2015-05-31 17:47:23', 0),
(53, 35, 'en', 'Privacy Policy', '<div>\r\n<p>This Privacy Policy governs the manner in which phptravels collects, uses, maintains and discloses information collected from users (each, a &quot;User&quot;) of the <a href=\"http://phptravels.com\">www.phptravels.com</a> website (&quot;Site&quot;). This privacy policy applies to the Site and all products and services offered by phptravels.</p>\r\n\r\n<p><strong>Personal identification information</strong></p>\r\n\r\n<p>We may collect personal identification information from Users in a variety of ways, including, but not limited to, when Users visit our site, place an order, and in connection with other activities, services, features or resources we make available on our Site. Users may be asked for, as appropriate, name, email address, mailing address, phone number, credit card information. We will collect personal identification information from Users only if they voluntarily submit such information to us. Users can always refuse to supply personally identification information, except that it may prevent them from engaging in certain Site related activities.</p>\r\n\r\n<p><strong>Non-personal identification information</strong></p>\r\n\r\n<p>We may collect non-personal identification information about Users whenever they interact with our Site. Non-personal identification information may include the browser name, the type of computer and technical information about Users means of connection to our Site, such as the operating system and the Internet service providers utilized and other similar information.</p>\r\n\r\n<p><strong>Web browser cookies</strong></p>\r\n\r\n<p>Our Site may use &quot;cookies&quot; to enhance User experience. User&#39;s web browser places cookies on their hard drive for record-keeping purposes and sometimes to track information about them. User may choose to set their web browser to refuse cookies, or to alert you when cookies are being sent. If they do so, note that some parts of the Site may not function properly.</p>\r\n\r\n<p><strong>How we use collected information</strong></p>\r\n\r\n<p>phptravels may collect and use Users personal information for the following purposes:</p>\r\n\r\n<ul>\r\n	<li><em>- To improve customer service</em><br />\r\n	Information you provide helps us respond to your customer service requests and support needs more efficiently.</li>\r\n	<li><em>- To personalize user experience</em><br />\r\n	We may use information in the aggregate to understand how our Users as a group use the services and resources provided on our Site.</li>\r\n	<li><em>- To improve our Site</em><br />\r\n	We may use feedback you provide to improve our products and services.</li>\r\n	<li><em>- To process payments</em><br />\r\n	We may use the information Users provide about themselves when placing an order only to provide service to that order. We do not share this information with outside parties except to the extent necessary to provide the service.</li>\r\n	<li><em>- To send periodic emails</em><br />\r\n	We may use the email address to send User information and updates pertaining to their order. It may also be used to respond to their inquiries, questions, and/or other requests. If User decides to opt-in to our mailing list, they will receive emails that may include company news, updates, related product or service information, etc. If at any time the User would like to unsubscribe from receiving future emails, they may do so by contacting us via our Site.</li>\r\n</ul>\r\n\r\n<p><strong>How we protect your information</strong></p>\r\n\r\n<p>We adopt appropriate data collection, storage and processing practices and security measures to protect against unauthorized access, alteration, disclosure or destruction of your personal information, username, password, transaction information and data stored on our Site.</p>\r\n\r\n<p>Sensitive and private data exchange between the Site and its Users happens over a SSL secured communication channel and is encrypted and protected with digital signatures.</p>\r\n\r\n<p><strong>Sharing your personal information</strong></p>\r\n\r\n<p>We do not sell, trade, or rent Users personal identification information to others. We may share generic aggregated demographic information not linked to any personal identification information regarding visitors and users with our business partners, trusted affiliates and advertisers for the purposes outlined above.</p>\r\n\r\n<p><strong>Changes to this privacy policy</strong></p>\r\n\r\n<p>phptravels has the discretion to update this privacy policy at any time. When we do, we will revise the updated date at the bottom of this page. We encourage Users to frequently check this page for any changes to stay informed about how we are helping to protect the personal information we collect. You acknowledge and agree that it is your responsibility to review this privacy policy periodically and become aware of modifications.</p>\r\n\r\n<p><strong>Your acceptance of these terms</strong></p>\r\n\r\n<p>By using this Site, you signify your acceptance of this policy and <a href=\"http://phptravels.com/terms-and-conditions\" title=\"terms and conditions\">terms of service</a>. If you do not agree to this policy, please do not use our Site. Your continued use of the Site following the posting of changes to this policy will be deemed your acceptance of those changes.</p>\r\n\r\n<p><strong>Contacting us</strong></p>\r\n\r\n<p>If you have any questions about this Privacy Policy, the practices of this site, or your dealings with this site, please contact us.</p>\r\n</div>\r\n', '', '', NULL, '2017-07-04 20:57:44', 0),
(54, 36, 'en', 'Booking Tips', '<p><strong>1. Time your booking.&nbsp;</strong>On any given day, prices can fluctuate based on whether the hotel thinks it will be able to fill its rooms for the night. Your best time to book is usually within 24 hours of the stay, when hotels slash prices to avoid vacant rooms, but that creates a lot of uncertainty and isn&#39;t ideal when you&#39;re traveling in an unfamiliar place.</p>\r\n\r\n<p>Thankfully, websites like TheSuitest.com can help you time your bookings so you get the best price without running the risk of not getting a room at all. The site allows you to&nbsp;<a href=\"http://travel.usnews.com/Hotels/USA/\" style=\"color: rgb(0, 94, 166); text-decoration: none;\">search for hotels</a>&nbsp;and predicts both room availability and price fluctuations.</p>\r\n\r\n<p><strong>2. Check for affiliation and other discounts.</strong>&nbsp;You may qualify for additional discounts simply by belonging to an association or organization. AARP and AAA are prototypical examples, but groups as diverse as the American Bar Association, the United States Billiard Association and even the Professional Disc Golf Association offer discounts on various hotel chains. Check with your professional organization, university or any other group you might belong to. Your credit card might also offer discounts &ndash; Visa Signature, for example, offers discounts and perks on a rotating cast of hotels.</p>\r\n\r\n<p><strong>3. Use rewards malls.&nbsp;</strong>When it comes time to finally book, utilize&nbsp;<a href=\"http://money.usnews.com/money/blogs/my-money/2013/08/12/5-tips-to-save-on-last-minute-summer-trips\" style=\"color: rgb(0, 94, 166); text-decoration: none;\">cash back and credit card rewards</a>&nbsp;to earn bonus rewards. For instance, ShopDiscover offers 5 percent cash back on Expedia, and topcashback.com gives 14 percent back on HotelClub. Keep in mind that while anyone can use cash back websites, you might need a credit card to access card issuers&#39; online malls.</p>\r\n\r\n<p><strong>4. Negotiate, not pay, for upgrades.&nbsp;</strong>Instead of booking the fanciest room in the place, reserve a lower-rate room and then ask for an upgrade. If you&#39;re traveling at an off-peak time, you have a higher chance of moving up to a vacant, better room at check-in.</p>\r\n\r\n<p>You can also try a number of&nbsp;<a href=\"http://money.usnews.com/money/personal-finance/articles/2013/05/21/5-budget-travel-tips-you-havent-heard-before\" style=\"color: rgb(0, 94, 166); text-decoration: none;\">tactics to score an upgrade</a>&nbsp;such as:</p>\r\n\r\n<ul>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Calling a manager to see what room is available (it usually helps to mention if it&#39;s a special occasion)</li>\r\n	<li>Showing up exactly at check-in time in hopes that your room won&#39;t be ready, and they&#39;ll have to upgrade you to a better, prepped room</li>\r\n	<li>Tipping in advance and asking nicely for an upgrade</li>\r\n</ul>\r\n\r\n<p>Here, too, your credit card can come in handy. The American Express Fine Hotels and Resorts booking tool gives room upgrades, resort credits and breakfast. Visa Signature and World MasterCard cardholders can also get special deals.</p>\r\n\r\n<p><strong>5. Keep an eye out for price drops.&nbsp;</strong>Savings don&#39;t stop when you book your hotel. As mentioned before, a room&#39;s price can fluctuate significantly, but not many people have the time or inclination to sit around hitting &quot;refresh&quot; to see if the nightly rate has dropped. Services like Yapta track the price of your room and let you know when it drops. Tingo goes a step further and actually rebooks the room for you, crediting the difference back to your account. It also keeps an eye on other rooms in the same hotel: If a better room&#39;s price drops below yours, the service will upgrade you even if your room&#39;s price didn&#39;t change.</p>\r\n', '', '', NULL, '2020-11-07 20:12:47', 0),
(64, 46, 'en', 'Become Supplier', '<h4><strong>A large, global audience</strong></h4>\r\n\r\n<p>We work directly with more properties than anyone else. From family-owned B&amp;Bs to resorts, we show your property to a large audience of travellers worldwide</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4>No registration fees, subscriptions or fixed costs</h4>\r\n\r\n<p>Registration with us is completely free. There are no sign-up or subscription costs.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4>Commission-based model</h4>\r\n\r\n<p>This means your property pays a percentage of each confirmed stay to us. This gets you access to our extensive advertising on search engines like Google, Bing and Yahoo, plus our more than 5,000 affiliate partner websites.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4>Your property details available in 41 languages</h4>\r\n\r\n<p>We are the top choice amongst travellers worldwide because we work with great properties and present them in a way that is locally relevant.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4>Multilingual, 24/7 assistance for our property owners and guests</h4>\r\n\r\n<p>Easily manage your listing and bookings with our simple online tools. Our dedicated support team is here round-the-clock to help &ndash; just in case.</p>\r\n\r\n<p>Apply today for supplier registration</p>\r\n', '', '', NULL, '2021-04-19 14:45:57', 0),
(66, 48, 'en', 'About Us', '<p>PHPTRAVELS&nbsp;providing the best and user friendly application to our customers, with extensive tools specially for online travel business from hotels booking to flights reservation, we also provide custom web solutions and services. With over 4 years of experience phptravels.com have unquestionably won a reputation for being a trusted source, a reliable partner and an expert in the area of online travel business applications.</p>\r\n\r\n<p>The combination of our services, 24/5 nonstop support, our pricing, friendly way of conducting business, and our compassionate corporate philosophy is very unique in today&#39;s business world. We pride ourselves on exceptional customer service and strive to build lasting relationships with our customers by making it easy and profitable for them to do business with us.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We value our clients and focus in customer satisfaction. That is why after-sale support is a key factor in our approach. With all this rich experience, now through PHPtravels we are bound to meet customer satisfaction and establish trust.</p>\r\n\r\n<p>If you are looking to enhance your online travel business, PHPtravels functions as the best one stop solution with user friendly interface and such a great features with prices that match your budget.</p>\r\n\r\n<p>To get in touch with us you can use our support desk system, or feel free to follow us on&nbsp;<a href=\"http://twitter.com/phptravels\" style=\"color: rgb(66, 139, 202); box-sizing: border-box; text-decoration: none; background-color: transparent;\" target=\"_blank\">Twitter</a>&nbsp;or&nbsp;<a href=\"http://www.facebook.com/travelbusiness\" style=\"color: rgb(66, 139, 202); box-sizing: border-box; text-decoration: none; background-color: transparent;\" target=\"_blank\">Facebook</a>. Please do not hesitate to contact us.</p>\r\n', '', '', '2014-04-01 08:26:13', '2020-11-07 20:12:26', 0),
(68, 48, 'ar', 'حول بنا', '<p>PHPtravels توفير أفضل وسهلة التطبيق ودية لعملائنا، مع أدوات واسعة خصيصا لقطاع السياحة والسفر على الانترنت من حجز الفنادق لرحلات التحفظ، كما نقوم بتوفير حلول وخدمات الويب المخصصة. مع أكثر من 4 سنوات من الخبرة phptravels.com فزنا دون شك سمعة لكونه مصدر موثوق، وهو شريك موثوق وخبير في مجال تطبيقات الأعمال عبر الإنترنت السفر.</p>\r\n\r\n<p>مزيج من خدماتنا، 24/5 الدعم دون توقف، والتسعير لدينا، بطريقة ودية من ممارسة الأعمال التجارية، وفلسفتنا الشركات الرأفة هي فريدة من نوعها للغاية في عالم الأعمال اليوم. ونحن نفخر على خدمة العملاء الاستثنائية ونسعى جاهدين لبناء علاقات دائمة مع عملائنا من خلال جعلها سهلة ومربحة بالنسبة لهم للقيام بأعمال تجارية مع لنا.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>نحن نقدر عملائنا والتركيز في رضا العملاء. هذا هو السبب في دعم ما بعد البيع هي عامل رئيسي في نهجنا. مع كل هذه التجربة الغنية، والآن من خلال PHPtravels ونحن ملزمون لتلبية رضا العملاء وبناء الثقة.</p>\r\n\r\n<p>إذا كنت تبحث لتعزيز قطاع السياحة والسفر على الانترنت، PHPtravels ظائف كأفضل حل واحد وقف مع واجهة المستخدم ودية ومثل هذه الميزات الرائعة مع الأسعار التي تتناسب مع ميزانيتك.</p>\r\n\r\n<p>للحصول على اتصال معنا يمكنك استخدام نظامنا مكتب الدعم، أو لا تتردد في متابعتنا على تويتر أو الفيسبوك. لا تترددوا في الاتصال بنا.</p>\r\n', 'keywords', 'description', NULL, NULL, 0),
