(73, 35, 'ar', 'سياسة الخصوصية', '<p>هذه هي المحطة الثانية في أسبوع ممتعة حقا. هناك مغامرات للحصول على كل صباح عندما كنا الأرض في مكان آخر، ولكن أيضا وقت ممتع على متن القارب نفسه.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>نادي ميد 2 يحتوي على بار مفتوح. نعم، وهذا يعني التدفق الحر للأشياء جيدة ... طوال اليوم. لذلك يجري على متن قارب الفرنسي، لديك ريكارد لفاتح للشهية في وقت الغداء إذا كنت على القارب في وقت الغداء ... وبينا كولادا من حوض السباحة قبل غروب الشمس، ومن الواضح النبيذ خلال وجبات الطعام. نحن في نهاية نصف الكرة الشمالي من نوفمبر، وذلك غروب الشمس في وقت مبكر في حوالي 17:30 كل يوم ... مع بعض وجهات النظر باردة جدا من شريط حوض سباحة على السطح الخلفي. قبل 18:00، وحان الوقت الشمبانيا ... كل ليلة طويلة. حسنا، أولا لقد حان الوقت دش والحصول على تغيير في المساء الواضح ... هذا لا يزال مكانا الفرنسي! وكما أننا جميعا الآن أن خلط المشروبات الكحولية المختلفة ليست فكرة عظيمة، وجدت مجموعة ممتعة من الناس على استعداد للذهاب على الشمبانيا طوال الليل، كل مساء، لوقت كبير ومتعة! أكثر من الإدخالات التالية من هذه المجموعة ممتعة حقا من الناس.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>تحذير قليلا، وكلوب ميد 2<br />\r\nكلوب ميد 2Club ميد 2<br />\r\nكلوب ميد 2<br />\r\nغير الفرنسية، وأنه يشعر. من 280 الضيوف على القارب هذا الأسبوع، وأنا لا أعتقد أن واحد لا يتكلم على الأقل بعض الفرنسية. سيكون من أسبوع مملة جدا إذا كنت يمكن أن يتكلم الإنكليزية فقط هنا ... وكما كنت قد تكون على علم ... الفرنسيين الذين يعيشون في فرنسا تمتص عندما يتعلق الأمر الكلام شيء آخر غير الفرنسية. كنت قد حذر بصدق!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>لذلك هذا الصباح، لقد حان الوقت الجزر العذراء البريطانية. لا أنا لا يأتي للعمل هنا. وجزر فيرجن البريطانية لا يقف فقط للشركات الخارجية ... أنها لا تقف جدا بالنسبة الشواطئ رائع، واليخوت، وجزر فيرجن البريطانية. لقد أبحرت كل ليلة طويلة من دومينيكا ... دومينيكا الكومنولث والفقراء .... جزر فيرجن البريطانية الإقليم البريطاني والأثرياء جدا.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>قضيت اليوم مع تييري .... نفس عمر لي، وعلى استعداد لدينا بعض المتعة في هذا الاسبوع. لأنه في نهاية المطاف نحن نعرف انك لا تجد السيدات واحدة في الثلاثينات من العمر على هذه الرحلات البحرية ... ونحن نعلم أننا في حاجة للحصول على المنظمة أن تفعل شيئا آخر غير قراءة الكتب لدينا! لم أفعل واجبي نحو من باهيا بلانكا. I كيو الغوص كان متوسط، وأن كروز كان غداء BBQ من جراد البحر المنظمة بالنسبة لنا على<br />\r\nالوقت جراد البحر جراد البحر ... الوقت ...<br />\r\nجراد البحر الوقت ...<br />\r\nالشاطئ! حتى أخذنا &quot;beacher&quot; مع نية للذهاب ببساطة على الشاطئ للصباح.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>كان هناك مكوك إلى &quot;أ&quot; الشاطئ تؤجر للصباح التي كتبها كلوب ميد. وضعناها بجانب السائق الراستا ... نعم الرجل ... وسقط لنا على الطريق. كان ذلك خارج الخطة، تماما من فراغ! كان الوقت قد حان بالنسبة لنا للذهاب استكشاف الحديقة الوطنية &quot;الحمامات&quot;. هذا هو نوع من الحديقة الوطنية ... بل هو سلسلة من الشواطئ مفصولة الصخور الجرانيت. أود في البداية شعرت في جزر سيشل ... قبل جدت نفسي إلى حد ما في نوع من ارتفاع مغامرة للمراهقين على استعداد لبعض المرح خطيرة. نجاح باهر، وهذا المكان مدهش!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>قضينا كل صباح يذهب من الشاطئ إلى الشاطئ وتسلق تلك الصخور الضخمة ... حتى التخبط على الشواطئ المهجورة كما تجول إذا كنا فقط على درب الصحيح. المياه كانت جميلة ودافئة .... كانت اليخوت حولها، وكان مجرد متعة سهل الكاملة ... بسيطة!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>نحن في طريقنا إلى الشاطئ كلوب ميد، تماما في الوقت المحدد للمكوك الماضي. فكرة جيدة، كما كان لدينا أي فكرة من أين كانت BBQ، ورحلة العودة إلى<br />\r\ncolada بينا القليل من تجمع ... colada بينا شيئا التجمع ...<br />\r\ncolada بينا القليل من تجمع ...<br />\r\nكانت نقطة هبوط الرحلة تماما سيرا على الأقدام. جراد البحر BBQ! ببساطة لا يمكن ان يكون سيئا فقط بالمناسبة يبدو. وكان آخر هذه ... التدفق الحر للردة النبيذ ... من سلطة، ونعم، من جراد البحر أيضا! كانت الشمس هناك، في نهاية الغداء ... وجوهنا انتهت نفس لون الكركند على استجواب .... ولكن مرة أخرى ... كان متعة!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>العودة على متن القارب قبل الحشود لقيلولة جيدة وبعض الوقت حمام السباحة. لا أن 280 ضيوف يجعلك تشعر مزدحمة في مثل قارب الشراع ضخمة ... ولكن الطابور هو ببساطة الحقيقة ليست لدينا شيء.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>آخر ليلة ممتعة حقا تنتظر منا ... وشراع قصيرة إلى أرض العم سام ... أو جميلة قريبة من هذا الواقع، لمغامرة أخرى متعة ... الذي سوف يكون لي لكتابة قريبا جدا!</p>\r\n', 'شواطئ عذراء غوردا و ', 'هذه هي المحطة الثانية في أسبوع ممتعة حقا. هناك مغامرات للحصول على كل صباح عندما كنا الأرض في مكان آخر، ولكن أيضا وقت ممتع على متن القارب نفسه.', NULL, NULL, 0),
(74, 34, 'ar', 'الثقافات المستقلين', '<p>في عالم غير متجانسة بشكل متزايد والثقافات المستقلين والأماكن المثيرة للاهتمام بشكل خاص. على الأرجح نتيجة لذلك في العزلة الجغرافية من كل من البر الرئيسى أوروبا وأمريكا الشمالية، وأيسلندا اتخذت دوما انها مسار فريدة من نوعها. العمارة الأيسلندية والأزياء هي انعكاس لانها جغرافيا غير عادي، لوحة الآيسلندي هو أكثر راحة عندما يتم علاجه المكونات المحلية الجودة، مثقف، المخمرة، أو مخلل، والشعب الأيسلندي عربد في الاكتفاء الذاتي والاستدامة البيئية. أيسلندا كانت دائما متجذرة في الحساسيات الليبرالية الشمال، ولكن على عكس أي دولة أخرى، رفضوا لإنقاذ بنوكها بعد ركود عام 2008، في عام 2009 انتخبوا أول امرأة تتولى رئاسة الوزراء مثلي الجنس علنا ​​في العالم وفي عام 2010، انتخب ريكيافيك جون Gnarr، مغنية الروك فاسق، والكوميدي، والنفس أعلنت فوضوية كمحافظة الخاصة بهم. المشهد المادي كما ضرب وفريدة من نوعها في الثقافة نفسها. جزيرة مغطاة في الصخور البركانية السوداء، والحقول الخضراء، والمخارج الطاقة الحرارية الأرضية والبراكين الهائلة. وكان مع هذا في الاعتبار، أن دني، هنري وركبت الطائرة للريكيافيك خلال عطلة عيد الفصح، حيث أننا سوف تنفق 9 أيام السباحة في برك الساخنة، والقيادة من خلال المضايق، وأكل لذيذ سكير (الزبادي الايسلندي).</p>\r\n\r\n<p>أيسلندا مكلفة. كما<br />\r\nالمشي لمسافات طويلة بالقرب Eyjafjallaj&ouml;kullHiking قرب في Eyjafjallaj&ouml;kul<br />\r\nالمشي لمسافات طويلة قرب في Eyjafjallaj&ouml;kul<br />\r\nوسيلة للتخفيف من تكاليف تضمنت خطتنا استئجار سيارة قديمة، صدئ ولكن يمكن الاعتماد عليها أساسا من Sadcar (أ يارس 2002 مع 280،000 كم)، والطبخ 2 من 3 وجبات يوميا في استئجار شقة لدينا مع محلات البقالة مكافأة العلامة التجارية والقيام بالتسوق أقل قدر بقدر الإمكان. على المشي من خلال الجمارك بدأت لديها بعض التحفظات الطفيفة عن خطتنا أن الميزانية الموجهة عندما كنا في استقبال ما أفترض هو واحد من اثنين من الموظفين Sadcar الذي أخذنا إلى quonset في حقل 10 دقيقة من المطار. عندما سألنا عن carseat لهنري، فإنها توجه لنا إلى الجزء الخلفي من الجسم السيارات مقبرة شوب / تأجير السيارات حيث تستخدم 3 جدا وجلس carseats كسر طفيف بين الخمارات وسوائل التبريد. دني اختار أكثر وظيفية من الكثير، وتحميلها في موقعنا Sadcar وأقلعت نحو ريكيافيك خلال عاصفة ثلجية طفيفة.</p>\r\n\r\n<p>وتقع لدينا القليل شقة ايكيا تماما أسفل الشارع من Hallgrimskirka، والكنيسة اللوثرية spired التي توفر بوصلة للمسافرين استكشاف المدينة. وكان هذا المكان رائع أن يكون كقاعدة المنزل، كما تم إنفاق معظم دينا الصباح يتساءل الشوارع<br />\r\nهانك وأنا داخل HarpaHank وأنا داخل Harpa<br />\r\nهانك وأنا داخل Harpa<br />\r\nمن البلدة القديمة حيث منازل متجاورة ملونة مع المساحات التجارية الطابق الأرضي توفر وسط مدينة نابضة بالحياة والمشاة تنتشر فيه محلات سجل مع الأرائك مريح وإسبرسو مجانا (12 TONAR) والتصميم والأثاث محلات الأيسلندية والمقاهي النباتية والحانات والنوادي والمنازل الكاري. قمنا بزيارة جميع المواقع الثلاثة لمتحف الفن ريكيافيك (Hafnarhus، Kjarvalsstadir، Asmundarsafn) حيث يعمل ما بعد الحداثة من ERRO والتكعيبية والمناظر الطبيعية مجردة من Kjarval شنق بجوار دوار المعارض من الفنانين الآيسلندي المعاصر. لقد عثر عليها في مطاردة بيضة عيد الفصح في اينار جونسون حديقة النحت، لعبت بطاقات في الصالات المترامية الاطراف داخل Harpa، وأخذ في متحف ريكيافيك التصوير (داخل المكتبة العامة)، ومتحف فايكنغ الملحمة، وبارك على ريكيافيك للطفولة و&quot; حديقة الحيوان &quot;(أكثر من حديقة للحيوانات الأليفة) وأخذ المصعد للمرصد في اللؤلؤة. والمدينة هي عالمية من المستغرب بعد تحتفظ الضيافة البلدة الصغيرة التي تعمل بمثابة تذكير بأن هناك فقط 120،000 شخص داخل حدود المدينة.</p>\r\n\r\n<p>على الرغم من التكلفة العالية لالحانات والمطاعم في مركز ريكيافيك تمكنا من العثور على عدد من المطاعم وبأسعار معقولة تقديم الطعام لذيذ والطازجة. وهنا بعض من توصياتنا: بابلو (مشوي<br />\r\nبيضة عيد الفصح هانت في اينار جونسون النحت GardenEaster البيض هانت في اينار جونسون حديقة النحت<br />\r\nبيضة عيد الفصح هانت في اينار جونسون حديقة النحت<br />\r\nهالجريمسكيركجا في الخلفية.<br />\r\nالجبن وحساء الطماطم)، C هو لكوكي (حساء محلية الصنع والسندويشات مع الجبن الكبير)، الغسيل كافيه (تراوت البحيرة مع الخضروات الجذرية كان ممتازا ومنطقة للعب الأطفال في الطابق السفلي هو ما لمح!)، Austur الهند Fjelagid (لذيذ ثالي نباتي)، Graen Kostur (شرق وحي الانصهار الغذاء الخضروات مع اثنين من خيارات الغداء يوميا). للمشروبات، مكروبار لديها الكثير من البيرة الحرفية المحلية على الاستفادة من (ساعة سعيدة 5-8 مساء). يبدو أن Labowski بار أيضا مثل مكان رائع ولكن كانت لديها التوافه حانة عندما كنا نسير في ذلك أننا لم يبق للشرب.</p>\r\n\r\n<p>لدينا Sadcar تمكن عدد من الرحلات اليومية من ريكيافيك. سافرنا إلى الشمال من خلال Hvalfjorour (الحوت المضيق)، ووقف للنزهة بالقرب من بعض المنحدرات. سافرنا إلى مدينة الطاقة الحرارية الأرضية في هافيراجيردي وعلى بركان ايافيالايوكول الشهير التي اندلعت في عام 2010 مما تسبب في الغاء الرحلات الجوية في جميع أنحاء أوروبا. سافرنا دائرة الذهبي مع توقف في السخان، Pingvellir الحديقة الوطنية وشلال Gulfoss. بمجرد ترك ريكيافيك الجغرافيا صارخ لكن مهيب مع الحقول الخضراء وتقاطعت مع الصخور البركانية السوداء، التلال، الممرات الجبلية شديدة الانحدار والبخار المتصاعد في الهواء من الفتحات الحرارية تنقيط المناظر الطبيعية في جميع أنحاء.</p>\r\n\r\n<p>دني<br />\r\nخارج LagoonOutside الزرقاء في البحيرة الزرقاء<br />\r\nخارج البحيرة الزرقاء<br />\r\nولقد جئت بسرعة لإدراك أن عند السفر مع طفل رضيع، وتجربة أكثر متعة للجميع إذا يدور عن التخطيط حول الطفل. وعلى الرغم من الحياة الليلية الأسطورية ريكيافيك قد دعا اسمي مرة واحدة أو مرتين، الأبوة والأمومة مع مخلفات بالتأكيد لا. على هذا النحو، قضينا قدرا كبيرا من وقتنا في أيسلندا غمر أنفسنا في الثقافة تجمع الحرارية. مع 122 المسابح و 17 في ريكيافيك حدها، ونحن جعل مهمتنا أن تسبح في بركة جديدة كل يوم. في ريكيافيك نحن سبح في Laugardalslaug، Sundhollin، Arbaejarlaug، Grafarvogslaug، Sudurbaejarlaug، وAsvallalaug. خلال رحلاتنا اليوم حول الجانب القطري الآيسلندي كان لدينا أيضا الفرصة للسباحة في بركة جميلة في Hverageroi، عاريا في Seljallalaug مهجورة تقع في واد تحيط به الجبال والشلالات، واليوم الأخير لنا في مكلفة ولكن المدهش بلو لاغون. 9 حمامات في 9 أيام. المياه في جميع حمامات العامة غير الكيميائية مجانا، يسخن من خلال الطاقة الحرارية الأرضية، وكلهم تقريبا لديهم عدد من &quot;الأواني الساخنة&quot;، وحمامات البخار، ممرات لممارسة السباحة وحمامات الاطفال، والشرائح المياه. حصلت على انطباع من وقتي جالسا في &quot;الأواني الساخنة&quot; الدردشة مع السكان المحليين أن الحمامات الحرارية مهمة<br />\r\nفي طريقها إلى تجمع الساخنة Seljvavellir في طريقها إلى حوض السباحة الساخن Seljvavellir<br />\r\nفي طريقها إلى تجمع الساخنة Seljvavellir<br />\r\nأماكن التجمعات لأفراد المجتمع. تحرك على حد سواء كبارا وصغارا بين مختلف تجمعات والتحدث علنا ​​مع الغرباء والأصدقاء. في لحظات حيث كان هنري غاضب أو التعب كنا نعرف دائما كنا في غضون بضع دقائق من تجمع حيث انه على الفور أن تتحول مرة أخرى إلى هانك يبتسم أصبحنا تستخدم ل. في حين أن حمامات جعلت بالتأكيد السفر في أيسلندا مع طفل رضيع أسهل بكثير، هو الشعب الآيسلندي الذي جعل حقا أيسلندا لغة صديقة للطفل. تقريبا كل مطعم ذهبنا إلى زيارتها منطقة لعب للأطفال، وكان هناك لافتات تشجع الرضاعة الطبيعية، وجميع البارات والحانات تسمح للأطفال. الشعب الآيسلندي كانت دافئة والمنتهية ولايته ولكن ليس بصوت عال أو البغيض وبغض النظر عن مكان ذهبنا، فإنه يبدو أنها قد فكرت في طرق لاستقبال الأطفال.</p>\r\n\r\n<p>على موقعنا على صباح النهائي في أيسلندا، ومشيت في الشارع من شقتنا لالتقاط الأقراص المدمجة زوجين في TONAR 12. جلست على الأرائك مريح لهم الاستماع إلى FM بلفاست وSeabear بينما هنري بالتفتيش من خلال مداخن. دون أن يطلب، والرجل الذي يدير المحل جلبت لي اسبرسو. التقطت دليل ريكيافيك من طاولة القهوة و<br />\r\nدني القيادة لدينا CarDennie حزين القيادة لدينا سيارة حزينة<br />\r\nدني القيادة لدينا سيارة حزينة<br />\r\nفتحت الكتاب إلى الصفحة الأولى لقراءة رسالة ترحيب رئيس البلدية للزوار. جون Gnarr (رئيس البلدية) تنبأ نسخته الأصلية في البلاد. قرأت،</p>\r\n\r\n<p>&quot;ولكن كيف يمكن أن يكون ذلك هذا البلد الحار جاء لامتلاك مثل هذا الاسم المتجمدة نعم، وتفسير ذلك بسيط:.. كان سوء فهم Ing&oacute;lfur Arnarson، الرجل الأول الذي وجدت ريكيافيك، وليس في طريقه هنا على الإطلاق وكان في طريقها إلى الولايات المتحدة الأمريكية، لشراء العنب وغيرها من الوجبات السريعة التي نمت البرية هناك في تلك الأيام. وقال انه مهتم جدا في الغذاء. وأيضا القتل. وفي طريقه لاحظ وجود سحابة من الدخان الصاعد إلى السماء من بلد غير معروف. حصل على طبيعة غريبة أفضل منه، وقام بتغيير مساره وأبحر إلى ريكيافيك (ريكيافيك تعني حرفيا &quot;خليج الدخان&quot;!).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>كما انه نزل سفينته، ​​ورأى أن الدخان كان في الواقع البخار المتصاعد من العديد من حمامات السباحة ريكيافيك. وعليه فإنه سريع في تمزيق الدعوى للدروع التي لبس في حالة عنيدا واجهت بعض الهنود في حين قطف العنب، والقفز إلى بعض جذوع السباحة. بعد السباحة جيدة<br />\r\nهانك اختبار القيادة الموسيقى إيندي في TONAR 12 في ReykjavikHank اختبار القيادة الموسيقى إيندي في TONAR 12 في ريكيافيك<br />\r\nهانك اختبار القيادة الموسيقى إيندي في TONAR 12 في ريكيافيك<br />\r\n500 متر جلس في حوض استحمام ساخن والاسترخاء. بعد محادثة ممتعة مع السكان المحليين كان قد نسي كل شيء عن أمريكا. الذي يحتاج إلى السفر على طول الطريق إلى أمريكا لاختيار العنب عندما يكون هناك متجر على و Laugavegur دعا V&iacute;nberi&eth; (V&iacute;nberi&eth; تعني حرفيا: &quot;العنب&quot;)؟ قررت Ing&oacute;lfur ليستقر هنا. استأجر شقة صغيرة مع زوجته، Hallveig Fr&oacute;&eth;ad&oacute;ttir، الذي كان يدعي الكثيرون ابنة فرودو من &quot;سيد الخواتم&quot;. وقد ثبت شيئا عن ذلك، ولكن.</p>\r\n\r\n<p>يوم واحد Ing&oacute;lfur وHallveig تم أخذ نزهة في جميع أنحاء المدينة. كانا يسيران الكلب، الذي كان يسمى بلوتو وكان الدانماركي العظيم. كان يوم صيف حار الأزيز و. كان طويل قبل أن اخترع تي شيرت. كانوا يرتدون سواء في الدعاوى كاملة من المدرعات، مع السيوف والدروع والخوذ وكل شيء. توقفوا قبل في &Iacute;sb&uacute;&eth; Vesturb&aelig;jar في Hagamelur للحصول على بعض الآيس كريم ويبرد. تقول القصة أن Ing&oacute;lfur طلبت من كاتب عما إذا كانت تعرف ما كان يسمى في البلاد.</p>\r\n\r\n<p>ظنت أنها كانت تسمى ثول. شعرت Ing&oacute;lfur أن كان اسم غبي.</p>\r\n\r\n<p>وأضاف &quot;يمكن أن يسمى أي بلد ثول&quot;.</p>\r\n\r\n<p>خارج<br />\r\nهنري داخل theatreHenry ايافيالايوكول داخل المسرح ايافيالايوكول<br />\r\nهنري داخل المسرح ايافيالايوكول<br />\r\nمتجر الآيس كريم، أن الجماهير تجمعوا. قد سمعوا أن الزوار الأجانب كانوا في المدينة. وهناك الكثير من هؤلاء الناس كانوا الجان. ثم اقترب Ing&oacute;lfur الحشد، ورفع له مخروط الآيس كريم عاليا وصاح:</p>\r\n\r\n<p>&quot;من الآن فصاعدا سوف يطلق هذا البلد أيسلندا، لأن المرء لا يستطيع الحصول على أفضل الآيس كريم في العالم هنا!&quot;.</p>\r\n\r\n<p>اليوم لدينا تمثال Ing&oacute;lfur. تمثال يصور Ing&oacute;lfur يموتون من الحرارة، متوكئا على كلبه.</p>\r\n\r\n<p>لا يكون غريبا، أن تكون مثل Ing&oacute;lfur! &quot;</p>\r\n\r\n<p>فقط في أيسلندا!</p>\r\n', 'الثقافات المستقلين', 'في عالم غير متجانسة بشكل متزايد والثقافات المستقلين والأماكن المثيرة للاهتمام بشكل خاص. على الأرجح نتيجة لذلك في العزلة الجغرافية من كل من', NULL, NULL, 0);
