(75, 32, 'ar', 'جنوب أفريقيا: صور الطرفية', '<p>كان الهواء في الإطارات ياب ليس فقط وصولا الى قماش، ولكن من خلال بضع طبقات. ونتيجة لذلك كان ركوب 120KM إلى سبرينغبوك واحدة مبدئي إلى حد ما. أننا مع ذلك تصل بأمان حول وقت الغداء، وكان يأمل في أن تكون قادرة على تعقب الإطارات لجاب. ولكن كان يوم أحد ويوم جنازة نيلسون مانديلا، وكان الزي الإطارات بصندوق بالطبع. بأعجوبة التقينا شخص يعرف المالك ودعا له بالنسبة لنا، ولكن أقل بأعجوبة انه لم تعقد حجم الإطارات نحتاجه. قضينا بعد ظهر ذلك اليوم والاثنين اتصل هاتفيا حول محاولة ايجاد طريقة للحصول على الاطارات لسبرينغبوك على وجه السرعة. كنت الوقت ينفد قبل رحلتي إلى NZ، وكان حريصا على استكشاف الطرق مرة أخرى على الطريق إلى كيب تاون، بدلا من الاضطرار إلى الاندفاع إلى أسفل. للأسف تحديد الاطارات ثبت صعبة، وبدا الأمر وكأن ياب سوف تحصل على الإطارات له يوم الاربعاء في أقرب وقت ممكن. كما جاب كان يقيم أطول من لي في جنوب أفريقيا، وسوف يكون الوقت لاستكشاف بعد عيد الميلاد، وأنا قررت أن تتوجه لاستكشاف معه اللحاق بالركب حتى نتمكن من ضرب الرأس<br />\r\nمحطة tyreTerminal الإطارات<br />\r\nالإطارات محطة<br />\r\nاجولهاس معا.</p>\r\n\r\n<p>وكان شخص شهريا أو سابقة لذلك اقترح أن يتوجه إلى التلال جنوب شرق كلانويليام، لذلك توقفت هناك للحصول على البنزين وحصلت في دردشة مع الرجل شكل ضفائر مع يوت مليئة لعب الأطفال التي كان يستقلها في جميع أنحاء البلاد في محاولة لبيع . وأشار إلى أن كنت رئيسا لWupperthal وثم جنوبا من هناك. وقد ثبت أن هذا اقتراح ممتاز. بعد اختتام طريقي حتى وأكثر من تمريرة وصلت Wupperthal، وهي قرية الجرمانية متضاربة في وسط جبال Cederberg التي كانت قد تأسست على يد المبشرين في عام 1830. وبعد التوقف لتناول وجبة خفيفة من متجر المدينة، ومن ثم الشعور تماما للخروج من المكان بينما أكلت ذلك، تابعت المسار على GPS التي بدت مثيرة للاهتمام، ولكن فيما يتعلق بشكل طفيف في غلظة. أردت لاستكشاف، ولكن كان الوقت ضيق، وأنا لا أريد أن يكون عالقا بنفسي في منتصف أي مكان. ومع ذلك، تلاشى قلقي بعيدا بعد مما يجعله أكثر من تمريرة أخرى وتواجه المناظر الطبيعية الخلابة من Matjiesrivier المحميات الطبيعية. نجاح باهر. يمكن ركوب بنفسك في مناطق غير مألوفة معزولة في بعض الأحيان يكون قليلا المرهقة للاعصاب، ولكن من التشويق وجود<br />\r\nذهبوا شاملة على تصميم والمواد لهذا sign.They ذهب كل خارج على التصميم والمواد اللازمة لهذه العلامة.<br />\r\nذهبوا شاملة على تصميم والمواد لهذا التوقيع.<br />\r\nالمناظر الطبيعية الخلابة لنفسك، دون أن تواجه أي شخص آخر على الطريق لبعد ظهر تعوض عن ما-المحاذير مثل: &quot;لو انخفض خلال تلك الهاوية لا أحد يجد لي لعدة أيام&quot;.</p>\r\n\r\n<p>أنا ظهرت في وقت لاحق بعد ظهر اليوم على طريق الحصى أكبر، وبعد فترة وجيزة تعثرت عبر واحة Cederberg، ضيافة مع التخييم الذي كان مدسوس بين المناظر الطبيعية الخلابة من الجبال الرسوبية يميل من قبل قوات التكتونية للقارات والتي تآكلت بفعل طحن الأنهار الجليدية القديمة. المناظر الطبيعية، وبركة، والبيرة الباردة، والضيافة، وشرائح اللحم الرسغ سميكة، وراية KTM الهائل وراء القضبان، يعني أنه حتى بعد التشويق وركوب اليوم، شعرت حقا مثل واحة.</p>\r\n\r\n<p>في صباح اليوم التالي غادرت مع فيرنر، راكب الدراجة النارية من كيب تاون، وتوجهنا إلى أسفل من خلال البيئة القاحلة كارو العظمى ويتل كارو نحو رأس أقولاس. حتى مع بلدي الصدمات الخلفي في مهب كانت الطرق غير الممهدة متعة كبيرة، ولقد وجدت أنني سوف ينتهي به الأمر بانتظام عدة دقائق قبل فيرنر - ثلاثة أشهر على الدراجة كان يعني أننا قد بدأت العمل بشكل جيد معا. هذا الاختلاف في وتيرة كان جيدا، لأنه أعطاني فرصة للتوقف،<br />\r\nبالقرب من Cederbarg Oasis.Near واحة Cederbarg.<br />\r\nبالقرب من واحة Cederbarg.<br />\r\nإيقاف الدراجة، واتخاذ بلدي خوذة قبالة، ونقع في المشهد.</p>\r\n\r\n<p>الأراضي الزراعية استقباله لنا ونحن نقترب من الساحل، وتوقفنا لشرب الجعة مع أحد زملائه ويرنر في Bredasdorp. وقد قالها كثيرون &quot;lekker&quot; قبل مغادرتنا لظهورهم بالقرب من كيب اجولهاس. شاركنا برغر عشاء ممتاز مع زوجين الايسلندي في شهر العسل، ثم يغسل عليه مع بعض البيرة الحرفية مثيرة للإعجاب. والايسلندي ركب إندورو تنافسية، وشرح كيف جعلوا إطارات الجليد من خلال حفر مئات من المسامير من خلال الإطارات من الداخل. وبعد ذلك حصلت على تأكيد من ياب انه سيلتقي لنا هناك في صباح اليوم التالي حوالي الساعة 10:00 لركوب على رأس أقولاس - باهر.</p>\r\n\r\n<p>وصل جاب كما كان مقررا في منتصف الصباح. في السحب كان كيلو، الايرلندي على BMW GS1200 الذي كان قد طاردت لنا باستمرار القارة، طرح الأسئلة كما ذهب عبر آفاق منتدى غير محدود ومن ثم الفيسبوك. تم شراء زجاجة شمبانيا في المدينة قبل الانطلاق لالرأس، وهو الأمر الذي بالنسبة لي كان قد نما في الأهمية خلال الرحلة. في رحلة من هذا القبيل أن تنفق قدرا كبيرا من الوقت في حدود الخوذة الخاصة بك<br />\r\nكيب AgulhasCape اجولهاس<br />\r\nرأس أقولاس<br />\r\nتخيل وصوله إلى هدفك. وكانت الرحلة دائما عن الرحلة بدلا من الوجهة، ولكن على الرغم من المناظر الطبيعية المختلفة والثقافات والمناخات، ظل هدفنا ثابت - رأس أقولاس. بانتظام أفكاري سوف ينجرف إلى تخيل لحظة أن التقدم جنوبا لدينا يأتي الى نهايته - في مرحلة ما كنا نفاد أفريقيا.</p>\r\n\r\n<p>في وقت الغداء، على 19 ديسمبر أننا لم تشغيل حقا من أفريقيا. مع شعور ربما في غير محله الاستحقاق، ونحن تجاهل علامات النهي عن الدراجات النارية من الطريق المؤدي إلى علامة لنقطة جنوب-معظم أفريقيا والخط الفاصل الرسمي بين المحيط الأطلسي والمحيط الهندي. واقفة مع كل من دراجاتنا أمام محيط مختلف أننا برزت في شمبانيا ويستمتع به لحظة. بدلا من أن يكون الاحتفال هدف، ليصل رأس أقولاس سمح لي أن ننظر مجازا الشمال وتذوق العديد من التجارب كان لدينا على الطريق من خلال أفريقيا: طعم قارة جديدة في تونس. مزقتها الحرب ودية للغاية ليبيا. الآثار القديمة والاضطرابات المدنية في مصر. الحيوانات المهددة بالانقراض 4000M عالية في المرتفعات الإثيوبية. الأهرامات مهجورة في صحراء المريخ من السودان. رجال القبائل بالعطش الملونة<br />\r\nقمة PeakChapman تشابمان في<br />\r\nقمة تشابمان<br />\r\nوالطريق الجحيم في كينيا؛ بحيرة تنجانيقا يقودنا من الطرق المتعرجة بوروندي، من خلال الحياة البرية في تنزانيا، وتنتهي مع وليمة السمك زامبيا. الفساد، طريق ترابي الأحمر وغابة من جمهورية الكونغو الديمقراطية. العواصف الرعدية، وأشجار الباوباب، وبعد الظهر صعبة في السرج في بوتسوانا، العقل تهب المناظر الطبيعية، وركوب مثيرة، مدينة أشباح، والصحراء التي تعيش في ناميبيا. وأخيرا ركوب منفردا من خلال Cederberg وMatjiesrivier المحميات الطبيعية هنا في جنوب أفريقيا.</p>\r\n\r\n<p>شعرت جيدة لتكون على رأس أقولاس، وبينما أنا يمكن أن يتحول بسهولة إلى الشمال لرئاسة الساحل الغربي لأفريقيا، وكان في عداد المفقودين أيضا تتبع والفنلندي، ولا يمكن أن ننتظر لنرى لهم في غضون أيام قليلة لعيد الميلاد.</p>\r\n\r\n<p>ركوب الغرب تحت المنحدرات التي تلوح في الأفق وحشية على طول الساحل حصل لنا بالقرب من كيب تاون، وكما كان آخر يوم لي على الدراجة أخذت التفاف على مذهلة الذروة تشابمان. هذا يعني أنني دخلت كيب تاون من الجنوب، الذي كان غريبا كما لمدة ثلاثة أشهر وكيب تاون كان مثال لل&quot;الجنوب&quot;.</p>\r\n\r\n<p>في اليوم التالي وأنا استقل الدراجة لشركة النقل البحري، وأعد لها ل<br />\r\nالجدول MountainTable الجبل<br />\r\nجبل الطاولة<br />\r\nرحلة في اتجاه البحر في الوطن. وقالت إنها كانت على فرس الرائعة، والمرح وراسخ القدم على المدرج لأنها كانت على الطرق الوعرة. وبصرف النظر عن الصدمات الخلفي في مهب وفلتر الوقود اختنق، وقالت انها تناولت قارة بأكملها دون صعوبات تذكر. التعبئة لها في قفص وترك لها مع الغرباء بدا يشكرون جدا.</p>\r\n\r\n<p>وأنفق تقريري الأخير يوم كامل في أفريقيا المشي بين النظام البيئي الفريد في أعلى جبل الطاولة. حافيا على حجر مسطح الجبل، مع أحمال الشمس وإطلالة رائعة على مدينة كيب تاون والمنطقة المحيطة بها جعل عن وسيلة مناسبة لنقول وداعا&nbsp;</p>\r\n', 'جنوب أفريقيا: صور الطرفية', 'كان الهواء في الإطارات ياب ليس فقط وصولا الى قماش، ولكن من خلال بضع طبقات. ونتيجة لذلك كان ركوب 120KM إلى سبرينغبوك واحدة مبدئي إلى حد ما. فعلنا ولكن', NULL, NULL, 0),
(76, 30, 'ar', 'مهن', '', '', '', NULL, NULL, 0),
(77, 29, 'ar', 'مطروح مصر', '<p>أعجب دائما صورة ظلية نحيلة من المآذن. يبدو أنها لإضافة نعمة إلى معادلة أفق أكثر فوضوية (قاسما مشتركا للمدن المصرية!).<br />\r\nحتى هنا، في مرسى مطروح، وهي بلدة صغيرة على ساحل البحر المتوسط، الأبراج البيضاء من مسجد يبدو مستحيل طويل القامة ونحيف بجوار المباني الواجهة البحرية.</p>\r\n', 'مطروح مصر', 'أعجب دائما صورة ظلية نحيلة من المآذن. يبدو أنها لإضافة نعمة إلى معادلة أفق أكثر فوضوية (قاسما مشتركا للمدن المصرية!).', NULL, NULL, 0),
(80, 46, 'ar', 'أصبح المورد', '<p>وقال كبير، جمهور عالمي</p>\r\n\r\n<p>نحن نعمل مباشرة مع مزيد من الخصائص من أي شخص آخر. من المملوكة للأسرة المبيت والإفطار في المنتجعات، وتبين لنا الممتلكات الخاصة بك لجمهور كبير من المسافرين في جميع أنحاء العالم</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>لا رسوم التسجيل والاشتراكات أو التكاليف الثابتة</p>\r\n\r\n<p>تسجيل معنا هو خال تماما. لا توجد الاشتراك أو اشتراك التكاليف.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>النموذج القائم على عمولة</p>\r\n\r\n<p>وهذا يعني الممتلكات الخاصة بك وتدفع نسبة مئوية من كل إقامة أكد لنا. هذا يحصل لك الوصول إلى الإعلان لدينا واسعة على محركات البحث مثل جوجل، بنج وياهو، بالإضافة لدينا أكثر من 5000 شريك المواقع التابعة لها.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>تفاصيل الممتلكات الخاصة بك متوفرة في 41 لغة</p>\r\n\r\n<p>ونحن على الخيار الأول من بين المسافرين في جميع أنحاء العالم لأننا نعمل مع خصائص كبيرة وتقديمها بطريقة التي هي ذات الصلة محليا.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>متعددي اللغات، 24/7 المساعدة لأصحاب ممتلكاتنا والضيوف</p>\r\n\r\n<p>بسهولة إدارة الحجوزات قائمتك ومع أدواتنا على الانترنت بسيطة. لدينا فريق دعم متخصص هنا على مدار الساعة لمساعدة - عادل في القضية.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>تطبيق للحصول على وكيل التسجيل</p>\r\n', '', '', NULL, NULL, 0),
(82, 31, 'ar', 'سياسة العمل', '<p>ليس من المفترض أن المطر في كو ساموي هذا الوقت من العام.</p>\r\n\r\n<p>أنا فعلت القليل من البحث حول كو ساموي قبل أن قررت لقضاء نهاية السنة هنا. ومن المفترض أن تكون دافئة ديسمبر - جعل هذا الساخنة - ومعظمهم مشمس. نموذجية العواصف والامطار بعد ظهر اليوم، ولكن الطقس الشاطئ لم يكن سيئا. نظرت إلى الأمام إلى أيام كسول في الشمس، وقراءة الروايات الرخيصة والسباحة في المياه الزرقاء.</p>\r\n\r\n<p>ومع ذلك، اعصار هاجوبيت على ما يبدو لم يقرأ المصادر نفسها كما فعلت. انها تقف نفسها على مدى الفلبين نحو أسبوع قبل وصولي في كو ساموي، مما تسبب في دمار لا يوصف وإزهاق أرواح 27 شخصا على الاقل. بعد الاعصار كان لها طريقها مع الفلبين، انتقلت قبالة إلى الغرب، تفقد السلطة ببطء كما فعلت ذلك.</p>\r\n\r\n<p>تخمين ما هو مباشر في مسار باتجاه الغرب ما هو الاكتئاب الآن المدارية هاجوبيت؟ نعم، كو ساموي ولي.</p>\r\n\r\n<p>الآن هذا ليس بعض بقايا جبان عاصفة. كانت الرياح قوية بما فيه الكفاية لضرب أكثر من نصف كاملة القدح البيرة وكسر الزجاج. شاهدت الشاب الذي يعمل في الفندق يستغرق وركوب الأمواج بها ويعود في أقل<br />\r\nوات بو PhutWat بو بوت<br />\r\nوات بو بوت<br />\r\nمن خمس دقائق مع نصف ركوب الأمواج، أبدا بعد أن حصلت في الماضي السطر الأول من القواطع. وكانت هذه الأمواج التي قذف حول جذوع الشجرة كلها، وكسر كرات رباط من مراسيها وأبدا اعتذر. أنا لست بصدد السباحة في ذلك. على الأقل حتى الآن.</p>\r\n\r\n<p>وأنا أعلم كاهن الكنيسة الانجليكانية متقاعد يقول لي (مع وجود قدر معين من الغبطة برنامج الأمم المتحدة للالكهنوتية) &quot;خطط الرجل، يضحك الله&quot;، ولكن أنا لا شيء إن لم يكن قابلا للتكيف، وتعلمت منذ زمن أنني لن تذوب في المطر، لذلك توجهت إلى الجانب الشمالي من الجزيرة لكزة حولها.</p>\r\n\r\n<p>ذهبت إلى الطريق الرئيسي المؤدي إلى العلم أسفل songthaew، وهي شاحنة بيك اب مع اثنين من مقاعد البدلاء ثابتة على طول جانبي السرير. فمن رخص تكاليف النقل وموثوق بها إلى حد ما. كما كنت أنتظر في رذاذ لأحد أن يأتي جنبا إلى جنب، وسحبت رجل على دراجة نارية حتى وعرضت على اتخاذ حيث أردت أن أذهب. ركوب الآن على ظهر دراجة نارية مع شخص غريب على الطرق الملتوية ولا خوذة هو التحدي بما فيه الكفاية، ولكن للقيام بذلك في المطر لمضاعفة تكلفة songthaew - حسنا، هذا كان من السهل<br />\r\nبو فوت stupaBo فوت ستوبا<br />\r\nبو فوت ستوبا<br />\r\nلرفض.</p>\r\n\r\n<p>الشيء بارد آخر عن songthaews - بخلاف السعر - غير الركاب. في songthaew أنا إشارة إلى أسفل وكان هناك سيدة التايلاندية مع سلة من أربع الجراء Samoyed و. الجراء Samoyed وتبدو وكأنها تنتمي في متجر لعبة، فهي لطيف جدا ورقيق. بالإضافة إلى الجراء كانت هناك سيدة مجرية الذين يريدون ممارسة اللغة الإنجليزية لها، وستة من الشبان الذين يمكن أن مرت لمقاتلي الملاكمة التايلاندية.</p>\r\n\r\n<p>وتوجهت إلى بو فوت على الساحل الشمالي. هذا هو موطن معبد بوذي وات بو Phuttharem، قرية الصيادين، وقليلا إلى الشرق، وات فرا ياي، المعروف أيضا باسم معبد بوذا الكبير.</p>\r\n\r\n<p>بناء على إلحاح من سيدة مجرية، ونزلت في السوق الرطب بو فوت. كان هناك الكثير من الفاكهة الجميلة واحدة كشك لبيع الكعك الزوجة الصالحة. هذا هو المعجنات قشاري مليئة wintermelon أو اللوتس معجون، ولأن هذا هو واحد من بلدي الحلويات المفضلة لديك، اشتريت واحدة. (فما استقاموا لكم فاستقيموا تظهر لك الصورة، ولكن أكلت. كان ذلك جيدا.) ومن هناك كان على مسافة قصيرة من وات بو Phuttharem.</p>\r\n\r\n<p>أحب زيارة المعابد البوذية؛<br />\r\nالتفاصيل من معبد buildingdetail بناء المعبد<br />\r\nالتفاصيل من بناء المعبد<br />\r\nأنها عادة ما تكون هادئة جدا وقبول الأماكن. وات بو Phuttharem الخلط لي، رغم ذلك، وأنا لم يكن قادرا على معرفة الكثير عن ذلك. أسس معبد واسعة جدا، ويبدو مثل المباني الجديدة آخذة في الارتفاع. ومن الواضح أنه لم يكن إعداده للسياح، لا توجد مؤشرات في أي لغة أخرى غير التايلاندية، و، في حين كانت هناك أجنحة مع صور بوذا، لم تكن أي من المباني المعبد مفتوح وكأنهم في الجزء الشمالي من البلاد.</p>\r\n\r\n<p>أضع التبرع في مربع لبلدي ولادة سنويا، والدهشة عندما جاءت الانشوده المسجلة مسبقا بها. انا التخمين أن وزن القطع النقدية انطلقت التسجيل. صناديق التبرع شائعة جدا في المعابد، ولكن لم يكن لدي الانشوده واحد بالنسبة لي قبل</p>\r\n\r\n<p>كانت هناك شواهد القبور وضع بطانة جدران المجمع، شيء آخر أنا لم أر في معبد بوذي. لقد قيل لي أن معظم التايلانديين وحرق والرماد من خلط في الأبراج البوذية ملموسة حول المعبد. رأيت لويحات اسم في المعابد، لذلك إذا كان الشخص ليس لديه ذرية أن نصلي من أجلهم سيكون لديهم صلوات الرهبان. لم أكن قد رأيت النصب التذكارية<br />\r\nوقر الرهبان monksrevered<br />\r\nالرهبان التبجيل<br />\r\nمثل هذه، تكرس كل لفرد بعينه.</p>\r\n\r\n<p>ربما كان ولايتي للعقل - حسنا، ربما كان ولايتي للعقل - لكني فشلت في العثور على السلام وجودي هنا. مشيت الطريق إلى قرية الصيادين، والتي هي بالتأكيد منطقة سياحية. وسط القضبان، تي شيرت المحلات التجارية، والكثير من TAT تتميز الفيلة ذات الإنتاج الضخم وتماثيل بوذا قد تكون قادرة على العثور على الهمس من المدينة الصيد القديمة، ولكن لا أرى ذلك.</p>\r\n\r\n<p>بعد نحو خمسة كيلومترات مزيد من أسفل الطريق هو وات فرا ياي، المعروفة أكثر باسم معبد بوذا الكبير. بوذا الكبير يستحق إدخال كل بمفرده، حتى لا تكون المقبل.</p>\r\n\r\n<p>في غضون ذلك، وهنا هو أسطورة من كعكة الزوجة الصالحة:</p>\r\n\r\n<p>كان ياما كان، كان هناك سيئة للغاية المعيشة زوجين في الصين الإمبراطورية. كانا يحبان بعضهما وعاش في قرية صغيرة. فجأة، انتشر مرض غامض من خلال قريتهم، وأصبح والد الزوج مريض جدا.</p>\r\n\r\n<p>للزوجين قضى كل من أموالهم من أجل علاج الد الشاب، لكنه كان لا يزال مريضا. الزوجة باعت نفسها كعبد في مقابل المال<br />\r\nالمعبد بناء buildingtemple<br />\r\nبناء المعبد<br />\r\nلشراء دواء لوالدها في القانون. علمت مرة واحدة الزوج حول ما فعلته زوجته، وقدم كعكة مليئة wintermelon المحلاة واللوز. كرس هذا المعجنات لزوجته، الذي كان يمكن أن ننسى أبدا، ويباع في الشارع. أصبحت كعكة له شعبية لدرجة أنه كان قادرا على كسب ما يكفي من المال لشراء زوجته مرة أخرى.</p>\r\n', 'لم يكن من المفترض أن المطر', 'ليس من المفترض أن المطر في كو ساموي هذا الوقت من العام.', NULL, NULL, 0),
(83, 48, 'es', 'Sobre Nosotros', '<p>PHPtravels que proporcionan el mejor y usuario de la aplicaci&oacute;n amigable para nuestros clientes, con herramientas extensas especialmente para los viajes de negocios en l&iacute;nea de reserva de hoteles a los vuelos de reservas, tambi&eacute;n ofrecemos soluciones y servicios web personalizados. Con m&aacute;s de 4 a&ntilde;os de experiencia phptravels.com han ganado, sin duda, una reputaci&oacute;n de ser una fuente de confianza, un socio fiable y un experto en el &aacute;rea de las aplicaciones de negocio de viajes en l&iacute;nea.</p>\r\n\r\n<p>La combinaci&oacute;n de nuestros servicios, 24/5 ayuda sin parar, nuestra fijaci&oacute;n de precios, forma amistosa de hacer negocios, y nuestra filosof&iacute;a corporativa compasivo es muy singular en el mundo empresarial actual. Nos enorgullecemos de servicio al cliente excepcional y nos esforzamos en construir relaciones duraderas con nuestros clientes, por lo que es f&aacute;cil y rentable para ellos hacer negocios con nosotros.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Valoramos a nuestros clientes y nos centramos en la satisfacci&oacute;n del cliente. Es por eso que el apoyo post-venta es un factor clave en nuestro enfoque. Con toda esta rica experiencia, ahora a trav&eacute;s de PHPtravels estamos obligados a cumplir con la satisfacci&oacute;n del cliente y establecer la confianza.</p>\r\n\r\n<p>Si usted est&aacute; buscando para mejorar su negocio de viajes en l&iacute;nea, PHPtravels funciona como la mejor soluci&oacute;n de una parada con interfaz f&aacute;cil de usar y un gran caracter&iacute;sticas tales con precios que responden a su presupuesto.</p>\r\n\r\n<p>Para ponerse en contacto con nosotros puedes utilizar nuestro sistema de mesas de apoyo, o no dude en seguirnos en Twitter o Facebook. Por favor no dude en contactarnos.</p>\r\n', '', '', NULL, NULL, 0),
(85, 46, 'es', 'Conviértase en Proveedor', '<p>Un numeroso p&uacute;blico, global</p>\r\n\r\n<p>Trabajamos directamente con m&aacute;s propiedades que cualquier otra persona. De propiedad familiar B &amp; B a los centros tur&iacute;sticos, mostramos su propiedad a una gran audiencia de los viajeros de todo el mundo</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>No hay cuotas de inscripci&oacute;n, suscripciones o costos fijos</p>\r\n\r\n<p>Registro con nosotros es totalmente gratuito. No hay Reg&iacute;strese o suscripci&oacute;n costos.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Modelo basado en la Comisi&oacute;n</p>\r\n\r\n<p>Esto significa que su propiedad paga un porcentaje de cada estancia confirmado para nosotros. Esto le proporcionar&aacute; acceso a nuestra extensa publicidad en motores de b&uacute;squeda como Google, Bing y Yahoo, adem&aacute;s de nuestros m&aacute;s de 5.000 sitios socios afiliados.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Sus datos de propiedades disponibles en 41 idiomas</p>\r\n\r\n<p>Somos la mejor opci&oacute;n entre los viajeros de todo el mundo debido a que trabajamos con grandes propiedades y presentarlas de una manera que es relevante a nivel local.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Multiling&uuml;e, asistencia 24/7 para nuestros propietarios y hu&eacute;spedes</p>\r\n\r\n<p>Administre f&aacute;cilmente su anuncio y reservas con nuestras herramientas en l&iacute;nea simples. Nuestro equipo de soporte dedicado est&aacute; aqu&iacute; durante todo el d&iacute;a para ayudar - por si acaso.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Solicitar el registro del Agente</p>\r\n', '', '', NULL, NULL, 0),
(87, 36, 'es', 'Consejos de reservación', '', '', '', NULL, NULL, 0),
(88, 35, 'es', 'Playas Virgen Gorda', '<p>Esta es la segunda escala de una semana verdaderamente divertido. Hay aventuras que reciben cada ma&ntilde;ana cuando aterricemos en otro lugar, pero tambi&eacute;n tiempo de la diversi&oacute;n en el propio barco.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>El Club Med 2 tiene un bar abierto. S&iacute;, eso significa que el libre flujo de las cosas bastante bien ... todo el d&iacute;a. As&iacute; que estar en un barco franc&eacute;s, tiene Ricard para aperitivo a la hora del almuerzo si est&aacute;s en el barco en la hora del almuerzo ... y pi&ntilde;a colada en la piscina antes de la puesta del sol, y obviamente vino durante las comidas. Estamos en el final del Hemisferio Norte de noviembre, por lo que las puestas de sol son temprano a las 17:30 cada d&iacute;a ... con unas vistas muy interesantes desde el bar de la piscina en la terraza de atr&aacute;s. Por 18:00, es hora de champ&aacute;n ... toda la noche. Bueno, primero que es hora de la ducha y conseguir el cambio para la noche ... obviamente esto sigue siendo un lugar franc&eacute;s! Y como todos ahora que la mezcla de diferentes bebidas alcoh&oacute;licas no es una gran idea, me encontr&eacute; con un divertido grupo de personas dispuestas a ir en el champ&aacute;n toda la noche, todas las noches, por genial y divertido tiempo! M&aacute;s en las pr&oacute;ximas entradas de este verdaderamente divertido grupo de personas.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Poco advertencia, Club Med 2<br />\r\nClub Med 2Club Med 2<br />\r\nClub Med 2<br />\r\nes franc&eacute;s, y se siente. De las 280 personas en el barco de esta semana, no creo que uno solo no habla al menos un poco de franc&eacute;s. Ser&iacute;a una semana bastante aburrido si s&oacute;lo se puede hablar Ingl&eacute;s aqu&iacute; ... y como es de su conocimiento ... los franceses que viven en Francia succionar cuando se trata de hablar algo m&aacute;s que el franc&eacute;s. Usted ha sido honestamente advertido!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>As&iacute; que esta ma&ntilde;ana, es el momento de las Islas V&iacute;rgenes Brit&aacute;nicas. No, yo no voy a hacer aqu&iacute;. Y BVI no s&oacute;lo destacan por empresas offshore ... no demasiado reposar por hermosas playas, yates y las Islas V&iacute;rgenes Brit&aacute;nicas. Hemos navegado toda la noche desde Dominica ... Dominica es Commonwealth y pobres .... BVI es territorio brit&aacute;nico y muy rico.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pas&eacute; mi d&iacute;a con Thierry .... misma edad que yo, y listo para pasar un buen rato esta semana. Porque al final del d&iacute;a sabemos que usted no encuentra las solteras en la treintena en estos cruceros ... sab&iacute;amos que tendr&iacute;amos que organizarnos para hacer algo m&aacute;s que leer nuestros libros! No hacer mi tarea sobre Virgin Gorda. Yo Kew el buceo era normal, y que el crucero ten&iacute;a un almuerzo de barbacoa de langosta organizado por nosotros en la<br />\r\nLangosta tiempo ... tiempo langosta ...<br />\r\nTiempo langosta ...<br />\r\nplaya! As&iacute; que tomamos un &quot;beacher&quot; con la intenci&oacute;n de simplemente ir a la playa por la ma&ntilde;ana.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hay un servicio de enlace a &quot;una&quot; playa alquilada por la ma&ntilde;ana por el Club Med. Nos pusimos al lado del conductor rasta ... s&iacute; hombre ... y &eacute;l nos dej&oacute; en el camino. Eso fue sobre plano, completamente de la nada! Ya era hora de que nos vayamos explorar el Parque Nacional de &quot;Los Ba&ntilde;os&quot;. Esta es una especie de parque nacional ... es una serie de playas separadas por rocas de granito. Sent&iacute; por primera vez en las Seychelles ... antes de encontrar a m&iacute; mismo m&aacute;s bien en una especie de caminata de aventura para adolescentes listos para tener un poco de diversi&oacute;n. Wow, ese lugar es incre&iacute;ble!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pasamos toda la ma&ntilde;ana yendo de playa en playa y subir esas enormes rocas ... incluso perderse en playas desiertas como vagando si solo est&aacute;bamos en el camino correcto. El agua era preciosa y c&aacute;lida .... los yates eran alrededor, era simplemente divertido lleno ... simple!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hicimos nuestro camino de regreso a la playa del Club Med, justo a tiempo para el &uacute;ltimo transporte. Buena idea, ya que no ten&iacute;a idea de d&oacute;nde estaba la barbacoa, y el viaje de regreso a<br />\r\nPoco pi&ntilde;a colada en la piscina ... Poco pi&ntilde;a colada en la piscina ...<br />\r\nPoco pi&ntilde;a colada en la piscina ...<br />\r\nel punto de la traves&iacute;a de aterrizaje era bastante un paseo de distancia. Langosta barbacoa! Eso simplemente no puede ser malo s&oacute;lo por la forma en que suena. Fue otro de estos ... libre flujo de rosa vino ... de ensalada, y s&iacute;, de langosta tambi&eacute;n! El sol estaba all&iacute;, al final del almuerzo ... nuestras caras terminaron del mismo color que las langostas a la parrilla .... pero una vez m&aacute;s ... divertido que era!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>De vuelta en el barco antes de las multitudes para una buena siesta y alg&uacute;n tiempo piscina. No es que los 280 invitados que te hace sentir lleno de gente en un enorme barco como vela ... pero la cola no es simplemente lo nuestro.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Otra noche muy divertida nos esperaba ... y una vela corta a la tierra del T&iacute;o Sam ... o muy cerca de esta realidad, por otra divertida aventura ... en la que voy a tener que escribir muy pronto!</p>\r\n', 'Playas Virgen Gorda y lobste', 'Esta es la segunda etapa de una semana verdaderamente divertido. Hay aventuras que reciben cada mañana cuando aterricemos en otro lugar, pero también tiempo de la diversión en el propio barco.', NULL, NULL, 0),
(89, 34, 'es', 'Culturas ferozmente independiente', '<p>En un mundo que es cada vez m&aacute;s homog&eacute;nea, culturas y lugares ferozmente independientes son especialmente intrigante. Probablemente el resultado de que es el aislamiento geogr&aacute;fico, tanto continental Europa y Am&eacute;rica del Norte, Islandia siempre ha tomado su propio camino &uacute;nico. Arquitectura islandesa y la moda es un reflejo de que es la geograf&iacute;a inusual, la paleta de Islandia es m&aacute;s c&oacute;modo cuando ingredientes locales de calidad se curan, cultivados, fermentados, o en escabeche, y el pueblo island&eacute;s se deleitan en la autosuficiencia y la sostenibilidad ambiental. Islandia siempre ha estado muy arraigado en las sensibilidades liberales n&oacute;rdicos, pero a diferencia de cualquier otra naci&oacute;n, que se neg&oacute; a rescatar a sus bancos despu&eacute;s de la recesi&oacute;n de 2008, en 2009 eligieron primera mujer primer ministro abiertamente gay del mundo y en 2010, Reykjavik eligi&oacute; a Juan Gnarr, cantante de punk rock, comediante, y auto proclamaron anarquista como su alcalde. El paisaje f&iacute;sico es tan llamativo y singular como la propia cultura; una isla cubierta de roca volc&aacute;nica negro, exuberantes campos verdes, los respiraderos geot&eacute;rmicos y volcanes espectaculares. Fue con esto en mente, que Dennie, Henry y yo abordamos un avi&oacute;n de Reykjavik durante las vacaciones de Semana Santa, donde &iacute;bamos a pasar 9 d&iacute;as nadando en piscinas de agua caliente, la conducci&oacute;n a trav&eacute;s de fiordos, y comer delicioso skyr (yogur island&eacute;s).</p>\r\n\r\n<p>Islandia es caro. como<br />\r\nSenderismo cerca de Eyjafjallaj&ouml;kullHiking cerca Eyjafjallaj&ouml;kull<br />\r\nSenderismo cerca de Eyjafjallaj&ouml;kull<br />\r\nuna manera de mitigar los costos de nuestro plan involucrado el alquiler de un viejo, oxidado pero sobre todo fiable coche Sadcar (un Yaris 2002 con 280.000 Kms), cocinar 2 de 3 comidas al d&iacute;a en nuestro apartamento de alquiler con alimentos de marca Bono y haciendo tan poco comercial como sea posible. Al entrar por la aduana empec&eacute; a tener algunas peque&ntilde;as reservas acerca de nuestro plan para estar presupuesto orientado cuando fuimos recibidos por lo que supongo que es uno de los dos empleados Sadcar que nos llev&oacute; a un quonset en un campo a 10 minutos del aeropuerto. Cuando preguntamos acerca de un asiento de seguridad para Henry, que nos dirigi&oacute; a la parte trasera del cementerio coche tienda / alquiler de carrocer&iacute;as de autom&oacute;viles, donde 3 muy utilizados y carseats ligeramente rotas s&aacute;b entre silenciadores y fluidos refrigerantes. Dennie eligi&oacute; el m&aacute;s funcional del lote, cargamos en nuestra Sadcar y salimos hacia Reykjavik a trav&eacute;s de una tormenta de nieve de menor importancia.</p>\r\n\r\n<p>Nuestro peque&ntilde;o apartamento Ikea estaba perfectamente situado en la calle del Hallgrimskirka, la iglesia luterana spired que proporciona una br&uacute;jula para los viajeros que deseen explorar la ciudad. Este fue un gran lugar para tener como base de operaciones, ya que la mayor&iacute;a de nuestras ma&ntilde;anas se gastaron pregunt&aacute;ndose las calles<br />\r\nHank y yo dentro de la HarpaHank y yo dentro de la Harpa<br />\r\nHank y yo dentro de la Harpa<br />\r\ndel casco antiguo, donde las casas adosadas de colores con planta principal espacio comercial proporcionan un centro vibrante y transitable salpicado de tiendas de discos con c&oacute;modos sof&aacute;s y espresso libre (12 Tonar), dise&ntilde;o y mobiliario islandeses tiendas, cafeter&iacute;as vegetarianas, pubs, clubes y casas de curry. Visitamos los tres lugares del Museo de Arte de Reykjavik (Hafnarhus, Kjarvalsstadir, Asmundarsafn) donde las obras posmodernas de Erro y las pinturas cubistas y paisaje abstracto de Kjarval cuelgan junto a exposiciones de artistas contempor&aacute;neos islandeses rotativo. Nos topamos con una caza del huevo de Pascua en el Jonsson Parque de Esculturas Einar, jugamos a las cartas en los salones en expansi&oacute;n dentro de la Harpa, y nos llev&oacute; en el Museo de Reykjavik de Fotograf&iacute;a (dentro de la biblioteca p&uacute;blica), la Saga Museo Vikingo, el Parque y la Infancia de Reykjavik &quot;zoo &quot;(m&aacute;s de un zool&oacute;gico de mascotas) y tom&oacute; el ascensor hasta el observatorio de la perla. La ciudad es sorprendentemente cosmopolita todav&iacute;a conserva una peque&ntilde;a hospitalidad de la ciudad que act&uacute;a como un recordatorio de que s&oacute;lo hay 120.000 personas dentro de los l&iacute;mites de la ciudad.</p>\r\n\r\n<p>A pesar del alto costo de los bares y restaurantes en el centro de Reykjavik nos las arreglamos para encontrar un n&uacute;mero de restaurantes a precios razonables que sirve deliciosa y fresca comida. Estas son algunas de nuestras recomendaciones: Babalu (a la parrilla<br />\r\nCaza del huevo de Pascua en Einar J&oacute;nsson Escultura GardenEaster Egg Hunt en Einar J&oacute;nsson Jard&iacute;n de Esculturas<br />\r\nCaza del huevo de Pascua en Einar J&oacute;nsson Jard&iacute;n de Esculturas<br />\r\nHallgr&iacute;mskirkja en el fondo.<br />\r\nqueso y tomate), C es para Cookie (sopa casera y s&aacute;ndwiches con gran pastel de queso), Lavander&iacute;a Cafe (trucha de lago con verduras de ra&iacute;z fue excepcional y zona de juegos para los ni&ntilde;os en el s&oacute;tano es algo digno de contemplar!), Austur India Fjelagid (delicioso Thali vegetariana), Graen Kostur (Eastern inspirado comida vegetariana fusi&oacute;n con dos opciones para el almuerzo todos los d&iacute;as). Para las bebidas, Microbar tiene un mont&oacute;n de cervezas artesanales de barril (Happy Hour de 5-8 pm). El Bar Labowski tambi&eacute;n parec&iacute;a un lugar incre&iacute;ble, pero que estaban teniendo pub trivia cuando entramos en lo que no nos quedamos para tomar una copa.</p>\r\n\r\n<p>Nuestra Sadcar logr&oacute; una serie de excursiones de un d&iacute;a desde Reykjavik; condujimos hacia el norte a trav&eacute;s de la Hvalfjorour (Whale fiordo), parando para un picnic cerca de algunos r&aacute;pidos. Nos llev&oacute; a la ciudad geot&eacute;rmica de Hverager&eth;i y sobre el volc&aacute;n Eyjafjallajokull famoso que hizo erupci&oacute;n en 2010 causando la cancelaci&oacute;n de vuelos en toda Europa. Manejamos el C&iacute;rculo de Oro, con paradas en Geyser, Parque Nacional Pingvellir y la cascada Gullfoss. Una vez que salga Reykjavik la geograf&iacute;a es cruda pero majestuoso con campos verdes salpicados de roca volc&aacute;nica negro, colinas, pasos de monta&ntilde;a empinadas y vapor que se elevaba en el aire de chimeneas termales que salpican el paisaje a lo largo.</p>\r\n\r\n<p>Dennie<br />\r\nFuera de la LagoonOutside azul de la Laguna Azul<br />\r\nFuera de la Laguna Azul<br />\r\ny he llegado r&aacute;pido a la conclusi&oacute;n de que cuando se viaja con un beb&eacute;, la experiencia es m&aacute;s divertido para todos si toda la planificaci&oacute;n gira en torno al beb&eacute;. Y mientras que la legendaria vida nocturna de Reykjavik pudo haber llamado a mi nombre una o dos veces, la crianza con una resaca sin duda no lo hizo. Como tal, nos pasamos buena parte de nuestro tiempo en Islandia sumergirnos en la cultura de la piscina termal. Con 122 piscinas termales y 17 s&oacute;lo en Reykjavik, hemos hecho nuestra misi&oacute;n de nadar en una piscina nueva cada d&iacute;a. En Reykjavik nadamos en Laugardalslaug, Sundhollin, Arbaejarlaug, Grafarvogslaug, Sudurbaejarlaug y Asvallalaug. Durante nuestros viajes de un d&iacute;a alrededor del campo de Islandia tambi&eacute;n tuvimos la oportunidad de nadar en la piscina hermosa en Hverageroi, desnudo en la Seljallalaug desierta ubicada en un valle de monta&ntilde;a rodeado de cascadas, y en nuestro &uacute;ltimo d&iacute;a en el caro, pero incre&iacute;ble laguna azul. 9 piscinas en 9 d&iacute;as. El agua en todas las piscinas p&uacute;blicas es libre de qu&iacute;micos, se calienta a trav&eacute;s de la energ&iacute;a geot&eacute;rmica, y casi todos tienen una serie de &quot;ollas calientes&quot;, saunas, carriles para nadar, piscinas para ni&ntilde;os y toboganes. Me dio la impresi&oacute;n de mi tiempo sentados en &quot;ollas calientes&quot; charlando con los lugare&ntilde;os que piscinas termales son importantes<br />\r\nEn ruta a la piscina caliente Seljvavellir en ruta a la piscina caliente Seljvavellir<br />\r\nEn ruta a la piscina caliente Seljvavellir<br />\r\nlugares de reuni&oacute;n para los miembros de la comunidad. Movimiento por igual Viejos y j&oacute;venes entre las diversas piscinas y abiertamente conversar con extra&ntilde;os y amigos. En momentos en los que Henry estaba de mal humor o cansado siempre supimos que est&aacute;bamos a pocos minutos de una piscina donde de inmediato se transform&oacute; de nuevo en el Hank sonriendo nos hemos acostumbrado a. Mientras que las piscinas sin duda hizo viajar por Islandia con un beb&eacute; mucho m&aacute;s f&aacute;cil, que es el pueblo island&eacute;s que realmente hacen Islandia un local amigable para los ni&ntilde;os. Casi todos los restaurantes que nos fuimos a ten&iacute;a una zona de juegos para ni&ntilde;os, no hab&iacute;a se&ntilde;alizaci&oacute;n que alienta la lactancia materna, y todos los bares y pubs se permiten ni&ntilde;os. Los islandeses eran c&aacute;lidos y saliente pero no es ruidoso o desagradable y no importa donde fuimos, parec&iacute;a que hab&iacute;an pensado en la manera de dar la bienvenida a los ni&ntilde;os.</p>\r\n\r\n<p>En nuestra &uacute;ltima ma&ntilde;ana en Islandia, caminaba por la calle de nuestro apartamento para recoger un par de CD en Tonar 12. Me sent&eacute; en sus c&oacute;modos sof&aacute;s escuchando FM Belfast y Seabear mientras que Henry busc&oacute; en las pilas. Sin preguntar, el hombre que corre la tienda me trajo un espresso. Cog&iacute; una gu&iacute;a Reykjavik desde una mesa de caf&eacute; y<br />\r\nDennie conducir nuestra triste CarDennie conducir nuestro coche Sad<br />\r\nDennie conducir nuestro coche Sad<br />\r\nabri&oacute; el libro a la primera p&aacute;gina para leer el mensaje de bienvenida del alcalde para los visitantes. Jon Gnarr (el alcalde) predijo su versi&oacute;n de origen del pa&iacute;s. Yo leo,</p>\r\n\r\n<p>&quot;Pero, &iquest;c&oacute;mo puede ser que un pa&iacute;s tan c&aacute;lido lleg&oacute; a poseer un nombre tan fr&iacute;gida S&iacute;, la explicaci&oacute;n es sencilla:?.. MISUNDERSTANDING Ing&oacute;lfur Arnarson, el primer hombre que encontr&oacute; Reikiavik, no estaba en su camino aqu&iacute; en todo lo que &Eacute;l era en el camino a los Estados Unidos de Am&eacute;rica, para comprar uvas y otra comida r&aacute;pida que crec&iacute;an salvajes all&iacute; en aquellos d&iacute;as. &eacute;l estaba muy interesado en los alimentos. y tambi&eacute;n el homicidio. en su camino se dio cuenta de una nube de humo que asciende a los cielos de un pa&iacute;s desconocido. su naturaleza curiosa tiene lo mejor de &eacute;l, y &eacute;l cambi&oacute; su curso y zarpar a Reykjav&iacute;k (Reykjav&iacute;k literalmente significa &quot;bah&iacute;a humeante&quot;!).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Como desembarc&oacute; su nave, vio que el humo era, de hecho, el aumento de vapor de muchas piscinas de Reykjav&iacute;k. Era, por tanto, r&aacute;pida en arrancar la armadura que hab&iacute;a llevado en caso de que hubiera encontrar algunos nativos americanos al recoger las uvas, y saltar en algunos trajes de ba&ntilde;o. Despu&eacute;s de nadar un buen<br />\r\nPrueba Hank conducir la m&uacute;sica Indie en Tonar 12 en la prueba de conducci&oacute;n ReykjavikHank m&uacute;sica Indie en Tonar 12 en Reykjavik<br />\r\nPrueba Hank conducir la m&uacute;sica Indie en Tonar 12 en Reykjavik<br />\r\n500 metros se sent&oacute; en la ba&ntilde;era de hidromasaje y relajado. Despu&eacute;s de una charla divertida con la gente del lugar que hab&iacute;a olvidado por completo de Am&eacute;rica. &iquest;Qui&eacute;n tiene que viajar todo el camino a Estados Unidos para recoger las uvas cuando hay una tienda en Laugavegur llamados V&iacute;nberi&eth; (V&iacute;nberi&eth; significa literalmente: &quot;la uva&quot;)? Ing&oacute;lfur decidi&oacute; instalarse aqu&iacute;. Alquil&oacute; un peque&ntilde;o apartamento junto con su esposa, Hallveig Fr&oacute;&eth;ad&oacute;ttir, que muchos dicen fue la hija de Frodo de &#39;El Se&ntilde;or de los Anillos&#39;. Nada ha sido probado de eso, sin embargo.</p>\r\n\r\n<p>Un d&iacute;a Ing&oacute;lfur y Hallveig estaban tomando un paseo por la ciudad. Estaban caminando a su perro, que fue llamado Plut&oacute;n y era un gran dan&eacute;s. Era un d&iacute;a de verano caliente chisporrotea. Fue mucho antes de la invenci&oacute;n de la camiseta. Estaban vestidos tanto en trajes completos de armadura, con espadas y escudos y cascos y todo. Se detuvieron junto a &Iacute;sb&uacute;&eth; Vesturb&aelig;jar en Hagamelur para obtener un helado y refrescarse. La historia cuenta que Ing&oacute;lfur pregunt&oacute; al empleado si sab&iacute;a lo que el pa&iacute;s se llama.</p>\r\n\r\n<p>Ella pens&oacute; que se llamaba Thule. Ing&oacute;lfur sent&iacute;a que era un nombre est&uacute;pido.</p>\r\n\r\n<p>&quot;Ning&uacute;n pa&iacute;s puede ser llamado Thule&quot;, dijo.</p>\r\n\r\n<p>Fuera de la<br />\r\nHenry dentro del theatreHenry eyjafjallajokull el interior del teatro eyjafjallajokull<br />\r\nHenry dentro del teatro eyjafjallajokull<br />\r\nhelader&iacute;a, una multitud se hab&iacute;a reunido. Hab&iacute;an o&iacute;do que los visitantes extranjeros estaban en la ciudad. Muchas de esas personas eran elfos. Ing&oacute;lfur luego se acerc&oacute; a la multitud, levant&oacute; su cono de helado en alto y grit&oacute;:</p>\r\n\r\n<p>&quot;De aqu&iacute; en adelante este pa&iacute;s se llama Islandia, porque uno puede conseguir mejor helado del mundo aqu&iacute;!&quot;.</p>\r\n\r\n<p>Hoy tenemos una estatua de Ing&oacute;lfur. La estatua representa a Ing&oacute;lfur muriendo de calor, apoyado en su perro.</p>\r\n\r\n<p>No ser un extra&ntilde;o, ser como Ing&oacute;lfur! &quot;</p>\r\n\r\n<p>S&oacute;lo en Islandia!</p>\r\n', 'Culturas ferozmente independiente', 'En un mundo que es cada vez más homogénea, culturas y lugares ferozmente independientes son especialmente intrigante. Probablemente el resultado de que es el aislamiento geográfico de ambos', NULL, NULL, 0),
(90, 32, 'es', 'Sudáfrica: Un Terminal Tiro', '<p>Neum&aacute;tico de Jaap era no s&oacute;lo a la lona, pero a trav&eacute;s de un par de capas. Como resultado, el viaje 120 kilometros a los Springboks fue bastante tentativo. Sin embargo, nos llega con seguridad alrededor de la hora del almuerzo, y est&aacute;bamos esperanzados de poder localizar a un neum&aacute;tico para Jaap. Sin embargo, fue un domingo y el d&iacute;a del funeral de Nelson Mandela, y el conjunto de los neum&aacute;ticos era por supuesto cerrado. Milagrosamente nos encontramos con alguien que conoc&iacute;a al due&ntilde;o y le llam&oacute; para nosotros, pero menos milagrosamente no ejerc&iacute;a el tama&ntilde;o de los neum&aacute;ticos que necesit&aacute;bamos. Pasamos la tarde y lunes llamando por ah&iacute; tratando de encontrar alguna manera de obtener un neum&aacute;tico a los Springboks con urgencia. Me estaba quedando sin tiempo antes de mi vuelo a Nueva Zelanda, y ten&iacute;a muchas ganas de explorar las carreteras secundarias en el camino a Ciudad del Cabo, en lugar de tener que correr hacia abajo. Desafortunadamente localizar un neum&aacute;tico result&oacute; dif&iacute;cil, y parec&iacute;a como si Jaap obtendr&iacute;a su neum&aacute;tico el mi&eacute;rcoles como muy pronto. Como Jaap quedarse m&aacute;s tiempo que yo en Sud&aacute;frica y tendr&iacute;a tiempo para explorar despu&eacute;s de Navidad, me decid&iacute; a ir del campo por una explorar con la captura de &eacute;l, as&iacute; que nos podr&iacute;a llegar a Cabo<br />\r\nTerminal tyreTerminal neum&aacute;ticos<br />\r\nneum&aacute;tico Terminal<br />\r\nAgulhas juntos.</p>\r\n\r\n<p>Alguien o menos un mes anterior hab&iacute;an sugerido que me dirijo hacia las colinas al sureste de Clanwilliam, as&iacute; que nos detuvimos all&iacute; para la gasolina y se meti&oacute; en una charla con un chico con rastas con un ute lleno de juguetes de los ni&ntilde;os que estaba viajando por el pa&iacute;s tratando de vender . Sugiri&oacute; que me dirijo a Wupperthal y luego al sur de all&iacute;. Esto result&oacute; ser una excelente sugerencia. Despu&eacute;s de enrollar mi camino hacia arriba y sobre un pase alcanc&eacute; Wupperthal, un pueblo germ&aacute;nico incongruente en medio de las monta&ntilde;as de Cederberg que hab&iacute;an sido fundadas por misioneros en 1830. Despu&eacute;s de parar para tomar un aperitivo en la tienda de la ciudad, y luego sentirse fuera de lugar mientras yo com&iacute;, he seguido una pista en el GPS que parec&iacute;a interesante, pero era concerniente a poco en su robustez. Quer&iacute;a explorar, pero el tiempo era escaso, y yo no quer&iacute;a ser atrapado por m&iacute; mismo en el medio en ninguna parte. Sin embargo, mi preocupaci&oacute;n se desvaneci&oacute; despu&eacute;s de hacerlo sobre otro paso y encuentro con el espectacular paisaje de la reserva natural de Matjiesrivier. Guau. El montar por ti mismo en zonas desconocidas aislados a veces puede ser un poco estresante, pero la emoci&oacute;n de tener<br />\r\nSe fueron todos hacia fuera en el dise&ntilde;o y materiales para este sign.They desvivi&oacute; en el dise&ntilde;o y los materiales para este signo.<br />\r\nSe fueron todos hacia fuera en el dise&ntilde;o y los materiales para este signo.<br />\r\nun espectacular paisaje a ti mismo, sin encontrar a nadie en el camino para una tarde compensa lo que tal s&iacute; les gusta: &quot;si yo se desplom&oacute; sobre el acantilado nadie me encuentre por d&iacute;a&quot;.</p>\r\n\r\n<p>Sal&iacute; por la tarde en un camino de grava m&aacute;s grande, y poco despu&eacute;s nos tropezamos con el Cederberg Oasis, una casa de hu&eacute;spedes con camping que estaba escondido en medio de un espectacular paisaje de colinas sedimentarias inclinadas por las fuerzas tect&oacute;nicas intercontinentales y erosionadas por la molienda de los antiguos glaciares. El paisaje, la piscina, la cerveza fr&iacute;a, la hospitalidad, filetes-mu&ntilde;eca de espesor, y la bandera masiva KTM detr&aacute;s de la barra, significa que incluso despu&eacute;s de la emoci&oacute;n de paseo del d&iacute;a, que realmente se sent&iacute;a como un oasis.</p>\r\n\r\n<p>A la ma&ntilde;ana siguiente me dej&oacute; con Werner, un ciclista de Ciudad del Cabo, y nos dirigimos a trav&eacute;s del ambiente &aacute;rido del Gran Karoo y Little Karoo hacia Cape Agulhas. Incluso con mi amortiguador trasero soplado las pistas de tierra eran muy divertido, y me pareci&oacute; que iba a terminar con regularidad siendo muchos minutos por delante de Werner - tres meses en la moto hab&iacute;an significado que hab&iacute;amos empezado a trabajar muy bien juntos. Esta diferencia en el ritmo era bueno, ya que me dio la oportunidad de parar,<br />\r\nCerca del Cederbarg Oasis.Near el Oasis Cederbarg.<br />\r\nCerca del Oasis Cederbarg.<br />\r\napagar la moto, toma mi casco, y sumergirse en el paisaje.</p>\r\n\r\n<p>Tierras de cultivo nos recibieron como nos acercamos a la costa, y nos detuvimos a tomar una cerveza con uno de los compa&ntilde;eros de Werner en Bredasdorp. M&aacute;s de un &quot;lekker&quot; fue pronunciada antes de irnos para mochileros cerca de Cape Agulhas. Compartimos una cena excelente hamburguesa con un par de Islandia en su luna de miel, y luego lav&oacute; abajo con un poco impresionante cerveza artesanal. El island&eacute;s mont&oacute; enduro competitivos, y explic&oacute; c&oacute;mo hicieron los neum&aacute;ticos de hielo mediante la perforaci&oacute;n de cientos de tornillos a trav&eacute;s de los neum&aacute;ticos desde el interior. Entonces recib&iacute; la confirmaci&oacute;n de Jaap que nosotros all&iacute; se reunir&iacute;a la ma&ntilde;ana siguiente, a las 10 de la ma&ntilde;ana para el viaje a Cabo Agulhas - genial.</p>\r\n\r\n<p>Jaap lleg&oacute; como a media ma&ntilde;ana estaba previsto. En el remolque fue Kev, un irland&eacute;s en un BMW GS1200 que nos hab&iacute;a perseguido el continente, haciendo preguntas a su paso a trav&eacute;s del foro Horizons ilimitado y Facebook. Una botella de champ&aacute;n fue comprado en la ciudad antes de salir hacia el cabo, algo que para m&iacute; hab&iacute;a crecido en importancia durante el viaje. En un viaje como este te pasas un poco de tiempo dentro de los confines de su casco<br />\r\nCape Agulhas AgulhasCape<br />\r\nCabo Agulhas<br />\r\nimaginar la llegada a la meta. El viaje fue siempre sobre el viaje y no el destino, pero a pesar de los diferentes paisajes, culturas y climas, nuestro objetivo se mantuvo constante - Cabo Agulhas. Regularmente mis pensamientos se deriva a imaginar el momento en nuestra progresi&oacute;n hacia el sur, llegar&iacute;a a su fin - en alg&uacute;n momento se correr&iacute;a fuera de &Aacute;frica.</p>\r\n\r\n<p>A la hora del almuerzo, en el 19 de diciembre hicimos hecho correr fuera de &Aacute;frica. Con un sentido posiblemente fuera de lugar del derecho, ignoramos las se&ntilde;ales de prohibici&oacute;n motos del camino que conduce al marcador para el punto m&aacute;s meridional de &Aacute;frica y la l&iacute;nea oficial divisoria entre el Atl&aacute;ntico y el &Iacute;ndico. Estacionado con cada una de nuestras bicicletas en frente de un oc&eacute;ano diferente que nos metimos el champ&aacute;n y saborear el momento. En lugar de ser una celebraci&oacute;n de un gol, llegando a Cabo Agulhas me permiti&oacute; mirar metaf&oacute;ricamente norte y saborear las muchas experiencias que hab&iacute;amos tenido en el camino a trav&eacute;s de &Aacute;frica: un sabor de un nuevo continente en T&uacute;nez; devastada por la guerra y extraordinariamente amable Libia; monumentos antiguos y los disturbios civiles en Egipto; animales en peligro de 4000m alto en las tierras altas de Etiop&iacute;a; pir&aacute;mides desiertas en los desiertos marcianos de Sud&aacute;n; tribus sed colorido<br />\r\nPico de PeakChapman de Chapman<br />\r\nPico de Chapman<br />\r\ny el camino del infierno en Kenia; Lago Tanganyika nos lleva desde las sinuosas carreteras de Burundi, a trav&eacute;s de la vida silvestre de Tanzania, y que termina con un banquete de pescado Zambia; la corrupci&oacute;n, el camino de tierra roja y de la selva de la Rep&uacute;blica Democr&aacute;tica del Congo; las tormentas el&eacute;ctricas, &aacute;rboles baobab, y una tarde complicada en la silla en Botswana, paisajes alucinantes, paseos emocionante, un pueblo fantasma, y un desierto que viven en Namibia; y finalmente un viaje en solitario a trav&eacute;s del Cederberg y Reserva Natural Matjiesrivier aqu&iacute; en Sud&aacute;frica.</p>\r\n\r\n<p>Se sent&iacute;a bien estar en el Cabo Agulhas, y mientras que podr&iacute;a haber convertido f&aacute;cilmente norte para dirigirse a la costa occidental de &Aacute;frica, tambi&eacute;n me estaba perdiendo de seguimiento y Finn, y no pod&iacute;a esperar para verlos en unos pocos d&iacute;as para la Navidad.</p>\r\n\r\n<p>Un viaje al oeste bajo los acantilados que asoman monstruosos lo largo de la costa nos llev&oacute; cerca de Ciudad del Cabo, y como era mi &uacute;ltimo d&iacute;a en la moto me tom&oacute; un desv&iacute;o a trav&eacute;s de la espectacular Pico de Chapman. Esto significaba que entr&eacute; en Ciudad del Cabo desde el sur, lo que era extra&ntilde;o que durante tres meses Ciudad del Cabo hab&iacute;a sido el ep&iacute;tome del &quot;sur&quot;.</p>\r\n\r\n<p>Al d&iacute;a siguiente me mont&eacute; la bicicleta a la empresa naviera y la prepar&oacute; para<br />\r\nTabla MountainTable Monta&ntilde;a<br />\r\nTable Mountain<br />\r\nel viaje hacia el mar de vuelta a casa. Ella hab&iacute;a sido una brillante corcel, como diversi&oacute;n y de pie firme en la pista como estaba fuera de la carretera. Aparte del amortiguador trasero soplado y un filtro de combustible ahogada, ella hab&iacute;a abordado todo un continente sin perder el ritmo. Su embalaje en una caja y dej&aacute;ndola con extra&ntilde;os parec&iacute;a bastante ingrato.</p>\r\n\r\n<p>Mi &uacute;ltimo d&iacute;a completo en &Aacute;frica se emplea caminando entre el ecosistema &uacute;nico en la parte superior de la monta&ntilde;a de la Mesa. Descalzo sobre la piedra plana de la monta&ntilde;a, con la sobrecarga de sol y una vista espectacular sobre Ciudad del Cabo y la zona circundante hecha para una forma apropiada para despedirse de &Aacute;frica.</p>\r\n', 'Sudáfrica: Un terminal Tiro', 'Neumáticos de Jaap era no sólo a la lona, pero a través de un par de capas. Como resultado el viaje 120 kilometros a los Springboks fue bastante tentativo. Sin embargo, nos', NULL, NULL, 0);
