(91, 31, 'es', 'No se suponía a Rain', '<p>No se supon&iacute;a que iba a llover en Ko Samui en esta &eacute;poca del a&ntilde;o.</p>\r\n\r\n<p>Hice un poco de investigaci&oacute;n sobre Ko Samui antes de que me decid&iacute; a pasar el fin de a&ntilde;o aqu&iacute;. Diciembre se supone que es tibia - hacer que caliente - y mayormente soleado. Tormentas t&iacute;picas de la tarde de lluvia, pero no el mal tiempo playa. Ten&iacute;a ganas de d&iacute;as de descanso bajo el sol, leyendo novelas baratas y nadar en las aguas azules.</p>\r\n\r\n<p>Sin embargo, el tif&oacute;n Hagupit aparentemente no ley&oacute; las mismas fuentes como lo hice. Se estacion&oacute; sobre las Filipinas alrededor de una semana antes de mi llegada en Ko Samui, causando la destrucci&oacute;n incalculable y cobrando la vida de al menos 27 personas. Despu&eacute;s de que el tif&oacute;n hab&iacute;a salido con la suya con las Filipinas, se traslad&oacute; hacia el oeste, perdiendo poco a poco el poder como lo hizo.</p>\r\n\r\n<p>Supongo que lo que est&aacute; directamente en el camino hacia el oeste de lo que es ahora Depresi&oacute;n Tropical Hagupit? S&iacute;, Ko Samui y yo.</p>\r\n\r\n<p>Ahora bien, esto no es algunos restos Wimpy de una tormenta. El viento era bastante fuerte para golpear sobre una taza medio llena de cerveza y romper el vidrio. Vi a un joven que trabajaba en el hotel toma una tabla de surf y volver en menos<br />\r\nWat Bo Bo Phut PhutWat<br />\r\nWat Bo Phut<br />\r\nde cinco minutos con media una tabla de surf, sin haber llegado m&aacute;s all&aacute; de la primera l&iacute;nea de interruptores. Esta fue la resaca que arroj&oacute; alrededor de los troncos de &aacute;rboles enteros, rompi&oacute; las bolas de amarre de su anclaje y nunca se disculp&oacute;. Yo no voy a nadar en eso. Al menos no todav&iacute;a.</p>\r\n\r\n<p>Conozco a un sacerdote anglicano retirado que me dice (con una cierta cantidad de alegr&iacute;a no-sacerdotal) &quot;planes hombre, Dios se r&iacute;e.&quot; Sin embargo, no soy nada si no es adaptable, y yo aprend&iacute; hace mucho tiempo que no voy a derretir en el lluvia, as&iacute; que me dirig&iacute; a la parte norte de la isla a hurgar.</p>\r\n\r\n<p>Fui a la carretera principal que hacerle un songthaew, que es una camioneta pick-up con dos asientos de banco fijo a lo largo de cada lado de la cama. Es el transporte barato y bastante fiable. Mientras esperaba en la llovizna de la por venir a lo largo, un chico en una moto se detuvo y se ofreci&oacute; a llevar a donde quer&iacute;a ir. Ahora montado en la parte trasera de una moto con un extra&ntilde;o en torcer los caminos y sin casco es suficiente desaf&iacute;o, pero hacerlo en la lluvia por el doble del costo de una songthaew - Bueno, eso fue f&aacute;cil<br />\r\nBo Phut stupaBo Phut estupa<br />\r\nBo Phut estupa<br />\r\ncomo para rechazarla.</p>\r\n\r\n<p>La otra cosa fresca sobre songthaews - que no sea el precio - es los pasajeros. En el songthaew hice se&ntilde;as a hab&iacute;a una se&ntilde;ora tailandesa con una cesta de cuatro cachorros samoyedo. Cachorros samoyedo parece que pertenecen a una tienda de juguetes, que son tan lindos y esponjosa. Adem&aacute;s de los cachorros hab&iacute;a una se&ntilde;ora h&uacute;ngaro que quer&iacute;a practicar su Ingl&eacute;s, y seis j&oacute;venes que podr&iacute;an haber pasado por luchadores de Muay Thai.</p>\r\n\r\n<p>Me dirig&iacute;a a Bo Phut en la costa norte. Este es el hogar del templo budista de Wat Bo Phuttharem, un pueblo de pescadores, y, un poco al este, Wat Phra Yai, tambi&eacute;n conocido como el Templo del Gran Buda.</p>\r\n\r\n<p>A instancias de la dama de Hungr&iacute;a, me baj&eacute; en el mercado mojado Bo Phut. Hab&iacute;a un mont&oacute;n de fruta encantadora y un puesto de venta de tortas buena esposa. Este es un hojaldre con wintermelon o loto pasta, y dado que este es uno de mis pasteles favoritos, me compr&eacute; uno. (Yo te muestro una foto, pero me lo com&iacute;. Fue bueno.) A partir de ah&iacute; fue un corto paseo de Wat Bo Phuttharem.</p>\r\n\r\n<p>Me gusta visitar los templos budistas;<br />\r\ndetalle del templo buildingdetail de la construcci&oacute;n de templos<br />\r\ndetalle de la construcci&oacute;n de templos<br />\r\npor lo general son muy tranquilo y aceptando lugares. Wat Bo Phuttharem me confundi&oacute;, sin embargo, y no he sido capaz de averiguar mucho sobre &eacute;l. Los terrenos del templo son muy amplias, y parece que los nuevos edificios est&aacute;n subiendo. Es obvio que no est&aacute; preparado para los turistas, no hay se&ntilde;ales en cualquier idioma que no sea tailandesa, y, mientras que hab&iacute;a pabellones con im&aacute;genes de Buda, ninguno de los edificios del templo se abrieron como si estuvieran en la parte norte del pa&iacute;s.</p>\r\n\r\n<p>Puse una donaci&oacute;n en la caja para mi a&ntilde;o de nacimiento, y se sorprendi&oacute; cuando un canto pregrabado sali&oacute;. Supongo que el peso de las monedas activ&oacute; la grabaci&oacute;n. Cajas de donaci&oacute;n son bastante comunes en los templos, pero nunca he tenido un canto para m&iacute; antes</p>\r\n\r\n<p>Hab&iacute;a tumbas elaboradas que recubren las paredes del recinto, algo que nunca he visto en un templo budista. Me han dicho que la mayor&iacute;a de los tailandeses son cremados y sus cenizas mezclados en stupas de hormig&oacute;n alrededor del templo. He visto las placas del nombre en los templos, por lo que si una persona no tiene hijos a orar por ellos tendr&aacute;n las oraciones de los monjes. Yo nunca hab&iacute;a visto memoriales<br />\r\nmonjes venerados monksrevered<br />\r\nmonjes venerados<br />\r\nson como ellos, cada uno dedicado a un individuo en particular.</p>\r\n\r\n<p>Tal vez era mi estado de &aacute;nimo - bueno, probablemente era mi estado de &aacute;nimo - pero no logr&oacute; encontrar mi paz aqu&iacute;. Camin&eacute; por la carretera hasta el pueblo de pescadores, que es definitivamente una zona tur&iacute;stica. En medio de los bares, tiendas de camisetas, y un mont&oacute;n de tat con elefantes de producci&oacute;n masiva y de los Budas es posible que pueda encontrar un susurro del antiguo pueblo de pescadores, pero yo no lo vi.</p>\r\n\r\n<p>A unos cinco kil&oacute;metros m&aacute;s abajo del camino es el Wat Phra Yai, m&aacute;s com&uacute;nmente conocido como el Templo del Gran Buda. Gran Buda merece una entrada muy propio, por lo que ser&aacute; hasta la pr&oacute;xima.</p>\r\n\r\n<p>Mientras tanto, aqu&iacute; est&aacute; la leyenda de la Buena Esposa Cake:</p>\r\n\r\n<p>&Eacute;rase una vez, hab&iacute;a una muy mala pareja que vive en la China imperial. Se amaban y viv&iacute;an en un peque&ntilde;o pueblo. De repente, una misteriosa enfermedad se extendi&oacute; a trav&eacute;s de su pueblo, y el padre del marido se puso muy enfermo.</p>\r\n\r\n<p>La pareja pas&oacute; todo su dinero con el fin de tratar el padre del hombre, pero &eacute;l todav&iacute;a estaba enfermo. La esposa se vendi&oacute; como esclavo a cambio de dinero<br />\r\nedificio buildingtemple templo<br />\r\nla construcci&oacute;n de templos<br />\r\npara comprar medicamentos para su padre-en-ley. Una vez que el marido se enter&oacute; de lo que hizo su esposa, &eacute;l hizo un pastel lleno de wintermelon endulzado y almendra. Dedic&oacute; esta pasteler&iacute;a a su esposa, a quien nunca pudo olvidar, y lo vendi&oacute; en la calle. Su pastel se hizo tan popular que fue capaz de ganar suficiente dinero para comprar a su esposa.</p>\r\n', 'No se suponía que Rain', 'No se suponía que iba a llover en Ko Samui en esta época del año.', NULL, NULL, 0),
(92, 30, 'es', 'Recorrido gráfico Sri Lanka', '<p>Sri Lanka no tiene la misma actitud de la cabeza a los pies a la decoraci&oacute;n de la India, que todav&iacute;a mantiene tesoros sorprendentes si se toma el tiempo para mirar.<br />\r\nDesde los antiguos frescos de Sigiriya a los dibujos de Geoffrey Bawa, ex&oacute;ticos patrones maderas y textiles tradicionales caprichoso, es el mismo toque delicado y juguet&oacute;n.</p>\r\n', '', '', NULL, NULL, 0),
(93, 29, 'es', 'SRA Matruh Egipto', '<p>siempre impresionado por la esbelta silueta de los minaretes. Ellos parecen a&ntilde;adir gracia para igualar el skyline m&aacute;s ca&oacute;tica (un denominador com&uacute;n para las ciudades egipcias!).<br />\r\nIncluso aqu&iacute;, en Marsa Matruh, un peque&ntilde;o pueblo en la costa mediterr&aacute;nea, las torres blancas de la mezquita parecen imposiblemente alto y delgado al lado de los edificios frente al mar.</p>\r\n', 'Masra Matruh Egipto', 'siempre impresionado por la esbelta silueta de los minaretes. Parecen añadir gracia para igualar la línea del horizonte más caótica (un denominador común para las ciudades egipcias!).', NULL, NULL, 0),
(95, 48, 'es', 'Sobre Nosotros', '<p>PHPtravels que proporcionan el mejor y usuario de la aplicaci&oacute;n amigable para nuestros clientes, con herramientas extensas especialmente para los viajes de negocios en l&iacute;nea de reserva de hoteles a los vuelos de reservas, tambi&eacute;n ofrecemos soluciones y servicios web personalizados. Con m&aacute;s de 4 a&ntilde;os de experiencia phptravels.com han ganado, sin duda, una reputaci&oacute;n de ser una fuente de confianza, un socio fiable y un experto en el &aacute;rea de las aplicaciones de negocio de viajes en l&iacute;nea.</p>\r\n\r\n<p>La combinaci&oacute;n de nuestros servicios, 24/5 ayuda sin parar, nuestra fijaci&oacute;n de precios, forma amistosa de hacer negocios, y nuestra filosof&iacute;a corporativa compasivo es muy singular en el mundo empresarial actual. Nos enorgullecemos de servicio al cliente excepcional y nos esforzamos en construir relaciones duraderas con nuestros clientes, por lo que es f&aacute;cil y rentable para ellos hacer negocios con nosotros.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Valoramos a nuestros clientes y nos centramos en la satisfacci&oacute;n del cliente. Es por eso que el apoyo post-venta es un factor clave en nuestro enfoque. Con toda esta rica experiencia, ahora a trav&eacute;s de PHPtravels estamos obligados a cumplir con la satisfacci&oacute;n del cliente y establecer la confianza.</p>\r\n\r\n<p>Si usted est&aacute; buscando para mejorar su negocio de viajes en l&iacute;nea, PHPtravels funciona como la mejor soluci&oacute;n de una parada con interfaz f&aacute;cil de usar y un gran caracter&iacute;sticas tales con precios que responden a su presupuesto.</p>\r\n\r\n<p>Para ponerse en contacto con nosotros puedes utilizar nuestro sistema de mesas de apoyo, o no dude en seguirnos en Twitter o Facebook. Por favor no dude en contactarnos.</p>\r\n', '', '', NULL, NULL, 0),
