(106, 48, 'tr', 'Hakkımızda', '<p>U&ccedil;uş rezervasyon i&ccedil;in rezervasyon otellerden &ouml;zel online seyahat iş i&ccedil;in kapsamlı ara&ccedil;ları ile m&uuml;şterilerimize en iyi ve kullanıcı dostu bir uygulama sağlayan PHPtravels, biz de &ouml;zel web &ccedil;&ouml;z&uuml;mleri ve hizmetleri sağlamak. Deneyim phptravels.com 4 yılı aşkın tartışmasız g&uuml;venilir bir kaynak, g&uuml;venilir bir ortak ve online seyahat iş uygulamaları alanında uzman olmak i&ccedil;in bir &uuml;n kazandı.</p>\r\n\r\n<p>Hizmetlerimizin, 24/5 kesintisiz destek, fiyatlandırma, iş yapma samimi bir şekilde ve bizim şefkatli kurumsal felsefemiz kombinasyonu bug&uuml;n&uuml;n iş d&uuml;nyasında &ccedil;ok benzersizdir. Biz istisnai m&uuml;şteri hizmetleri kendimizle gurur duyuyoruz ve onları bizimle iş yapmak i&ccedil;in kolay ve karlı hale getirerek m&uuml;şterilerimiz ile kalıcı ilişkiler kurmak i&ccedil;in &ccedil;alışıyoruz.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>M&uuml;şterilerimize değer ve m&uuml;şteri memnuniyeti odaklanır. Satış sonrası destek yaklaşımımızın &ouml;nemli bir fakt&ouml;r olmasının nedeni budur. B&uuml;t&uuml;n bu zengin deneyimi ile, şimdi PHPtravels aracılığıyla m&uuml;şteri memnuniyetini karşılamak ve g&uuml;ven oluşturmak bağlanmıştır.</p>\r\n\r\n<p>Eğer online seyahat iş geliştirmek isteyen varsa, b&uuml;t&ccedil;enize uygun fiyatları ile kullanıcı dostu aray&uuml;z&uuml; ve b&ouml;yle bir b&uuml;y&uuml;k &ouml;zellikleri ile en iyi bir durak &ccedil;&ouml;z&uuml;m olarak işlevlerini PHPtravels.</p>\r\n\r\n<p>Bizimle temasa ge&ccedil;mek bizim destek masası sistemini kullanabilir veya Twitter ya da Facebook bizi takip etmeye &ccedil;ekinmeyin. Bizimle irtibata ge&ccedil;mekte teredd&uuml;t etmeyiniz.</p>\r\n', '', '', NULL, NULL, 0),
(108, 46, 'tr', 'Tedarikçi ol', '<p>B&uuml;y&uuml;k, k&uuml;resel izleyici</p>\r\n\r\n<p>Biz herkesten daha fazla &ouml;zelliklere sahip doğrudan &ccedil;alışmak. Tatil aile tarafından işletilen pansiyonlar, biz d&uuml;nya &ccedil;apında seyahat b&uuml;y&uuml;k bir kitleye mal g&ouml;stermek</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hi&ccedil;bir kayıt &uuml;cretleri, abonelikler veya sabit maliyetler</p>\r\n\r\n<p>Bizimle Kayıt tamamen &uuml;cretsizdir. Hi&ccedil;bir kayıt veya abonelik maliyetleri vardır.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Komisyon-tabanlı model</p>\r\n\r\n<p>Bu &ouml;zellik bize her teyit fiyatının y&uuml;zdesi &ouml;der demektir. Bu, Google, Bing ve Yahoo, artı bizim 5000&#39;den fazla bağlı ortağı siteleri gibi arama motorlarında geniş reklam erişmenizi alır.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>41 dilde Senin İşletme bilgilerini</p>\r\n\r\n<p>Biz b&uuml;y&uuml;k bir &ouml;zellikleri ile &ccedil;alışmak ve yerel alakalı bir şekilde sunmak, d&uuml;nya &ccedil;apında &ccedil;&uuml;nk&uuml; gezginler arasında &uuml;st se&ccedil;imdir.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dilde, bizim m&uuml;lk sahipleri ve misafirler i&ccedil;in 24/7 yardım</p>\r\n\r\n<p>Kolayca bizim basit &ccedil;evrimi&ccedil;i ara&ccedil;lar ile kaydınızı ve rezervasyon y&ouml;netmek. Her ihtimale karşı - &Ouml;zel destek ekibimiz burada yardımcı olmak i&ccedil;in g&uuml;n&uuml;n her saati olduğunu.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ajan Kayıt İ&ccedil;in Uygula</p>\r\n', '', '', NULL, NULL, 0),
(110, 36, 'tr', 'rezervasyon İpuçları', '', '', '', NULL, NULL, 0),
(111, 35, 'tr', 'Virgin Gorda', '<p>K&uuml;&ccedil;&uuml;k bir uyarı, Club Med 2<br />\r\nClub Med 2Club Med 2<br />\r\nClub Med 2<br />\r\nFransız ve hissediyor. Teknede bu hafta 280 misafirler dışarı, ben bir tane en azından bazı Fransızca konuşmak değil sanmıyorum. Eğer sadece burada İngilizce konuşabilir eğer olduk&ccedil;a sıkıcı bir hafta olacağını ... ve farkında olabilir gibi Fransızca dışında başka bir şey konuşmak i&ccedil;in geldiğinde ... Fransa&#39;da yaşayan Fransız insanlar emmek. Sen d&uuml;r&uuml;st uyardı!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Yani bu sabah, bu BVI zamanı. Hayır ben buraya iş i&ccedil;in gelmiyorum. Ve BVI sadece &ccedil;ok g&uuml;zel plajları, yatlar ve İngiliz Virgin Adaları i&ccedil;in durmak yok ... Offshore şirketler i&ccedil;in durmazsa. Biz Dominika b&uuml;t&uuml;n gece uzun kalkmıştı ... Dominika Topluluğu ve k&ouml;t&uuml; .... BVI İngiliz B&ouml;lgesi ve olduk&ccedil;a zengin olduğunu.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bana Thierry .... aynı yaşta olan benim g&uuml;n ge&ccedil;irdim, ve bu hafta biraz eğlenmek i&ccedil;in hazır. Biz bu yolculukları onların otuzlu tek bayanlar bulmuyorum biliyoruz g&uuml;n&uuml;n sonunda ... biz biliyorduk &Ccedil;&uuml;nk&uuml; bizim kitap okumak daha başka bir şey yapmak organize etmek gerekir! Virgin Gorda hakkında &ouml;devimi yapmadım. Ben dalış ortalama kew ve seyir bizim i&ccedil;in organize ıstakoz Barbek&uuml; &ouml;ğle yemeği vardı<br />\r\nIstakoz s&uuml;resi ... Istakoz zaman ...<br />\r\nIstakoz s&uuml;resi ...<br />\r\nplaj! Yani biz sadece sabah sahilde gitmek niyetiyle bir &quot;Beacher&quot; aldı.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&quot;Bir&quot; plaj Kul&uuml;b&uuml; Med sabah kiralanan bir servis vardı. &Ouml;n&uuml;m&uuml;zdeki rasta s&uuml;r&uuml;c&uuml;s&uuml; ... evet adam ayarlanır ... ve o yolda bize d&uuml;şt&uuml;. Bu tamamen dışarı mavi, off-plan! Bize &quot;Hamam&quot; Ulusal Parkı keşfetmek gitmek i&ccedil;in zaman oldu. Bu Milli Parkı &ccedil;eşit ... granit kayaların ayrılmış plajları bir dizi. Ben ilk ciddi eğlenmek i&ccedil;in hazır gen&ccedil;ler i&ccedil;in macera zammı &ccedil;eşit olduk&ccedil;a kendimi bulmadan &ouml;nce ... Seyşeller hissettim. Vay, bu şaşırtıcı bir yerdir!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Biz bile biz sadece sağ izi olsaydı dolaşıp gibi ıssız koylarda kaybolmadan ... plaj plaj gidiyor ve bu b&uuml;y&uuml;k kayalar tırmanma b&uuml;t&uuml;n sabah ge&ccedil;irdi. Su, g&uuml;zel ve sıcak .... yatlar etrafında vardı, sadece d&uuml;z dolu eğlence ... basit!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Biz sadece son servisi i&ccedil;in zamanında geri Club Med plaja yolumuza yaptı. İyi fikir, biz Barbek&uuml; hi&ccedil;bir fikrim, ve geri binmek zorunda gibi<br />\r\nHavuz k&uuml;&ccedil;&uuml;k pina colada ... havuz k&uuml;&ccedil;&uuml;k pina colada ...<br />\r\nHavuz k&uuml;&ccedil;&uuml;k pina colada ...<br />\r\nseyir iniş noktası bir y&uuml;r&uuml;me olduk&ccedil;a oldu. Istakoz Barbek&uuml;! Bu sadece sadece sesler arada k&ouml;t&uuml; olamaz. Bu başka bir oldu ... salata G&uuml;l şarap ... ve evet, &ccedil;ok ıstakoz serbest akışı! G&uuml;neş bizim y&uuml;zleri ızgara ıstakoz gibi aynı renk sona erdi ... &ouml;ğle sonunda, orada .... ama bir kez daha ... eğlenceli oldu!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Geri teknede iyi bir şekerleme ve bazı y&uuml;zme havuzu s&uuml;re &ouml;nce kalabalıklar. Değil 280 konuk b&ouml;yle b&uuml;y&uuml;k bir yelkenli teknede kalabalık hissettiriyor ... ama kuyruk ger&ccedil;ekten bizim bir şey değil basit&ccedil;e.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Başka ger&ccedil;ekten eğlenceli gece bizi bekliyor ... ve Sam Amca arazi kısa bir yelken ... ya da ben &ccedil;ok yakında yazmak zorunda hangi başka eğlenceli bir maceraya ... i&ccedil;in, bu aslında olduk&ccedil;a yakın oldu!</p>\r\n', 'Virgin Gorda plajları ve lobste', 'Bu gerçekten eğlenceli haftanın ikinci ayağı. Biz başka bir yerde indiğimizde her sabah olsun maceralar değil, aynı zamanda tekne kendisi eğlenceli zaman vardır.', NULL, NULL, 0),
(112, 34, 'tr', 'Şiddetle Bağımsız Kültürler', '<p>Giderek homojen bir d&uuml;nyada, şiddetle bağımsız k&uuml;lt&uuml;rler ve yerler &ouml;zellikle ilgi &ccedil;ekici. Olası bunun bir sonucu anakara Avrupa ve Kuzey Amerika hem de coğrafi izolasyon var, İzlanda her zaman kendi benzersiz bir yol var almıştır. İzlandalı mimari ve moda kaliteli yerel malzemeler, k&uuml;lt&uuml;rl&uuml;, tedavi fermente veya salamura zaman İzlandalı paleti en rahat, bunun bir yansıması sıradışı coğrafya olduğunu ve İzlandalı insanlar kendi kendine yeterlilik ve &ccedil;evresel s&uuml;rd&uuml;r&uuml;lebilirlik mest. İzlanda, her zaman derinden nordic liberal duyarlılıklarını k&ouml;kl&uuml; olmuştur, ama başka bir milletin farklı, onlar d&uuml;nyanın ilk a&ccedil;ık eşcinsel kadın başbakan se&ccedil;ildi ve 2010 yılında 2009 yılında, 2008 resesyondan sonra kendi bankalarını kurtarmak i&ccedil;in reddetti, Reykjavik John Gnarr, se&ccedil;ildi punk rock şarkıcısı, komedyen ve kendini onların belediye başkanı olarak anarşist ilan etti. Fiziksel peyzaj k&uuml;lt&uuml;r&uuml; kendisi kadar &ccedil;arpıcı ve benzersiz; siyah volkanik kaya, yemyeşil alanlar, jeotermal delikleri ve dramatik volkanlar kaplı bir ada. Bu Dennie, Henry ve ben, biz, sıcak havuzlarda y&uuml;zme fiyortları ile s&uuml;r&uuml;ş ve lezzetli Skyr (İzlanda yoğurt) yeme 9 g&uuml;n ge&ccedil;irmek istiyorum Paskalya tatili, &uuml;zerinde Reykjavik i&ccedil;in bir u&ccedil;ağa bindik akılda bu, oldu.</p>\r\n\r\n<p>İzlanda pahalıdır. olarak<br />\r\nEyjafjallaj&ouml;kull yakın Eyjafjallaj&ouml;kullHiking yakın y&uuml;r&uuml;y&uuml;ş<br />\r\nEyjafjallaj&ouml;kull yakınındaki Y&uuml;r&uuml;y&uuml;ş<br />\r\nBizim planı Sadcar bir, eski paslı ama esas g&uuml;venilir araba (280,000 Kms ile 2002 Yaris) kiralama maliyetleri dahil, Bonus marka bakkaliye ile kiralık daire 2 &uuml;zerinden 3 &ouml;ğ&uuml;n yemek ve az alışveriş yapıyor azaltmak i&ccedil;in bir yol m&uuml;mk&uuml;n olduğunca. G&uuml;mr&uuml;k y&uuml;r&uuml;rken &uuml;zerine biz Havaalanından bir alanda bir Quonset 10 dakika g&ouml;t&uuml;rd&uuml;ler iki Sadcar &ccedil;alışanlarının dışında biri olduğunu varsayalım ne tarafından karşılandık b&uuml;t&ccedil;e odaklı olmak bizim planı hakkında bazı k&uuml;&ccedil;&uuml;k &ccedil;ekinceleri var başladı. Biz Henry i&ccedil;in bir carseat hakkında sordu, onlar 3 &ccedil;ok kullanılan ve hafif kırık carseats kaşkol ve soğutma sıvıları arasında oturdu oto kaportacı / araba kiralama mezarlığın arkasına bizi y&ouml;netti. Dennie bizim Sadcar i&ccedil;ine y&uuml;klenen ve bir k&uuml;&ccedil;&uuml;k kar fırtınası yoluyla Reykjavik doğru &ccedil;ıkardı, partinin en işlevsel se&ccedil;ti.</p>\r\n\r\n<p>Bizim k&uuml;&ccedil;&uuml;k Ikea daire m&uuml;kemmel Hallgrimskirka, şehri keşfetmek i&ccedil;in seyahat bir pusula sağlayan sivri Lutheran kilise caddede yer oldu. Bizim sabahları &ccedil;oğu sokaklarda merak harcandı gibi bu, ana &uuml;s olarak sahip olmak harika bir konum oldu<br />\r\nHarpa i&ccedil;inde Hank ve ben HarpaHank i&ccedil;inde ve ben<br />\r\nHarpa i&ccedil;inde Hank ve ben<br />\r\nAna zemin ticari alan ile renkli teraslı evler rahat kanepeler ve &uuml;cretsiz espresso (12 Tonar) ile rekor d&uuml;kkanlar, İzlanda tasarım ve mobilya mağazaları, vejetaryen kafeler, barlar, kul&uuml;pler ve k&ouml;ri evleri ile noktalı bir canlı ve yapılabilen şehir sağlayan eski şehir. Biz Erro post modern bir eserleri ve Kjarval k&uuml;bist ve soyut manzara resimleri &ccedil;ağdaş İzlandalı sanat&ccedil;ıların sergi d&ouml;nen yanındaki asmak Reykjavik Sanat M&uuml;zesi (Hafnarhus, Kjarvalsstadir, Asmundarsafn) her &uuml;&ccedil; yerleri ziyaret etti. Biz &quot;, Einar Jonsson Heykel Parkı bir Paskalya yumurtası avı t&ouml;kezledi Harpa i&ccedil;inde yayılan salonlarında oynanan kartlar ve (halk k&uuml;t&uuml;phanesi i&ccedil;inde) Fotoğraf Reykjavik M&uuml;zesi, Viking Saga M&uuml;zesi, Reykjavik &Ccedil;ocuk Parkı ve aldı zoo &quot;(bir sevişme hayvanat bah&ccedil;esi daha fazla) ve Pearl g&ouml;zlemevi asans&ouml;r aldı. Şehir hen&uuml;z şaşırtıcı kozmopolit şehir sınırları i&ccedil;inde sadece 120.000 kişi olduğunu hatırlatmak gibi davranan k&uuml;&ccedil;&uuml;k bir kasaba misafirperverliği korur.</p>\r\n\r\n<p>Reykjavik&#39;in merkezinde barlar ve restoranlar maliyeti y&uuml;ksek olmasına rağmen lezzetli ve taze yemekler sunan makul fiyatlı atılmış bir dizi bulmayı başardılar. Babalu (ızgara: İşte bazı &ouml;neriler şunlardır<br />\r\nEinar J&oacute;nsson Heykel Garden Einar J&oacute;nsson Heykel GardenEaster Yumurta Hunt Easter Egg Hunt<br />\r\nEinar J&oacute;nsson Heykel Garden Easter Egg Hunt<br />\r\nArka planda Hallgr&iacute;mskirkja.<br />\r\npeynir ve domates &ccedil;orbası), C &Ccedil;erez (ev yapımı &ccedil;orba ve sandvi&ccedil; b&uuml;y&uuml;k cheesecake), Laundromat Cafe (k&ouml;k sebzeler ile g&ouml;l alabalığı olağan&uuml;st&uuml; ve bodrum &ccedil;ocuk oyun alanı seyretmek i&ccedil;in bir şey!), Austur Hindistan Fjelagid (lezzetli i&ccedil;indir vejetaryen Thali), Graen Kostur (g&uuml;nde iki &ouml;ğle yemeği se&ccedil;enekleri ile Doğu ilham f&uuml;zyon vejetaryen yemek). İ&ccedil;ecekler i&ccedil;in, MicroBar&#39;ın (5-8 pm Happy Hour) dokunun yerel zanaat bira bir yeri vardır. Labowski Bar da inanılmaz bir yer gibi g&ouml;r&uuml;n&uuml;yordu ama biz bir şeyler i&ccedil;mek i&ccedil;in kalmak yoktu bu y&uuml;zden y&uuml;r&uuml;d&uuml; onlar pub trivia yapıyorduk.</p>\r\n\r\n<p>Bizim Sadcar Reykjavik g&uuml;nl&uuml;k geziler bir dizi y&ouml;netilen; bazı Rapids yakın bir piknik i&ccedil;in durdurma, Hvalfjorour (Balina Fjord) ile kuzey s&uuml;rd&uuml;. Biz Hverager&eth;i jeotermal kasaba ve Avrupa&#39;da u&ccedil;uş iptalleri neden 2010 yılında patlak veren &uuml;nl&uuml; Eyjafjallajokull volkanın &uuml;zerine s&uuml;rd&uuml;. Biz Şofben durur Altın &Ccedil;ember, Pingvellir Milli Parkı ve Gulfoss şelale s&uuml;rd&uuml;. Eğer Reykjavik terk kez coğrafya sade ama yeşil alanlar boyunca manzara s&uuml;sleyen termal delikleri havaya y&uuml;kselen siyah volkanik kaya, inişli &ccedil;ıkışlı tepeler, sarp dağ ge&ccedil;er ve buhar ile noktalanan ile g&ouml;rkemli.</p>\r\n\r\n<p>Dennie<br />\r\nBlue Lagoon Mavi LagoonOutside Dışında<br />\r\nBlue Lagoon Dışında<br />\r\nve ben hızlı bir bebek ile seyahat ederken, deneyim t&uuml;m planlama bebek etrafında d&ouml;ner eğer t&uuml;m i&ccedil;in daha eğlenceli olduğunu ger&ccedil;ekleşme geldim. Reykjavik&#39;in efsanevi gece hayatı bir kalıntı ile ebeveynlik, bir veya iki kez ismimi &ccedil;ağırdı olabilir iken kesinlikle yoktu. Bu nedenle, biz termal havuz k&uuml;lt&uuml;r&uuml; i&ccedil;ine kendimizi daldırarak İzlanda bizim zaman iyi bir anlaşma ge&ccedil;irdi. 122 termal havuzlar ve yalnız Reykjavik 17 ile, biz her g&uuml;n yeni bir havuzda y&uuml;zmek i&ccedil;in misyonumuzu yaptı. Reykjavik biz Laugardalslaug&#39;a, Sundhollin Arbaejarlaug, Grafarvogslaug, Sudurbaejarlaug ve Asvallalaug y&uuml;zd&uuml;m. İzlandalı &uuml;lke tarafında etrafında bizim g&uuml;nl&uuml;k geziler sırasında biz de şelaleler &ccedil;evrili bir dağ vadisinde bulunan ıssız Seljallalaug &ccedil;ıplak Hverageroi en g&uuml;zel havuzda y&uuml;zmek i&ccedil;in fırsat oldu ve pahalı ama inanılmaz Blue Lagoon bizim son g&uuml;n&uuml;nde. 9 g&uuml;n 9 havuzları. T&uuml;m kamu havuzlarında su jeotermal aracılığıyla, &uuml;cretsiz kimyasal ısıtılır, ve neredeyse t&uuml;m &quot;sıcak tencere&quot;, saunalar, y&uuml;zme i&ccedil;in şerit, &ccedil;ocuk havuzları, su kaydırağı bir dizi var. Ben termal havuzlar &ouml;nemli olduğunu halk ile sohbet &quot;sıcak tencere&quot; oturan benim zaman izlenim var<br />\r\nEnroute Seljvavellir sıcak havuza Seljvavellir sıcak havuzda enroute<br />\r\nSeljvavellir sıcak havuzda enroute<br />\r\ntopluluk &uuml;yeleri i&ccedil;in yer toplama. &Ccedil;eşitli havuzları ve yabancılarla ve arkadaşları ile a&ccedil;ık&ccedil;a sohbet arasında yaşlı ve gen&ccedil; hem hareket. Henry huysuz ya da yorgun anlarda biz her zaman onun hemen biz alıştık g&uuml;l&uuml;mseyen Hank geri d&ouml;n&uuml;şt&uuml;r&uuml;lm&uuml;ş olacak bir havuzdan birka&ccedil; dakika i&ccedil;inde olduğumuzu biliyordu. Havuzlarda kesinlikle bir bebek ile İzlanda seyahat &ccedil;ok daha kolay hale iken, ger&ccedil;ekten İzlanda &ccedil;ocuk dostu yerel yapmak İzlandalı insanlar. Neredeyse biz gittik her Restoran emzirme teşvik tabela vardı, bir &ccedil;ocuk oyun alanı vardı, ve t&uuml;m barlar ve publar &ccedil;ocuklar izin. İzlandalı insanlar sıcak ve giden ama y&uuml;ksek sesle değil ya iğren&ccedil; ve biz gittik olursa olsun, onlar &ccedil;ocukları ağırlamaktan yolları hakkında d&uuml;ş&uuml;nm&uuml;şt&uuml; gibiydi.</p>\r\n\r\n<p>İzlanda bizim son sabahı, ben Henry yığınları ile karıştırdı ise FM Belfast ve SeaBear dinlerken onların rahat kanepeler oturdu Tonar 12. bir ka&ccedil; CD&#39;ler almak i&ccedil;in bizim daire caddede y&uuml;r&uuml;d&uuml;. Sormadan, d&uuml;kkanı &ccedil;alıştıran adam bana bir espresso getirdi. Ben bir sehpa bir Reykjavik rehber kitap aldı ve<br />\r\nDennie bizim Sad CarDennie bizim Sad Araba s&uuml;r&uuml;ş S&uuml;r&uuml;ş<br />\r\nDennie bizim Sad Araba s&uuml;r&uuml;ş<br />\r\nziyaret&ccedil;iler i&ccedil;in belediye başkanının hoş geldiniz mesajı okumak i&ccedil;in ilk sayfaya kitabı a&ccedil;tı. Jon Gnarr (belediye başkanı), &uuml;lkenin menşe onun versiyonunu foretold. Okudum,</p>\r\n\r\n<p>&quot;Ama nasıl b&ouml;yle bir sıcak &uuml;lke b&ouml;yle bir soğuk isim sahip &ccedil;ıktığını olabilir Evet, a&ccedil;ıklama basit:?.. ANLAMA Ingolfur Arnarson, Reykjav&iacute;k bulunan ilk adam, burada t&uuml;m giderken değildi o oldu Amerika Birleşik Devletleri yolda, o gıda &ccedil;ok ilgilendi. o g&uuml;nlerde orada vahşi b&uuml;y&uuml;yen &uuml;z&uuml;m ve diğer hızlı yiyecek almak i&ccedil;in. ve de cinayet. yolda bir g&ouml;klere duman y&uuml;kselen bir bulut fark bilinmeyen &uuml;lke. onun meraklı doğa ona iyi var, ve o (Reykjavik kelimenin tam anlamıyla! &quot;dumanlı bay&quot; anlamına gelir) Reykjavik yaptığı kursu ve yelken değiştirdi.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Onun gemiyi karaya gibi, o duman Reykjavik&#39;in bir&ccedil;ok y&uuml;zme havuzları y&uuml;kselen aslında buhar olduğunu g&ouml;rd&uuml;k. O &uuml;z&uuml;m toplama ederken bazı Yerli Amerikalılar karşılaşırsanız ediyorum durumda giydiği zırh takım yırtmak ve bazı y&uuml;zmek mayo i&ccedil;ine atlama nedenle hızlı oldu. Bir iyi y&uuml;zme sonra<br />\r\nReykjavik TONAR 12. Indie m&uuml;zik s&uuml;r&uuml;ş ReykjavikHank testinde Tonar 12. Indie m&uuml;zik s&uuml;r&uuml;ş Hank testi<br />\r\nReykjavik TONAR 12. Indie m&uuml;zik s&uuml;r&uuml;ş Hank testi<br />\r\n500 metre o sıcak k&uuml;vet ve rahat oturdu. Halk ile eğlenceli bir sohbet sonra Amerika&#39;ya hakkında t&uuml;m unutmuştu. Kim Laugavegur&#39;da bir d&uuml;kkan V&iacute;nberi&eth; orada denir zaman &uuml;z&uuml;m almak i&ccedil;in Amerika&#39;ya t&uuml;m yol yolculuk gerekiyor (V&iacute;nberi&eth; anlamına gelmektedir: &quot;&uuml;z&uuml;m&quot;)? Ingolfur burada yerleşmeye karar verdi. Bir&ccedil;ok iddia &#39;Y&uuml;z&uuml;klerin Efendisi&#39; den Frodo kızı eşi, Hallveig Fr&oacute;&eth;ad&oacute;ttir ile birlikte k&uuml;&ccedil;&uuml;k bir daire kiraladı. Hi&ccedil;bir şey, ancak bu konuda kanıtlanmıştır.</p>\r\n\r\n<p>Bir g&uuml;n Ingolfur ve Hallveig şehir etrafında bir gezintiye g&ouml;t&uuml;r&uuml;yorlardı. Onlar Pluto denilen ve bir Danua oldu onların k&ouml;pek, y&uuml;r&uuml;yorduk. Bu cızırtılı sıcak bir yaz g&uuml;n&uuml;yd&uuml;. T-shirt icat edilmeden &ouml;nce uzun oldu. Her ikisi de kılı&ccedil; ve kalkan ve kask ve her şeyi ile, zırh tam takım elbise giymiş. Onlar bazı dondurma almak ve soğumasını Hagamelur i&ccedil;inde &Iacute;sb&uacute;&eth; Vesturbaejar tarafından durduruldu. Hikaye o &uuml;lkenin denilen biliyordu olmadığını Ingolfur katip istedi gider.</p>\r\n\r\n<p>O Thule adında d&uuml;ş&uuml;nd&uuml;m. Ingolfur bir aptal isim olduğunu hissettim.</p>\r\n\r\n<p>&quot;Hi&ccedil;bir &uuml;lke Thule adında edilebilir&quot; dedi.</p>\r\n\r\n<p>dışında<br />\r\nHenry Eyjafjallajokull tiyatro i&ccedil;inde Eyjafjallajokull theatreHenry i&ccedil;inde<br />\r\nEyjafjallajokull tiyatro i&ccedil;inde Henry<br />\r\ndondurma d&uuml;kkanı, bir kalabalık toplanmıştı. Onlar yabancı ziyaret&ccedil;iler kasabasında olduğunu duymuştum. Bu insanların bir s&uuml;r&uuml; elfler vardı. Ingolfur sonra, kalabalık yaklaştı havada onun dondurma koni kaldırdı ve bağırdı:</p>\r\n\r\n<p>&quot;Burada kimse d&uuml;nyanın en iyi dondurma alabilirsiniz &ccedil;&uuml;nk&uuml; Bundan sonra bu &uuml;lkenin, İzlanda adı verilecek!&quot;.</p>\r\n\r\n<p>Bug&uuml;n Ingolfur bir heykeli var. Heykel Ingolfur k&ouml;peği yaslanmış, ısı &ouml;l&uuml;yor resmediyor.</p>\r\n\r\n<p>Bir yabancı olmayın, Ingolfur gibi! &quot;</p>\r\n\r\n<p>Sadece İzlanda!</p>\r\n', 'Şiddetle Bağımsız Kültürler', 'sempre più omogeneo, culture e luoghi fieramente indipendenti sono particolarmente intrigante. Probabilmente a causa del suo isolamento geografico sia da', NULL, NULL, 0),
(113, 32, 'tr', 'Güney Afrika: Terminal Lastik', '<p>Jaap lastik sadece tuval aşağı, ama katmanları bir &ccedil;ift ile oldu. Sonu&ccedil; olarak Springbok 120km binmek olduk&ccedil;a belirsiz bir oldu. Biz ancak &ouml;ğle vakti etrafında g&uuml;venli bir şekilde ulaşması ve Jaap i&ccedil;in bir lastik izini edememek umutlu olduklarını etmedi. Ancak bir Pazar ve Nelson Mandela&#39;nın cenazesi g&uuml;nd&uuml;, ve tabii ki kapalı lastik kıyafeti oldu. Mucizevi biz sahibi biliyordu ve bizim i&ccedil;in onu aradım, ama daha az mucizevi o biz gerekli lastik boyutunu tutun vermedi biriyle tanıştım. Biz acilen Springbok bir lastik almak i&ccedil;in bir yol bulmaya &ccedil;alışırken etrafında telefon ederek Pazartesi &ouml;ğleden sonra ve ge&ccedil;irdi. Ben NZ benim u&ccedil;uş &ouml;ncesi zaman t&uuml;keniyor, ve olduk&ccedil;a aşağı acele zorunda daha Cape Town, yolda geri yollar keşfetmek i&ccedil;in istekli oldu. Ne yazık ki bir lastik bulma zor oldu, ve o Jaap erken &Ccedil;arşamba g&uuml;n&uuml; yaptığı lastik alacağı gibi g&ouml;r&uuml;n&uuml;yordu. Jaap G&uuml;ney Afrika&#39;da benden daha uzun kaldığını ve sonra Noel keşfetmek i&ccedil;in zaman olurdu, ben Cape ona yetişmeye y&uuml;zden vurabilecek ile keşfetmek bir kapalı baş verdi<br />\r\nTerminal tyreTerminal lastik<br />\r\nTerminal lastik<br />\r\nBirlikte Agulhas.</p>\r\n\r\n<p>Bir ay kadar &ouml;nce Birisi g&uuml;neydoğusunda Clanwilliam tepelerine baş &ouml;ne s&uuml;rm&uuml;şt&uuml;, bu y&uuml;zden o satmaya &ccedil;alışan &uuml;lke &ccedil;apında geziyordu &ccedil;ocuk oyuncakları ile dolu bir ute ile dreadlocked adam ile bir sohbet i&ccedil;ine benzin orada durdu ve var . O oradan g&uuml;neye sonra Wupperthal i&ccedil;in baş ve &ouml;nerdi. Bu m&uuml;kemmel bir &ouml;neri olduğunu kanıtladı. Yukarı ve bir ge&ccedil;iş &uuml;zerinde yolumu sarma sonra Wupperthal, kasaba deposundan bir aperatif i&ccedil;in durdurma ve daha sonra olduk&ccedil;a yersiz duygu sonra 1830 yılında misyonerler tarafından kurulan olmuştu Cederberg Dağları&#39;nın ortasında bir yersiz Germen k&ouml;y&uuml;ne ulaştı Ben yerken, ben ilgin&ccedil; g&ouml;r&uuml;n&uuml;yordu GPS bir par&ccedil;a izledi, ama biraz kendi sağlamlığı i&ccedil;inde ilgili oldu. Ben keşfetmek istedim, ama zaman dardı, ve ben hi&ccedil;bir ortasında kendim tutulmak istemedi. Ancak, benim endişe başka ge&ccedil;iş &uuml;zerine yapım ve Matjiesrivier Tabiatı muhteşem sahne karşılaşmadan sonra uzak soluk. Vay. Izole yabancı yerlerde kendiniz Binme bazen biraz sinir bozucu, ama sahip heyecanını olabilir<br />\r\nOnlar tasarımı t&uuml;m dışarı gitti ve bu sign.They i&ccedil;in malzemeler bu işareti tasarım ve malzeme &uuml;zerindeki t&uuml;m dışarı gitti.<br />\r\nOnlar bu işareti tasarım ve malzeme &uuml;zerindeki t&uuml;m dışarı gitti.<br />\r\nBir &ouml;ğleden sonra yolda başkasının karşılaşmadan kendinize muhteşem bir manzara,-IFS ne gibi yapar: &quot;Ben bu u&ccedil;urumun &uuml;zerinden d&uuml;şt&uuml; eğer kimse g&uuml;n beni bulur&quot;.</p>\r\n\r\n<p>Ben b&uuml;y&uuml;k bir &ccedil;akıl yol &uuml;zerine &ouml;ğleden sonra ortaya &ccedil;ıktı, ve kısa s&uuml;re sonra Cederberg Oasis, kıtalararası tektonik g&uuml;&ccedil;ler tarafından eğik ve antik buzulların taşlama aşınmış tortul tepelerin muhteşem bir manzara arasında sıkışmış oldu kamp ile bir misafirhane t&ouml;kezledi. Peyzaj, havuz, soğuk bir bira, misafirperverliği, bilek kalınlığında biftek ve barın arkasındaki b&uuml;y&uuml;k KTM afiş, hatta g&uuml;n&uuml;n s&uuml;r&uuml;ş heyecanını sonra, ger&ccedil;ekten bir vaha gibi hissettim anlamına geliyordu.</p>\r\n\r\n<p>Ertesi sabah ben Werner, Cape Town bir bisiklet&ccedil;inin sol, ve biz Cape Agulhas doğru B&uuml;y&uuml;k Karoo ve k&uuml;&ccedil;&uuml;k Karoo kurak ortamda aşağı y&ouml;neldi. Hatta benim şişmiş arka şok ile &ccedil;akıl yollar &ccedil;ok eğlenceli idi, ve ben d&uuml;zenli &ouml;ncesinde Werner bir&ccedil;ok dakika olmak kadar sona ereceğini bulundu - Birlikte olduk&ccedil;a iyi &ccedil;alışmaya başladığını geliyordu bisikletle &uuml;&ccedil; ay. Bana durdurmak i&ccedil;in bir şans verdi hızda bu fark, iyi oldu,<br />\r\nCederbarg Oasis.Near Cederbarg Oasis yakınında.<br />\r\nCederbarg Oasis civarında.<br />\r\n, bisiklet kapatmak benim kaskı &ccedil;ıkar, ve manzara emmek.</p>\r\n\r\n<p>Biz sahil yaklaşırken tarım arazileri bizi karşıladı, ve biz Bredasdorp Werner arkadaşları ile bir bira i&ccedil;in durdu. Biz Cape Agulhas yakın bir backpackers i&ccedil;in gitmeden &ouml;nce bir&ccedil;ok &quot;lekker&quot; &ccedil;ıkardı edildi. Biz onların balayı bir İzlandalı &ccedil;ift ile m&uuml;kemmel bir hamburger yemek paylaştı, ve sonra bazı etkileyici zanaat bira ile aşağı yıkadı. İzlandalı rekabet&ccedil;i enduro&#39;su bindi ve onlar i&ccedil;eriden lastikleri ile vida y&uuml;zlerce sondaj buz lastikleri yapılmış nasıl a&ccedil;ıkladı. Parlak - Ben o ertesi sabah Cape Agulhas binmek i&ccedil;in etrafında 10:00 orada bizi karşılamaya ki Jaap onay aldı.</p>\r\n\r\n<p>Jaap planlanan kuşluk olarak geldi. Yedekte Kev, o sonra Facebook Ufuklar Sınırsız forum &uuml;zerinden gitti ve gibi sorular sorarak, kıta bizi kovaladı olan BMW GS1200 bir İrlandalı oldu. Bubbly bir şişe burun, benim i&ccedil;in yolculuk sırasında &ouml;nemi b&uuml;y&uuml;m&uuml;ş şey &ccedil;ıkmadan &ouml;nce kasabasında satın alındı. B&ouml;yle bir gezi size kask sınırları i&ccedil;inde zaman biraz harcamak<br />\r\nCape Agulhas AgulhasCape<br />\r\nCape Agulhas<br />\r\nsenin gol varış hayal. Gezi yolculuğa ziyade hedef hakkında her zaman, ancak farklı manzaralar, k&uuml;lt&uuml;rler ve iklimlerde rağmen, hedefimiz sabit kalmıştır - Cape Agulhas. Biz Afrika t&uuml;kendi olacağını noktada - D&uuml;zenli benim d&uuml;ş&uuml;ncelerim bizim g&uuml;neye ilerleme sona geleceğini an hayal kayması olur.</p>\r\n\r\n<p>&Ouml;ğle vakti, 19 Aralık biz ger&ccedil;ekten Afrika t&uuml;kendi. Hak bir olasılıkla yanlış anlamda, biz Afrika&#39;nın en g&uuml;neydeki noktası ve Atlantik ve Hint okyanusları arasında resmi ayıran &ccedil;izgi i&ccedil;in işaretleyici giden yoldan motosiklet yasaklayan işaretler yok. Farklı bir okyanus &ouml;n&uuml;nde bizim bisiklet her ile park biz kabarcıklı attı ve an savoured. Aksine Cape Agulhas ulaşan bir gol bir kutlama olmaktan daha beni mecazi kuzeyi bakmak ve biz Afrika ile yolda vardı pek &ccedil;ok deneyim tadını &ccedil;ıkarmak i&ccedil;in izin: Tunus&#39;ta yeni bir kıtanın bir tat; savaşın par&ccedil;aladığı ve olağan&uuml;st&uuml; kolay Libya; antik anıtlar ve Mısır&#39;da halk ayaklanması; nesli t&uuml;kenmekte olan hayvanlar Etiyopya dağlık y&uuml;ksek 4000M; Sudan&#39;ın Mars &ccedil;&ouml;llerinde ıssız piramitler; renkli susuz kabilesi<br />\r\nChapman&#39;ın PeakChapman Peak<br />\r\nChapman&#39;ın Tepe<br />\r\nve Kenya&#39;da Cehennem Yolu; G&ouml;l Tanganyika Tanzanya yaban hayatı boyunca, Burundi sarma yollar bizi lider ve Zambiya balık ziyafeti ile biten; yolsuzluk, kırmızı toprak yol ve Kongo Demokratik Cumhuriyeti orman; yıldırım fırtına, baobab ağa&ccedil;ları ve Botsvana, zihin-&uuml;fleme manzara, heyecan verici s&uuml;rme, bir hayalet kasaba ve Namibya yaşayan bir &ccedil;&ouml;lde eyer sert &ouml;ğleden sonra; ve nihayet Cederberg ve burada G&uuml;ney Afrika&#39;da Matjiesrivier Tabiatı ile solo bir yolculuk.</p>\r\n\r\n<p>Cape Agulhas olmak iyi hissettim, ve kolayca Afrika&#39;nın batı kıyıları kadar kafa kuzey d&ouml;nd&uuml; olabilirdi ederken, ben de Trace ve Finn eksik ve Noel i&ccedil;in bir ka&ccedil; g&uuml;n i&ccedil;inde onları g&ouml;rmek i&ccedil;in sabırsızlanıyordu.</p>\r\n\r\n<p>Batı kıyısında korkun&ccedil; başg&ouml;steren u&ccedil;urumlar altında bir yolculuk Cape Town yakınlarındaki bize var, ve bisikletle benim son g&uuml;n olduğu gibi muhteşem Chapman&#39;ın tepe &uuml;zerinde bir dolamba&ccedil;lı yoldan aldı. Bu &uuml;&ccedil; ay boyunca Cape Town &quot;g&uuml;ney&quot; &Ouml;zet olmuştu garip g&uuml;ney, Cape Town, girdi geliyordu.</p>\r\n\r\n<p>Ertesi g&uuml;n nakliye şirketi i&ccedil;in bisiklet s&uuml;rd&uuml; ve onu hazır<br />\r\nMasa Dağı MountainTable<br />\r\nTable Mountain<br />\r\neve denize yolculuk. O kadar parlak bir at olmuştu eğlenceli ve o off-road gibi asfalt &uuml;zerinde emin adımlarla. Apart şişmiş arka şok ve kısık yakıt filtresinden, o bir ka&ccedil;ırmadan b&uuml;t&uuml;n kıtayı ele etmişti. Bir sandık i&ccedil;ine onu Ambalaj ve yabancılarla onu terk olduk&ccedil;a nank&ouml;r g&ouml;r&uuml;n&uuml;yordu.</p>\r\n\r\n<p>Afrika&#39;da Benim son tam g&uuml;n Table Mountain &uuml;st&uuml;ndeki eşsiz ekosistem arasında y&uuml;r&uuml;y&uuml;ş ge&ccedil;irdi. G&uuml;neş y&uuml;k&uuml; ve Cape Town &uuml;zerinde muhteşem bir g&ouml;r&uuml;n&uuml;m ve Afrika&#39;ya veda i&ccedil;in uygun bir yol yapılmış &ccedil;evresi ile dağın d&uuml;z taş, &ccedil;ıplak ayaklı.</p>\r\n', 'Güney Afrika: Terminal Lastik', 'Jaap lastik sadece tuvale aşağı, ancak katmanları bir çift ile oldu. Sonuç olarak Springbok için 120km binmek oldukça belirsiz bir oldu. Biz ancak yaptığımız', NULL, NULL, 0),
(114, 31, 'tr', 'Bu Rain gerekiyordu değil miydi', '<p>Bu Ko Samui yılın bu zamanı yağmur gerekiyordu değildir.</p>\r\n\r\n<p>Burada yılın sonu ge&ccedil;irmek i&ccedil;in karar vermeden &ouml;nce Ko Samui hakkında biraz araştırma yaptım. Aralık sıcak olması gerekiyordu - ve &ccedil;oğunlukla g&uuml;neşli - sıcak olun. Tipik &ouml;ğleden sonra yağmur fırtınaları, ama k&ouml;t&uuml; değil plaj hava. Ben ucuz roman okuma ve masmavi sularda y&uuml;zme, g&uuml;neşte tembel g&uuml;n ileriye baktı.</p>\r\n\r\n<p>Ben yaptım Ancak, Typhoon Hagupit g&ouml;r&uuml;n&uuml;şte aynı kaynakları okumadım. Ben Ko Samui geldi &ouml;nce anlatılmamış yıkıma neden ve en az 27 kişinin hayatını alarak, yaklaşık bir hafta Filipinler &uuml;zerinde kendini park. Tayfun Filipinler ile yoluna vardı sonra, o kadar olduğu gibi yavaş yavaş g&uuml;&ccedil; kaybediyor, batıya kapalı taşındı.</p>\r\n\r\n<p>Şimdi Tropikal Depresyon Hagupit ne batıya yolu doğrudan ne olduğunu tahmin? Evet, Ko Samui ve ben.</p>\r\n\r\n<p>Şimdi bu fırtına bazı wimpy kalıntıları değildir. R&uuml;zgar yarım-tam bira kupa devirmek ve cam kırmak i&ccedil;in yeterince g&uuml;&ccedil;l&uuml; oldu. Otelde &ccedil;alışan gen&ccedil; bir adam dışarı s&ouml;rf almak ve daha az geri gelmek izledim<br />\r\nWat Bo PhutWat Bo Phut<br />\r\nWat Bo Phut<br />\r\nyarım s&ouml;rf tahtası ile beş dakikadan daha asla kesicilerin ilk satırında ge&ccedil;miş kazanılmış olan. Bu, t&uuml;m ağa&ccedil; g&ouml;vdeleri etrafında attı onların demirleme gelen bağlama topları kırdı ve asla &ouml;z&uuml;r diledi s&ouml;rf oldu. Ben y&uuml;zme gitmiyorum. En azından hen&uuml;z değil.</p>\r\n\r\n<p>Ben Ancak, ben bir şey adapte değilse değilim &quot;. Adam planları, Tanrı g&uuml;l&uuml;yor&quot; (un-rahip sevin&ccedil;le belirli bir miktarda) Bana s&ouml;yler emekli Anglikan rahibi biliyorum, ve ben uzun zaman &ouml;nce ben eritmek olmaz &ouml;ğrenildi yağmur, bu y&uuml;zden etrafında poke adanın kuzey tarafına y&ouml;neldi.</p>\r\n\r\n<p>Ben yatağın her iki tarafında sabit iki tezgah koltuk ile bir pick-up kamyon bir songthaew, bayrak ana yola gitti. Ucuz ulaşım ve olduk&ccedil;a g&uuml;venilirdir. Bir gelmek i&ccedil;in ben late in bekliyordu gibi, bir motosiklet &uuml;zerinde bir adam &ccedil;ekti ve ben nereye gitmek istediğini almak i&ccedil;in teklif etti. Şimdi yollar b&uuml;k&uuml;m bir yabancıyla bir motosiklet arkasında s&uuml;rme ve hi&ccedil;bir kask yeterli meydan okuma, ama bir songthaew &ccedil;ift maliyet yağmurda bunu yapmak i&ccedil;in - iyi, kolay oldu<br />\r\nBo Phut stupaBo Phut stupa<br />\r\nBo Phut stupa<br />\r\nkapatmak i&ccedil;in.</p>\r\n\r\n<p>Songthaews hakkında diğer serin şey - fiyat dışında - yolcudur. Songthaew ben d&ouml;rt Samoyed yavru bir sepet ile bir Taylandlı bayan vardı bayraklı. Samoyed yavru bir oyuncak mağazasında ait gibi, onlar kadar sevimli ve kabarık bak. Yavru ek olarak Muay Thai savaş&ccedil;ıları i&ccedil;in ge&ccedil;miş olabilir ona İngilizce ve altı gen&ccedil; erkekleri pratik isteyen bir Macar bayan vardı.</p>\r\n\r\n<p>Ben kuzey kıyısında Bo Phut başkanlığında yapıldı. Bu Budist tapınağı Wat Bo Phuttharem, Balık&ccedil;ı K&ouml;y&uuml;, ve, aynı zamanda Big Buddha Tapınağı olarak bilinen doğu biraz, Wat Phra Yai, ev sahipliği yapmaktadır.</p>\r\n\r\n<p>Macar bayan ısrarıyla, ben Bo Phut ıslak pazarda indi. G&uuml;zel meyve ve The Good Wife kek satan bir durak bir s&uuml;r&uuml; oldu. Bu wintermelon veya lotus macun ile doldurulmuş bir lapa lapa pasta olduğunu ve bu benim en sevdiğim hamur işleri biridir &ccedil;&uuml;nk&uuml;, ben bir tane aldım. (Sana bir resim g&ouml;stermek istiyorum, ama ben yedim. Bu iyi oldu.) O Wat Bo Phuttharem kısa bir y&uuml;r&uuml;y&uuml;ş oldu Oradan.</p>\r\n\r\n<p>Ben Budist tapınakları ziyaret Seviyorum;<br />\r\nTapınak binasının tapınak buildingdetail detay<br />\r\nTapınak binasının detay<br />\r\ngenellikle &ccedil;ok sakin ve yerleri kabul vardır. Wat Bo Phuttharem olsa, beni şaşkın ve ben bu konuda &ccedil;ok bulmak m&uuml;mk&uuml;n olmamıştır. Tapınak gerek&ccedil;esiyle &ccedil;ok geniş ve yeni binalar kadar gidiyor gibi g&ouml;r&uuml;n&uuml;yor. Onlar &uuml;lkenin kuzey kesiminde olduğu gibi Buda g&ouml;r&uuml;nt&uuml;leri ile pavyonlar, tapınak binaların hi&ccedil;biri a&ccedil;ık vardı A&ccedil;ık&ccedil;ası, turistler, Tay dışında herhangi bir dilde hi&ccedil;bir belirti i&ccedil;in kurulmuş, ve değil.</p>\r\n\r\n<p>Benim doğum yılı i&ccedil;in kutuya bir bağış koymak, ve &ouml;nceden kaydedilmiş ilahiyi &ccedil;ıktığında şaşırdı. Ben paraların ağırlığı kayıt yola tahmin ediyorum. Bağış kutuları tapınaklar olduk&ccedil;a yaygındır, ama &ouml;nce benim i&ccedil;in bir ilahiyi yoktu</p>\r\n\r\n<p>Bileşik duvarlarını kaplayan ayrıntılı mezar taşları, başka bir Budist tapınağında hi&ccedil; g&ouml;rmediğiniz bir şey vardı. Ben en &ccedil;ok Taylandlılar cremated ve onların k&uuml;lleri tapınağın etrafında somut stupas i&ccedil;inde karıştırıldığını s&ouml;yledi oldum. Ben tapınaklar ad plaklar g&ouml;rd&uuml;m, bu y&uuml;zden bir kişinin onlar i&ccedil;in dua hi&ccedil;bir yavrular varsa onlar rahipler dualarını olacaktır. Ben anıtları g&ouml;rmemişti<br />\r\nsaygı monksrevered keşişler<br />\r\nsaygı keşişler<br />\r\nBu gibi, her biri belirli bir bireye &ouml;zel.</p>\r\n\r\n<p>Iyi, muhtemelen aklımın devlet oldu - - Belki de aklımın devlet oldu ama ben burada benim huzur bulmak i&ccedil;in başarısız oldu. Ben kesinlikle bir turizm alanı olan balık&ccedil;ı k&ouml;y&uuml;, yol kadar y&uuml;r&uuml;d&uuml;. Barlar, tiş&ouml;rt d&uuml;kkan ve seri &uuml;retim tat sunan filler ve Buda s&uuml;r&uuml; ortasında eski balık&ccedil;ı kasabası bir fısıltı bulmak m&uuml;mk&uuml;n olabilir, ama ben bunu g&ouml;rmedim.</p>\r\n\r\n<p>Yaklaşık beş kilometre daha yolda daha sık Big Buddha Tapınağı olarak bilinen Wat Phra Yai, olduğunu. Sonraki yukarı olacak şekilde Big Buddha, bir girdi, t&uuml;m kendi hak ediyor.</p>\r\n\r\n<p>Bu arada, burada The Good Wife Cake efsanesi:</p>\r\n\r\n<p>Bir zamanlar, emperyal &Ccedil;in&#39;de &ccedil;ok k&ouml;t&uuml; bir &ccedil;ift yaşayan oldu. Birbirlerini sevdi ve bir k&uuml;&ccedil;&uuml;k k&ouml;yde yaşıyordu. Aniden, gizemli bir hastalık k&ouml;ylerine yayıldı, ve kocasının babası &ccedil;ok hasta oldu.</p>\r\n\r\n<p>&Ccedil;ift adamın babası tedavi i&ccedil;in b&uuml;t&uuml;n paralarını ge&ccedil;irdi, ama o yine de hasta oldu. Karısı para karşılığında bir k&ouml;le olarak kendini sattı<br />\r\ntapınak buildingtemple bina<br />\r\ntapınak binası<br />\r\nbabası-in-law i&ccedil;in ila&ccedil; satın almak i&ccedil;in. Koca karısının ne yaptığını &ouml;ğrendim, o şekerli wintermelon ve badem ile dolu bir pasta yaptı. O unutamadığı eşi, bu pasta adanmış, ve sokakta sattı. Onun kek geri karısını almak i&ccedil;in yeterli para kazanmak m&uuml;mk&uuml;n olduğunu &ccedil;ok pop&uuml;ler oldu.</p>\r\n', 'Bu Rain gerekiyordu değil miydi', 'Bu Ko Samui yılın bu zamanında yağmur gerekiyordu değildir.', NULL, NULL, 0),
(115, 30, 'tr', 'Grafik Tur Sri Lanka', '<p>Eğer bakmak i&ccedil;in zaman ayırın sri Lanka Hindistan&#39;dan daha dekor aynı kafa-ayak tutum yoktur, yine de şaşırtıcı hazineleri tutar.<br />\r\nGeoffrey Bawa&#39;nın &ccedil;izimleri, egzotik ağa&ccedil;lar desen ve kaprisli geleneksel tekstil Sigiriya antik freskleri itibaren, aynı hassas ve eğlenceli bir dokunuş var.</p>\r\n', '', '', NULL, NULL, 0),
