(163, 35, 'it', 'Spiagge Virgin ', '<p>Piccolo avvertimento, Club Med 2<br />\r\nClub Med 2Club Med 2<br />\r\nClub Med 2<br />\r\n&egrave; francese, e si sente. Dei 280 ospiti sulla barca di questa settimana, non credo che uno solo non parla almeno un po &#39;francese. Sarebbe una settimana piuttosto noioso se si pu&ograve; parlare solo inglese qui ... e come si pu&ograve; essere consapevoli ... i francesi che vivono in Francia succhiarlo quando si tratta di parlare con qualcosa di altro che francese. Siete stati avvertiti onestamente!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Cos&igrave; questa mattina, &egrave; il momento BVI. No io non vengo per affari qui. E BVI non sta solo per le societ&agrave; off-shore ... non troppo riposare per splendide spiagge, yacht e Isole Vergini britanniche. Abbiamo navigato tutta la notte da Dominica ... Dominica &egrave; del Commonwealth e poveri .... BVI &egrave; territorio britannico e piuttosto ricco.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ho trascorso la mia giornata con Thierry .... mia stessa et&agrave;, e pronto a divertirsi un po &#39;di questa settimana. Perch&eacute; alla fine della giornata che conosciamo non trovate singoli signore trentenni su queste crociere ... sapevamo che ci sarebbe bisogno di organizzarsi per fare qualcosa di altro che leggere i nostri libri! Non fare i compiti su Virgin Gorda. I Kew il diving era nella media, e che la crociera aveva un pranzo barbecue di aragoste organizzato per noi sulla<br />\r\nTempo Lobster ... tempo Lobster ...<br />\r\nTempo Lobster ...<br />\r\nspiaggia! Cos&igrave; abbiamo preso una &quot;beacher&quot; con l&#39;intenzione di andare semplicemente in spiaggia per la mattina.</p>\r\n', 'Spiagge Virgin Gorda e lobste', 'Questa è la seconda tappa di una settimana veramente divertente. Ci sono avventure per ottenere ogni mattina quando atterriamo da qualche altra parte, ma anche tempo di divertimento sulla barca stessa.', NULL, NULL, 0),
(164, 35, 'ur', 'ورجن ساحل اور ', '<p>یہ واقعی ایک مذاق ہفتے کے دوسرے مرحلے میں ہے. ہم کہیں اور اترنے جب ہر صبح نکلنے کی مہم جوئی، بلکہ کشتی پر ہی مذاق وقت موجود ہیں.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>کلب میڈ 2 ایک اوپن بار ہے. جی ہاں، یہ بہت اچھی چیزیں کے آزاد بہاؤ ... سارا دن کا مطلب ہے. آپ دوپہر کے کھانے کے وقت میں کشتی پر ہیں اگر ایسا ہے تو ایک فرانسیسی کشتی پر ہونے کی وجہ سے، آپ کو دوپہر کے کھانے کے وقت میں aperitif کے لئے Ricard کے پاس ... اور کھانے کے دوران Pina کی غروب آفتاب سے پہلے پول کی طرف سے colada، اور ظاہر ہے کہ شراب. چپ چھت پر واپس سوئمنگ پول بار سے کچھ بہت اچھا خیالات کے ساتھ ... ابتدائی ارد گرد 5.30pm ہر ایک دن میں ہیں تو ہم، نومبر کے شمالی نصف کرہ آخر میں ہیں. 6PM طرف سے، یہ شیمپین وقت ہے ... جب تک ساری رات. ویسے، سب سے پہلے اس کے شاور وقت اور ظاہر ہے کہ شام کے لئے تبدیلی ہو رہی ہے ... یہ اب بھی ایک فرانسیسی جگہ ہے! اور ہم سب کو اب مختلف الکحل مشروبات اختلاط ایک عظیم خیال نہیں ہے کہ، میں نے ساری رات طویل شیمپین پر جانے کے لئے تیار لوگوں کی ایک مذاق گروپ مل گیا کے طور پر، بہت اچھا اور مزہ وقت کے لئے ہر شام،! لوگوں کی یہ واقعی مزہ گروپ کے اگلے اندراجات میں مزید.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>تھوڑا انتباہ، کلب میڈ 2<br />\r\nکلب میڈ 2Club میڈ 2<br />\r\nکلب میڈ 2<br />\r\nفرانسیسی ہے، اور یہ محسوس ہوتا ہے. کشتی اس ہفتے پر 280 مہمانوں سے باہر، میں ایک بھی کم از کم کچھ فرانسیسی بات نہیں کرتا نہیں لگتا. تم یہیں انگریزی بولتے ہیں تو یہ ایک بہت بورنگ ہفتے ہو جائے گا ... اور آپ کو معلوم ہو سکتا ہے کے طور پر اس فرانسیسی کے علاوہ کچھ اور بات کرنے کے لئے آتا ہے جب ... فرانس میں رہنے والے فرانسیسی لوگوں کو چوستے. اگر آپ ایمانداری کو خبردار کیا گیا ہے!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>لہذا آج صبح، یہ BVI کا وقت ہے. نہیں میں یہاں کاروبار کے لئے نہیں آ رہا ہوں. اور BVI صرف یہ بہت خوبصورت ساحل، یاٹ، اور برطانوی ورجن جزائر مطلب ہے ... غیر ملکی کمپنیوں کے لئے کھڑے نہیں کرتا. ہم ڈومینیکا سے ساری رات طویل سفر کیا ہے ... ڈومینیکا دولت مشترکہ اور غریب ہے .... BVI برٹش علاقہ اور بہت امیر ہے.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>میں نے میرے جیسے تھیری .... ایک ہی عمر کے ساتھ اپنے دن گزارے، اور اس ہفتے کچھ مزہ کرنے کے لئے تیار. ہم آپ کو ان سیر پر ان تیس میں اکیلی خواتین کو تلاش نہیں کرتے جانتے دن کے اختتام پر ... ہم جانتے تھے کیونکہ ہم نے اپنے کتابیں پڑھنے کے مقابلے میں کچھ اور کرنے کی منظم کرنے کے لئے کی ضرورت ہو گی! ورجن Gorda کے بارے میں میرا ہوم ورک نہیں کیا تھا. مجھے ڈائیونگ اوسط تھا kew، اور جہاز پر ہمارے لئے منظم لابسٹر کی ایک BBQ دوپہر کا کھانا کھایا کہ<br />\r\nلابسٹر وقت ... لابسٹر وقت ...<br />\r\nلابسٹر وقت ...<br />\r\nساحل سمندر! لہذا ہم تو صرف صبح کے لئے ساحل سمندر پر جانے کے لئے نیت کے ساتھ ایک &quot;beacher&quot; لیا.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&quot;ایک&quot; بیچ کلب میڈ کی طرف سے صبح کے لئے کرائے کے لئے ایک شٹل تھی. ہم اگلے راستہ ڈرائیور ... جی ہاں آدمی کے لئے مقرر کیا ہے ... اور وہ راستے میں ہم سے گرا دیا. یہ مکمل طور پر نیلے رنگ سے باہر، آف منصوبہ بندی تھی! یہ ہمارے &quot;حمام&quot; کے نیشنل پارک کو دریافت جانے کا وقت تھا. یہ ایک نیشنل پارک کے کسی قسم ہے ... یہ گرینائٹ پتھر کی طرف سے الگ ساحل کا ایک سلسلہ ہے. میں نے پہلی بار کچھ سنگین مذاق کرنے کے لئے تیار نوجوانوں کے لئے ساہسک اضافے کے کچھ قسم میں نہیں بلکہ اپنے آپ کو تلاش کرنے سے پہلے ... سے شلز میں محسوس کیا. واہ، اس جگہ حیرت انگیز ہے!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ہم بھی ہم صرف صحیح راستے پر تھے تو گھوم کے طور پر ویران ساحلوں پر راستہ بھٹک ... ساحل سمندر کے ساحل سمندر سے جا کر اور وہ بڑی چٹانوں پر چڑھنے سب صبح گزارے. پانی خوبصورت اور گرم تھا .... یاٹ کے ارد گرد تھے، یہ صرف سادہ مکمل مزہ ... آسان تھا!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ہم صرف گزشتہ شٹل کے لئے وقت پر، واپس کلب میڈ ساحل سمندر پر ہمارے راستے بنا دیا. اچھا خیال ہے، ہم BBQ تھا جہاں کوئی اندازہ نہیں ہے، اور واپس سواری کے لئے تھا کے طور پر<br />\r\nپول کی طرف سے لٹل سے Pina Colada ... پول کی طرف سے لٹل سے Pina Colada ...<br />\r\nپول کی طرف سے لٹل سے Pina Colada ...<br />\r\nکروز کی لینڈنگ نقطہ ٹہلنے کے دور کافی تھا. لابسٹر BBQ! یہ صرف صرف یہ لگتا ہے راہ کی طرف سے خراب نہیں ہو سکتی. یہ ان کی ایک اور تھا ... ترکاریاں کے گلاب شراب ...، اور ہاں، بھی لابسٹر کے کے آزاد بہاؤ! سورج ہمارے چہرے گرل پر lobsters کے طور پر ایک ہی رنگ کے ختم ہو گیا ... دوپہر کے کھانے کے آخر میں، وہاں تھا .... لیکن ایک بار ... مذاق تھا!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>پیچھے اگلا، کشتی پر ایک اچھی نیند اور کچھ سوئمنگ پول مرتبہ ہجوم سے پہلے. ایسا نہیں ہے کہ 280 مہمانوں اگر آپ اس طرح ایک بہت بڑا بادبان کشتی پر ہجوم محسوس کرتا ہے ... لیکن قطار میں کھڑے واقعی ہماری بات نہیں بس ہے.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ایک اور واقعی مزہ رات ہمارے منتظر ... اور انکل سیم کے ملک کے لئے ایک مختصر پال ... یا میں بہت جلد ہی لکھنا پڑے گا جس پر ایک مذاق جرات ... کے لئے، یہ اصل میں کرنے کے لئے بہت قریب تھا!</p>\r\n', 'ورجن Gorda ساحل اور ', 'یہ واقعی ایک مذاق ہفتے کے دوسرے مرحلے میں ہے. ہم کہیں اور اترنے جب ہر صبح نکلنے کی مہم جوئی، بلکہ کشتی پر ہی مذاق وقت موجود ہیں.', NULL, NULL, 0),
(165, 34, 'it', 'Culture fieramente indipendente', '<p>In un mondo che &egrave; sempre pi&ugrave; omogenea, culture e luoghi fieramente indipendenti sono particolarmente intrigante. Probabilmente a causa del suo isolamento geografico sia da Europa continentale e il Nord America, l&#39;Islanda ha sempre avuto un proprio percorso unico. Architettura islandese e la moda &egrave; un riflesso del suo insolito geografia, la palette islandese &egrave; pi&ugrave; comodo quando ingredienti locali di qualit&agrave; sono guariti, colta, fermentati, o in salamoia, e il popolo islandese dilettano in autosufficienza e sostenibilit&agrave; ambientale. L&#39;Islanda &egrave; sempre stata profondamente radicata nella sensibilit&agrave; liberali nordici, ma a differenza di qualsiasi altra nazione, hanno rifiutato di salvare le loro banche dopo la recessione del 2008, nel 2009 hanno eletto prima donna primo ministro dichiaratamente gay del mondo e nel 2010, Reykjavik eletto John Gnarr, punk cantante rock, comico, e l&#39;auto proclamato anarchico come loro sindaco. Il paesaggio fisico &egrave; suggestivo e unico come la cultura stessa; un&#39;isola coperta di roccia nera vulcanica, campi verdeggianti, sfiati geotermici e vulcani drammatici. &Egrave; con questo in mente, che Dennie, Henry e io sono imbarcati su un aereo per Reykjavik durante le vacanze di Pasqua, dove avremmo passato nove giorni nuoto nelle piscine calde, attraversando fiordi, e mangiare una deliziosa Skyr (yogurt islandese).</p>\r\n\r\n<p>L&#39;Islanda &egrave; costoso. come<br />\r\nEscursionismo vicino Eyjafjallaj&ouml;kullHiking vicino Eyjafjallaj&ouml;kull<br />\r\nEscursionismo vicino Eyjafjallaj&ouml;kull<br />\r\nun modo per ridurre i costi nostro piano coinvolta noleggiare un&#39;auto vecchia, arrugginita ma soprattutto affidabile da Sadcar (a 2002 Yaris con 280.000 Km), cucina 2 su 3 pasti al giorno nel nostro appartamento in affitto con generi alimentari di marca Bonus e fare come po &#39;di shopping possibile. Upon a piedi attraverso la dogana ho cominciato ad avere alcune riserve minori sul nostro piano per essere di bilancio orientata quando siamo stati accolti da quello che presumo sia uno su due dipendenti Sadcar che ci ha portato ad un Quonset in un campo 10 minuti dall&#39;aeroporto. Quando abbiamo chiesto un seggiolino per Henry, ci hanno indicato alla parte posteriore della carrozzeria cimitero auto bar / noleggio dove 3 molto utilizzato e carseats leggermente rotto seduto tra marmitte e liquidi di raffreddamento. Dennie ha scelto la pi&ugrave; funzionale del lotto, abbiamo caricato nel nostro Sadcar e togliemmo verso Reykjavik attraverso una tempesta di neve minore.</p>\r\n\r\n<p>Il nostro piccolo appartamento Ikea &egrave; perfettamente situato lungo la strada dal Hallgrimskirka, la chiesa luterana guglie che fornisce una bussola per i viaggiatori che esplorano la citt&agrave;. Questa era una posizione ottima per avere come base di partenza, come la maggior parte delle nostre mattine sono stati spesi chiedendo le strade<br />\r\nHank ed io dentro la HarpaHank e io dentro la Harpa<br />\r\nHank ed io dentro la Harpa<br />\r\ndella citt&agrave; vecchia, dove colorate case a schiera con piano principale spazio commerciale offrono un vivace e percorribile centro costellata di negozi di dischi con comodi divani e caff&egrave; espresso gratuito (12 Tonar), di design e arredamento negozi islandesi, caff&egrave; vegetariano, pub, club e case di curry. Abbiamo visitato tutte le tre sedi del Museo Reykjavik Art (Hafnarhus, Kjarvalsstadir, Asmundarsafn) in cui il posto moderne opere d&#39;Erro e le cubiste e astratto paesaggi dipinti di Kjarval appesi accanto alle mostre di artisti islandesi contemporanei rotante. Ci siamo capitati per una caccia alle uova di Pasqua nel Einar Jonsson Sculpture Park, carte giocato nelle sale tentacolare all&#39;interno del Harpa, e abbiamo preso nel Museo Reykjavik della Fotografia (all&#39;interno della biblioteca pubblica), il Museo Saga vichingo, Park e dei Bambini di Reykjavik &quot;zoo &quot;(pi&ugrave; di uno zoo) e ha preso l&#39;ascensore per l&#39;osservatorio al The Pearl. La citt&agrave; &egrave; sorprendentemente cosmopolita conserva ancora una piccola ospitalit&agrave; della citt&agrave; che agisce come un promemoria che ci sono solo 120.000 persone entro i limiti della citt&agrave;.</p>\r\n\r\n<p>Nonostante l&#39;alto costo di bar e ristoranti nel centro di Reykjavik siamo riusciti a trovare una serie di ristoranti a prezzi ragionevoli che servono cibo delizioso e fresco. Ecco alcune delle nostre raccomandazioni: Babalu (alla griglia<br />\r\nEaster Egg Hunt in Einar J&oacute;nsson Sculpture GardenEaster Egg Hunt in Einar J&oacute;nsson Sculpture Garden<br />\r\nEaster Egg Hunt in Einar J&oacute;nsson Sculpture Garden<br />\r\nHallgr&iacute;mskirkja in background.<br />\r\nformaggio e zuppa di pomodoro), C &egrave; per Cookie (zuppa fatta in casa e panini con grande cheesecake), Laundromat Cafe (trota di lago con ortaggi a radice era eccezionale e l&#39;area giochi per bambini nel seminterrato &egrave; qualcosa da vedere!), Austur India Fjelagid (delizioso Thali vegetariano), Graen Kostur (ispirato cibo vegetariano fusion orientale con due opzioni per il pranzo tutti i giorni). Per le bevande, Microbar ha un sacco di birre artigianali locali alla spina (Happy Hour 5-8 pm). Il Labowski Bar sembrava anche come un posto incredibile, ma erano avendo pub quiz quando siamo entrati in modo non siamo stati per un drink.</p>\r\n\r\n<p>La nostra Sadcar gestito una serie di gite di un giorno da Reykjavik; abbiamo guidato a nord attraverso la Hvalfjorour (Whale Fjord), fermandosi per un pic-nic nei pressi di alcune rapide. Abbiamo guidato per la citt&agrave; geotermica di Hverager&eth;i e sul vulcano Eyjafjallajokull famosa scoppiata nel 2010 causando cancellazioni dei voli in tutta Europa. Abbiamo guidato la Golden Circle con fermate a Geyser, Parco Nazionale di Pingvellir e la cascata Gulfoss. Una volta lasciato Reykjavik la geografia &egrave; forte, ma maestosa con i campi verdi punteggiati con roccia nera vulcanica, dolci colline, ripide passi di montagna e vapore che sale in aria da camini termici che punteggiano il paesaggio in tutto.</p>\r\n\r\n<p>Dennie<br />\r\nAl di fuori del LagoonOutside Blu della Laguna Blu<br />\r\nAl di fuori della Laguna Blu<br />\r\ne sono veloce venuto alla realizzazione che quando si viaggia con un bambino, l&#39;esperienza &egrave; pi&ugrave; divertente per tutti, se tutta la pianificazione ruota intorno al bambino. E mentre leggendaria vita notturna di Reykjavik pu&ograve; essere chiamato il mio nome una o due volte, genitori con una sbornia di certo non l&#39;ha fatto. Come tale, abbiamo trascorso un bel po &#39;del nostro tempo in Islanda immergendoci nella cultura piscina termale. Con 122 piscine termali e 17 nel solo Reykjavik, abbiamo fatto la nostra missione di fare il bagno in una nuova piscina ogni giorno. In Reykjavik abbiamo nuotato a Laugardalslaug, Sundhollin, Arbaejarlaug, Grafarvogslaug, Sudurbaejarlaug, e Asvallalaug. Durante le nostre gite di un giorno in tutto il campagna islandese abbiamo anche avuto la possibilit&agrave; di nuotare presso la splendida piscina a Hverageroi, nudo in Seljallalaug deserta situata in una valle di montagna, circondata da cascate, e il nostro ultimo giorno al costoso ma incredibile Blue Lagoon. 9 piscine in 9 giorni. L&#39;acqua in tutte le piscine pubbliche &egrave; chimico libero, riscaldata attraverso geotermica, e quasi tutti hanno un numero di &quot;pentole calde&quot;, saune, corsie per il nuoto, piscine per bambini, e di acqua-scivoli. Ho avuto l&#39;impressione del mio tempo seduto in &quot;pentole calde&quot; in chat con i locali che piscine termali sono importanti<br />\r\nDurante il tragitto verso la piscina calda Seljvavellir Enroute alla piscina calda Seljvavellir<br />\r\nDurante il tragitto verso la piscina calda Seljvavellir<br />\r\nluoghi di aggregazione per i membri della comunit&agrave;. Vecchi e giovani mossa simile tra le varie piscine e apertamente conversare con gli sconosciuti e amici. Nei momenti in cui Henry era scontroso o stanchi abbiamo sempre saputo che eravamo in pochi minuti da una piscina dove sarebbe immediatamente essere trasformata di nuovo nel Hank sorridente ci siamo abituati a. Mentre le piscine certamente fatti viaggiare in Islanda con un bambino molto pi&ugrave; facile, &egrave; il popolo islandese che davvero rendono l&#39;Islanda un accogliente locale bambino. Quasi ogni ristorante siamo andati a aveva un&#39;area giochi per bambini, c&#39;era la segnaletica che ha incoraggiato l&#39;allattamento al seno, e tutti i bar e pub permettere ai bambini. Islandesi erano calde e in uscita, ma non forte o antipatico e non importa dove siamo andati, sembrava che avevano pensato di modi per accogliere i bambini.</p>\r\n\r\n<p>Sul nostro mattina finale in Islanda, ho camminato lungo la strada dal nostro appartamento per prendere un paio di cd a Tonar 12. Mi sono seduto sul loro comodi divani ascoltando FM Belfast e Seabear mentre Henry frug&ograve; le pile. Senza chiedere, l&#39;uomo che corre il negozio mi ha portato un espresso. Ho preso una guida Reykjavik da un tavolino e<br />\r\nDennie guidare la nostra triste CarDennie guidare la nostra auto Sad<br />\r\nDennie guidare la nostra auto Sad<br />\r\naperto il libro per la prima pagina per leggere il messaggio di benvenuto del sindaco per i visitatori. Jon Gnarr (il sindaco) predisse la sua versione di origine del paese. Leggo,</p>\r\n\r\n<p>&quot;Ma come pu&ograve; essere che un paese cos&igrave; caldo &egrave; venuto in possesso di un nome cos&igrave; freddo S&igrave;, la spiegazione &egrave; semplice:?.. MALINTESO Ing&oacute;lfur Arnarson, il primo uomo che ha trovato Reykjav&iacute;k, non era la sua strada qui a tutti Era in rotta verso gli Stati Uniti d&#39;America, per comprare uva e altri fast food che crescevano selvatici l&igrave; in quei giorni. era molto interessato al cibo. e anche l&#39;omicidio. Sulla sua strada notato una nube di fumo salire al cielo da un paese sconosciuto. la sua natura curiosa avuto la meglio su di lui, e ha cambiato il suo corso e salpare a Reykjav&iacute;k (Reykjav&iacute;k letteralmente significa &quot;baia fumosa&quot;!).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Mentre sbarcato la sua nave, vide che il fumo era in realt&agrave; vapore passando da numerose piscine di Reykjav&iacute;k. Era quindi veloce nel strappare l&#39;armatura che aveva indossato in caso avrebbe incontrare alcuni nativi americani, mentre la raccolta dell&#39;uva, e saltando in alcuni costume da bagno. Dopo il nuoto un buon<br />\r\nTest Hank guida di musica Indie a Tonar 12 nella prova di guida ReykjavikHank musica Indie a Tonar 12 a Reykjavik<br />\r\nTest Hank guida di musica Indie a Tonar 12 a Reykjavik<br />\r\n500 metri si sedeva nella vasca idromassaggio e rilassato. Dopo una chiacchierata divertente con la gente del posto che aveva dimenticato di America. Chi ha bisogno di viaggiare fino in America per raccogliere l&#39;uva quando c&#39;&egrave; un negozio in Laugavegur chiamato V&iacute;nberi&eth; (V&iacute;nberi&eth; letteralmente significa: &quot;l&#39;uva&quot;)? Ing&oacute;lfur deciso di stabilirsi qui. Ha affittato un piccolo appartamento insieme a sua moglie, Hallveig Fr&oacute;&eth;ad&oacute;ttir, che molti sostengono era figlia di Frodo da &#39;Signore degli Anelli&#39;. Nulla &egrave; stato dimostrato su questo, per&ograve;.</p>\r\n\r\n<p>Un giorno Ing&oacute;lfur e Hallveig stavano facendo una passeggiata in citt&agrave;. Stavano camminando loro cane, che si chiamava Pluto ed era un alano. Era il giorno di un frizzante della calda estate. E &#39;stato molto tempo prima che la t-shirt &egrave; stato inventato. Erano entrambi vestiti in pieno armature, con spade e scudi e caschi e tutto. Si fermarono per a &Iacute;sb&uacute;&eth; Vesturbaejar in Hagamelur per ottenere un gelato e raffreddare. La storia racconta che Ing&oacute;lfur chiesto all&#39;impiegato se sapeva quello che il paese &egrave; stato chiamato.</p>\r\n\r\n<p>Pensava si chiamava Thule. Ing&oacute;lfur sentiva che era un nome stupido.</p>\r\n\r\n<p>&quot;Nessun paese pu&ograve; essere chiamato Thule&quot;, ha detto.</p>\r\n\r\n<p>All&#39;esterno<br />\r\nHenry all&#39;interno del theatreHenry Eyjafjallajokull all&#39;interno del teatro Eyjafjallajokull<br />\r\nHenry all&#39;interno del teatro Eyjafjallajokull<br />\r\ngelateria, una folla si era radunata. Avevano sentito che i visitatori stranieri erano in citt&agrave;. Molte di queste persone erano elfi. Ing&oacute;lfur poi avvicinato alla folla, alz&ograve; il cono gelato alto e grid&ograve;:</p>\r\n\r\n<p>&quot;D&#39;ora in poi questo paese sar&agrave; chiamato Islanda, perch&eacute; si pu&ograve; ottenere miglior gelato del mondo!&quot;.</p>\r\n\r\n<p>Oggi abbiamo una statua di Ing&oacute;lfur. La statua raffigura Ing&oacute;lfur muore di calore, appoggiato al suo cane.</p>\r\n\r\n<p>Non essere un estraneo, essere come Ing&oacute;lfur! &quot;</p>\r\n\r\n<p>Solo in Islanda!</p>\r\n', 'Culture fieramente indipendente', 'In un mondo che è sempre più omogeneo, culture e luoghi fieramente indipendenti sono particolarmente intrigante. Probabilmente a causa del suo isolamento geografico sia da', NULL, NULL, 0),
(166, 34, 'ur', 'انتہائی خود مختار ثقافت', '<p>تیزی یک رنگ ہے کہ ایک ایسی دنیا میں، انتہائی خود مختار ثقافتوں اور مقامات خاص طور پر دلچسپ ہیں. غالبا اس کا ایک نتیجہ مینلینڈ یورپ اور شمالی امریکہ دونوں کی طرف سے جغرافیائی تنہائی ہے، آئس لینڈ ہمیشہ اس کی اپنی منفرد راستہ ہے لے لیا ہے. برفستانی فن تعمیر اور فیشن معیار مقامی اجزاء، مہذب، تندرست خمیر، یا نمکین کر رہے ہیں جب برفستانی پیلیٹ سب سے زیادہ آرام دہ ہے، اس کا ایک عکاسی غیر معمولی جغرافیے ہے ہے، اور برفستانی لوگوں کو خود انحصاری اور ماحولیاتی پائیداری میں revel. آئس لینڈ کو ہمیشہ دل کی گہرائیوں نورڈک لبرل احساسات میں جڑیں کیا گیا ہے، لیکن کسی بھی دوسرے ملک کے برعکس، وہ دنیا کی پہلی کھلے عام ہم جنس پرستوں کی خاتون وزیر اعظم منتخب ہوئے اور 2010 میں 2009 میں، 2008 کساد بازاری کے بعد ان کے بینکوں کو ضمانت دینے سے انکار کر، ریکجااخت جان Gnarr، رکن منتخب پنک راک گلوکار، کامیڈین، اور خود ان کے میئر کے طور پر اراجکتاوادی اعلان. جسمانی زمین کی تزئین کی ثقافت جتنا کہ خود حیران کن اور منفرد ہے. سیاہ جوالامھی راک، سرسبز سبز شعبوں، جیوتھرمل vents اور ڈرامائی جوالامھیوں میں احاطہ کرتا ہے ایک جزیرہ. یہ Dennie، ہنری اور میں ہم، شہوت انگیز پول میں تیراکی fjords کے ذریعے ڈرائیونگ، اور مزیدار Skyr (برفستانی دہی) کھا 9 دن خرچ کرے گا جہاں ایسٹر تعطیلات، اوور ریکجااخت کے لئے ایک جہاز پر سوار ہے کہ یہ بات ذہن میں، کے ساتھ تھا.</p>\r\n\r\n<p>آئس لینڈ مہنگی ہے. جیسا<br />\r\nEyjafjallaj&ouml;kull قریب Eyjafjallaj&ouml;kullHiking قریب پیدل سفر<br />\r\nEyjafjallaj&ouml;kull قریب پیدل سفر<br />\r\nہماری منصوبہ بندی Sadcar سے ایک، پرانی زنگ آلود لیکن بنیادی طور پر قابل اعتماد کار (280،000 کلومیٹر کے ساتھ ایک 2002 Yaris کے) کرایہ پر لینے ملوث اخراجات، بونس برانڈ راشن کے ساتھ ہمارے رینٹل اپارٹمنٹ میں 2 سے باہر 3 کے کھانے کے ایک دن کھانا پکانے اور کے طور پر تھوڑا شاپنگ کر کم کرنے کا ایک طریقہ ممکن طور پر. کسٹم کے ذریعے چلنے کے بعد مجھے لگتا ہے ہم میں ہوائی اڈے سے ایک میدان میں ایک quonset 10 منٹ ہمیں لینے والے دو Sadcar ملازمین میں سے ایک ہے فرض کیا کی طرف سے مبارک باد دی رہے تھے جب بجٹ پر مبنی ہو کرنے کے لئے اپنی منصوبہ بندی کے بارے کچھ معمولی تحفظات ہیں کرنا شروع کر دیا. ہم ہنری لئے ایک carseat کے بارے میں پوچھا تو انہوں نے 3 بہت استعمال کیا اور تھوڑا سا توڑا carseats مفلر اور کولنگ سیال کے درمیان بیٹھے جہاں آٹو جسم دکان / کرایہ کی کار قبرستان کی پشت پر ہمیں اس کی ہدایت. Dennie ہم اپنے Sadcar میں بھری ہوئی اور ایک معمولی برف طوفان کے ذریعے ریکجااخت تئیں چھٹی لی، لوط کی سب سے زیادہ فعال انتخاب کیا ہے.</p>\r\n\r\n<p>ہماری چھوٹی Ikea کی اپارٹمنٹ بالکل Hallgrimskirka، شہر کی تلاش مسافروں کے لئے ایک کمپاس فراہم کرتا spired لوتھران چرچ سے نیچے سڑک پر واقع تھا. ہماری صبح کے بیشتر سڑکوں سوچ خرچ کئے گئے کے طور پر یہ، گھر کی بنیاد کے طور پر کے لئے ایک عظیم مقام تھا<br />\r\nHarpa کی اندر ہانک اور میں HarpaHank اندر اور مجھے<br />\r\nHarpa کی اندر ہانک اور میں<br />\r\nاہم منزل کمرشل ساتھ رنگا رنگ سیڑھیدار مکانات آرام تختوں اور مفت یسپریسو (12 Tonar) کے ساتھ ریکارڈ دکانوں، برفستانی ڈیزائن اور فرنیچر کی دکانوں، سبزی کیفے، پب، کلب اور سالن گھروں کے ساتھ بندیدار ایک متحرک اور walkable شہر کے مرکز میں ہے جہاں پرانے شہر کے. ہم سے Erro کے عہدے جدید کا کام اور Kjarval کے cubist اور تجریدی زمین کی تزئین کی پینٹنگز معاصر برفستانی فنکاروں سے نمائش گھومنے کے لئے اگلے پھانسی جہاں ریکجااخت آرٹ میوزیم (Hafnarhus، Kjarvalsstadir، Asmundarsafn) کے تمام تین مقامات کا دورہ کیا. ہم &quot;، Einar Jonsson کے مجسمہ پارک میں ایک ایسٹر انڈے ہنٹ ٹھوکر Harpa کی اندر وسیع و عریض انتظارگاہ میں کارڈ سے ادا کیا، اور (پبلک لائبریری کے اندر) فوٹوگرافی کے ریکجااخت میوزیم، وائکنگ ساگا میوزیم، ریکجااخت بچوں کے پارک اور میں لے لیا چڑیا گھر &quot;(ایک petting کی چڑیا گھر کے زیادہ) اور پرل پر آبزرویٹری پر لفٹ لے گئے. شہر ابھی تک حیرت کی بات ہے میٹرو شہر کی حدود کے اندر اندر صرف 120،000 لوگ ہیں کہ ایک یاد دہانی کے طور پر کام کرتا ہے کہ ایک چھوٹے سے شہر کی مہمان نوازی کو برقرار رکھتی ہے.</p>\r\n\r\n<p>ریکجااخت کے مرکز میں بار اور ریستوران کے اعلی قیمت کے باوجود ہم مزیدار اور تازہ کھانا پیش کرنے کی مناسب قیمت eateries کی ایک بڑی تعداد کو تلاش کرنے کے لئے منظم. Babalu کی (انکوائری: یہاں ہماری سفارشات میں سے کچھ یہ ہیں<br />\r\nEinar Jonsson کے مجسمہ باغ میں Einar Jonsson کے مجسمہ GardenEaster انڈے ہنٹ ایسٹر انڈے ہنٹ<br />\r\nEinar Jonsson کے مجسمہ باغ میں ایسٹر انڈے ہنٹ<br />\r\nپس منظر میں Hallgr&iacute;mskirkja.<br />\r\nپنیر اور ٹماٹر کا سوپ)، C کوکی (گھر سوپ اور سینڈوچ عظیم چیزکیک کے ساتھ)، لانڈرومیٹ کیفے (جڑ سبزیوں کے ساتھ جھیل ٹراؤٹ بقایا تھا اور تہھانے میں بچوں کے کھیلنے ملاحظہ کرنے کے لئے کچھ ہے!)، Austur بھارت Fjelagid (مزیدار لئے ہے سبزی سے Thali)، Graen Kostur (ڈیلی دو دوپہر کے کھانے کے اختیارات کے ساتھ مشرقی الہامی ولی ویجی کھانے). مشروبات کے لئے، Microbar (5-8 بجے سے مبارک قیامت) نل پر مقامی کرافٹ بیر کی ایک بہت ہے. Labowski بار بھی ایک حیرت انگیز جگہ کی طرح لگ رہا تھا لیکن ہم نے ایک پینے کے لئے رہنے نہیں کیا تو اندر چلا گیا جب وہ پب trivia سے کر رہے تھے.</p>\r\n\r\n<p>ہمارے Sadcar ریکجااخت سے دن بھر کی ایک بڑی تعداد کے لئے منظم؛ ہم نے کچھ ریپڈس کے قریب ایک پکنک کے لئے روکنے، Hvalfjorour (وہیل fjord کی) کے ذریعے شمال نکال دیا. ہم Hverager&eth;i کے جیوتھرمل شہر میں اور یورپ بھر میں پرواز کی منسوخی کا باعث 2010 ء میں شروع ہوئی جس میں مشہور Eyjafjallajokull آتش فشاں پر نکال دیا. ہم گیزر پر رک جاتا ہے کے ساتھ گولڈن سرکل، Pingvellir نیشنل پارک اور Gulfoss آبشار نکال دیا. آپ ریکجااخت چھوڑ جانے کے بعد جغرافیہ سنگین لیکن سبز شعبوں بھر میں زمین کی تزئین کی dotting کے تھرمل vents کے سے ہوا میں بڑھتی ہوئی سیاہ جوالامھی راک، رولنگ پہاڑیوں، کھڑی پہاڑ کے پاس اور بھاپ کے ساتھ punctuated ساتھ شاندار ہے.</p>\r\n\r\n<p>Dennie<br />\r\nآبی نیلا کی بلیو LagoonOutside سے باہر<br />\r\nآبی نیلا کے باہر<br />\r\nاور میں نے تیزی سے ایک بچے کے ساتھ سفر میں، تجربے تمام منصوبہ بندی بچے کے گرد گھومتی ہے اگر تمام کے لئے زیادہ مزہ ہے کہ احساس کرنے آیا ہوں. ریکجااخت کی افسانوی رات کی زندگی ایک نشہ کے ساتھ والدین، ایک یا دو بار فون کیا میرا نام کیا ہے ہو سکتا ہے جبکہ اور یقینا ایسا نہیں کیا. اس طرح کے طور پر، ہم تھرمل پول ثقافت میں خود immersing کی آئس لینڈ میں ہمارے وقت کا ایک اچھا سودا خرچ کیا. 122 تھرمل کے تالابوں اور اکیلے ریکجااخت میں 17 کے ساتھ، ہم نے اسے ہر دن ایک نئے پول میں تیرنے کے لئے ہمارے مشن بنا دیا. ریکجااخت میں ہم Laugardalslaug، Sundhollin، Arbaejarlaug، Grafarvogslaug، Sudurbaejarlaug، اور Asvallalaug پر تیر. برفستانی ملک کی طرف بھر میں اپنے دن بھر کے دوران ہم نے بھی جھرنے کی طرف سے گھیر ایک پہاڑ کی وادی میں واقع ویران Seljallalaug میں ننگے Hverageroi، میں خوبصورت پول میں تیر کرنے کا موقع ملا، اور مہنگا لیکن حیرت انگیز آبی نیلا پر ہمارے آخری دن. 9 دنوں میں 9 تالابوں. تمام عوامی پول میں پانی جیوتھرمل کے ذریعے، مفت کیمیائی گرم کیا جاتا ہے، اور تقریبا تمام &quot;گرم برتنوں&quot;، saunas کے، تیراکی کے لین، بچوں کے پول، اور پانی سلائیڈوں کی ایک بڑی تعداد ہے. میں نے تھرمل پول اہم ہیں کہ مقامی لوگوں کے ساتھ چیٹنگ &quot;گرم برتنوں&quot; میں بیٹھے اپنے وقت سے یہ تاثر ملا<br />\r\nراستے Seljvavellir گرم پول Seljvavellir گرم پول راستے<br />\r\nSeljvavellir گرم پول راستے<br />\r\nکمیونٹی کے ارکان کے لئے مقامات اجتماع. مختلف پول اور اجنبیوں اور دوستوں کے ساتھ کھل کر بات چیت کے درمیان پرانے اور نوجوان آپس میں ایک جیسے اقدام. ہنری بدمزاج یا تھکا ہوا تھا جہاں لمحات میں ہم نے ہمیشہ ہم وہ فوری طور پر ہم استعمال ہو گئے ہیں مسکرا ہانک میں واپس تبدیل کر دیا جائے گا جہاں ایک پول سے چند منٹ کے اندر اندر تھے جانتے تھے. تالابوں یقینی طور پر ایک بچے کے ساتھ آئس لینڈ میں سفر بہت آسان بنا دیا ہے، یہ واقعی آئس لینڈ ایک بچے دوستانہ ماحول بنانے والے برفستانی لوگوں کو ہے. تقریبا ہم پر گئے تھے ہر ریستوران دودھ پلانے کی حوصلہ افزائی کی کہ اشارے وہاں تھا، ایک بچوں کے کھیل کے علاقے تھا، اور تمام بار اور پب بچوں کی اجازت دیتے ہیں. برفستانی لوگوں گرم اور سبکدوش ہونے والے ہیں لیکن اونچی آواز میں نہیں یا قابل نفرت تھے اور ہم چلے گئے جہاں کوئی بات نہیں، یہ ہے کہ وہ بچوں کا استقبال کرنے کے طریقوں کے بارے میں سوچا تھا لگ رہا تھا.</p>\r\n\r\n<p>آئس لینڈ میں ہماری آخری صبح، میں نے ہنری پوٹ کے ذریعے rummaged جبکہ ایف ایم بیلفاسٹ اور Seabear کو سننے ان کے آرام تختوں پر بیٹھ Tonar 12. میں ایک جوڑے کی سی ڈی لینے کے لئے اپنے اپارٹمنٹ سے سڑک کے نیچے چلا گیا. سے پوچھے بغیر، دکان چلانے شخص میرے ایک یسپریسو لایا. میں نے ایک کافی ٹیبل کی طرف سے ایک گائیڈ بک ریکجااخت اٹھایا اور<br />\r\nDennie ہمارے دکھ کی بات CarDennie ہمارے دکھ کی کار ڈرائیونگ ڈرائیونگ<br />\r\nDennie ہمارے دکھ کی کار ڈرائیونگ<br />\r\nزائرین کے لئے میئر کے استقبالیہ پیغام پڑھنے کے لئے پہلے صفحے پر کتاب کھولی. جان Gnarr (میئر) ملک کی اصل کے اپنے ورژن پیشن گوئی. میں نے پڑھا،</p>\r\n\r\n<p>&quot;لیکن کس طرح اس طرح کے ایک گرم ملک اس طرح ایک برفیلی نام قبضہ کرنے کو آیا ہے کہ ہو سکتا ہے جی ہاں، وضاحت بہت سادہ ہے:؟.. غلط فہمی Ing&oacute;lfur Arnarson، ریکیاوک پتہ چلا ہے کہ پہلے انسان، یہاں بالکل اس کے راستے پر نہیں تھا انہوں نے کہا تھا ریاستہائے متحدہ امریکہ کے راستے، اس نے کھانے میں بہت دلچسپی تھی. ان دنوں میں وہاں جنگلی اضافہ ہوا ہے کہ انگور اور دیگر فاسٹ فوڈ کو خریدنے کے لئے. اور یہ بھی قتل. اس کے راستے پر وہ ایک سے آسمان تک دھواں آروہی کے بادل محسوس کیا نامعلوم ملک. اس کی متجسس فطرت اس کا سب سے اچھا ہے، اور وہ (ریکیاوک لفظی! &quot;دھواں دار خلیج&quot; کا مطلب ہے) ریکیاوک کو اپنے کورس اور سیٹ پال کو تبدیل کر دیا.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>جب انہوں نے اپنے جہاز کو اترنے کے طور پر وہ دھواں ریکیاوک کی کئی سوئمنگ پول سے بڑھتی ہوئی حقیقت یہ بھاپ میں نے دیکھا کہ. انہوں نے کہا کہ انگور اٹھا جبکہ وہ کچھ مقامی امریکیوں کا سامنا کروں گا کیس میں پہنا تھا کہ کوچ کے سوٹ پھاڑنا، اور کچھ تیر تنوں میں کود میں اس وجہ سے جلدی تھی. ایک اچھی تیراکی کے بعد<br />\r\nریکجااخت میں Tonar 12 میں انڈی موسیقی ڈرائیونگ ReykjavikHank ٹیسٹ میں Tonar 12 میں انڈی موسیقی ڈرائیونگ ہانک ٹیسٹ<br />\r\nریکجااخت میں Tonar 12 میں انڈی موسیقی ڈرائیونگ ہانک ٹیسٹ<br />\r\n500 میٹر انہوں گرم ٹب اور پر سکون میں بیٹھ گئے. مقامی لوگوں کے ساتھ ایک مذاق چیٹ کے بعد وہ امریکہ کے بارے میں سب کو بھول گیا تھا. کون Laugavegur پر ایک دکان V&iacute;nberi&eth; وہاں کہا جاتا ہے جب انگور لینے کے لئے امریکہ کے لئے تمام طریقے سے سفر کرنے کی ضرورت ہے (V&iacute;nberi&eth; لفظی مطلب: &quot;انگور&quot;)؟ Ing&oacute;lfur یہاں آباد ہونے کا فیصلہ کیا. انہوں نے کہا کہ بہت سے دعوی &#39;حلقے کے رب&#39; سے Frodo کی کی بیٹی تھی جو اپنی بیوی، Hallveig Fr&oacute;&eth;ad&oacute;ttir، کے ساتھ ساتھ ایک چھوٹے سے اپارٹمنٹ کرایے. کچھ بھی نہیں تاہم، اس کے بارے میں ثابت کیا گیا ہے.</p>\r\n\r\n<p>ایک دن Ing&oacute;lfur اور Hallveig شہر کے ارد گرد ٹہلنے لے جا رہے تھے. انہوں نے پلوٹو کو بلایا اور ایک عظیم ڈین تھا کیا گیا تھا جو ان کے کتے، چل رہے تھے. یہ ایک گرم گرم موسم گرما کے دن تھا. ٹی شرٹ ایجاد کیا گیا اس سے پہلے کہ یہ طویل تھا. وہ دونوں میں تلوار اور ڈھال اور ہیلمیٹ اور سب کچھ کے ساتھ، کوچ کی مکمل سوٹ میں ملبوس تھے. انہوں نے کچھ آئس کریم حاصل کرنے اور ٹھنڈا کرنے کے لئے Hagamelur میں &Iacute;sb&uacute;&eth; Vesturb&aelig;jar میں نے روکا. کہانی وہ ملک کہلاتا تھا کیا پتہ تھا کہ آیا Ing&oacute;lfur کلرک سے پوچھا کہ جاتا ہے.</p>\r\n\r\n<p>وہ اس تھولے بلایا گیا تھا سوچا. Ing&oacute;lfur کہ ایک پاگل کا نام تھا.</p>\r\n\r\n<p>&quot;کوئی بھی ملک تھولے بلایا جا سکتا ہے&quot;، انہوں نے کہا.</p>\r\n\r\n<p>باہر<br />\r\nہنری eyjafjallajokull تھیٹر کے اندر eyjafjallajokull theatreHenry اندر<br />\r\neyjafjallajokull تھیٹر کے اندر ہینری<br />\r\nآئس کریم کی دکان، ایک ہجوم جمع ہوئے تھے. انہوں نے غیر ملکی سیاحوں شہر میں تھے سنا تھا کہ. وہ لوگ بہت سے لوگ یلوس تھے. Ing&oacute;lfur پھر، بھیڑ سے رابطہ کیا ہونے والی الوفٹ اپنے آئس کریم شنک اٹھایا اور چلایا:</p>\r\n\r\n<p>&quot;یہاں دنیا کے بہترین آئس کریم حاصل کر سکتے ہیں کیونکہ آج کے بعد اس ملک، آئس لینڈ بلایا جائے گا!&quot;.</p>\r\n\r\n<p>آج ہم Ing&oacute;lfur کی ایک مورتی ہے. مورتی Ing&oacute;lfur اپنے کتے پر جھکاو، گرمی سے مر دکھایا گیا ہے.</p>\r\n\r\n<p>ایک اجنبی نہ ہو، Ing&oacute;lfur کی طرح ہو! &quot;</p>\r\n\r\n<p>صرف آئس لینڈ میں!</p>\r\n', 'انتہائی خود مختار ثقافت', 'تیزی یک رنگ، انتہائی خود مختار ثقافتوں اور مقامات خاص طور پر دلچسپ ہیں. غالبا اس کا ایک نتیجہ جغرافیائی تنہائی دونوں کی طرف سے ہے', NULL, NULL, 0),
(167, 31, 'it', 'Non doveva Pioggia', '<p>Non dovrebbe piovere in Ko Samui questo periodo dell&#39;anno.</p>\r\n\r\n<p>Ho fatto una piccola ricerca su Ko Samui prima ho deciso di trascorrere la fine dell&#39;anno qui. Dicembre dovrebbe essere caldo - fare quel caldo - e per lo pi&ugrave; soleggiato. Tipici pomeriggio tempeste di pioggia, ma non male spiaggia tempo. Non vedevo l&#39;ora di giorni pigri al sole, leggere romanzi a buon mercato e nuotare in acque azzurre.</p>\r\n\r\n<p>Tuttavia, Typhoon Hagupit evidentemente non ha letto le stesse fonti, come ho fatto io. Si parcheggiata sulle Filippine circa una settimana prima del mio arrivo a Koh Samui, causando la distruzione indicibili e prendere la vita di almeno 27 persone. Dopo il tifone aveva avuto la sua strada con le Filippine, &egrave; spostato verso ovest, lentamente perdere il potere come ha fatto cos&igrave;.</p>\r\n\r\n<p>Indovinate qual &egrave; direttamente nel percorso verso ovest di quella che oggi &egrave; Tropical Depression Hagupit? Yep, Koh Samui e me.</p>\r\n\r\n<p>Ora questo non &egrave; alcuni resti wimpy di una tempesta. Il vento era abbastanza forte da battere sopra una tazza piena a met&agrave; di birra e rompere il vetro. Ho visto un giovane che lavorava presso l&#39;hotel prendere una tavola da surf fuori e tornare in meno<br />\r\nWat Bo PhutWat Bo Phut<br />\r\nWat Bo Phut<br />\r\ndi cinque minuti con mezzo una tavola da surf, non avendo ottenuto oltre la prima linea di interruttori. Questo &egrave; stato il surf che sballottata interi tronchi d&#39;albero, ha rotto le palle di ormeggio dal loro ancoraggio e mai scusato. Non sto andando a nuotare in quella. Almeno non ancora.</p>\r\n\r\n<p>So che un sacerdote anglicano in pensione che mi dice (con una certa quantit&agrave; di gioia un-sacerdote) &quot;piani di uomo, Dio ride&quot;. Tuttavia, non sono nulla se non adattabile, e ho imparato molto tempo fa che io non fondere in pioggia, quindi mi sono diretto verso il lato nord dell&#39;isola a curiosare.</p>\r\n\r\n<p>Sono andato alla strada principale per fermare un songthaew, che &egrave; un pick-up con due panchine fisse lungo entrambi i lati del letto. E &#39;il trasporto a buon mercato e abbastanza affidabile. Mentre stavo aspettando sotto la pioggia per uno a venire lungo, un ragazzo in motorino si ferm&ograve; e si offr&igrave; di prendere dove volevo andare. Ora a cavallo sul retro di una moto con uno sconosciuto su strade tortuose e nessun casco &egrave; abbastanza sfida, ma a farlo sotto la pioggia per il doppio del costo di un songthaew - beh, &egrave; stato facile<br />\r\nBo Phut stupaBo Phut stupa<br />\r\nBo Phut stupa<br />\r\ndi abbassare.</p>\r\n\r\n<p>L&#39;altra cosa bella di songthaews - altro che il prezzo - &egrave; i passeggeri. Nel songthaew ho segnalato gi&ugrave; c&#39;era una signora tailandese con un paniere di quattro cuccioli Samoiedo. Cuccioli Samoiedo sembrano appartenere in un negozio di giocattoli, sono cos&igrave; simpatico e birichino. Oltre ai cuccioli c&#39;era una signora ungherese che voleva praticare il suo inglese, e sei giovani che avrebbero potuto passare per combattenti Muay Thai.</p>\r\n\r\n<p>Ero diretto a Bo Phut sulla costa settentrionale. Questo &egrave; sede del tempio buddista di Wat Bo Phuttharem, Villaggio del Pescatore, e, un po &#39;a est, Wat Phra Yai, noto anche come il Grande Tempio del Buddha.</p>\r\n\r\n<p>Su richiesta della signora ungherese, sono sceso al mercato bagnato Bo Phut. C&#39;era un sacco di bella frutta e una bancarella che vende torte buona moglie. Si tratta di una pasta sfoglia riempita con wintermelon o loto pasta, e dal momento che questo &egrave; uno dei miei dolci preferiti, ho comprato uno. (Mi piacerebbe mostrarvi una foto, ma ho mangiato. E &#39;stato bello.) Da l&igrave; &egrave; stata una breve passeggiata per Wat Bo Phuttharem.</p>\r\n\r\n<p>Mi piace visitare i templi buddisti;<br />\r\ndettaglio del tempio buildingdetail di costruzione del tempio<br />\r\ndettaglio di costruzione del tempio<br />\r\nsono generalmente molto calmi e accettare posti. Wat Bo Phuttharem me confuso, per&ograve;, e non sono stato in grado di scoprire molto su di esso. I giardini del tempio sono molto spaziose, e sembra che i nuovi edifici sono in aumento. Non &egrave; ovviamente impostato per i turisti, nessun segno in una lingua diversa thailandese, e, mentre c&#39;erano padiglioni con immagini del Buddha, nessuno degli edifici templari erano aperte come sono nella parte settentrionale del paese.</p>\r\n\r\n<p>Ho messo una donazione nel box per il mio anno di nascita, e sono stato sorpreso quando un canto pre-registrato &egrave; venuto fuori. Sto indovinando che il peso delle monete part&igrave; la registrazione. Scatole di donazione sono abbastanza comuni nei templi, ma non ho mai avuto un canto per me prima</p>\r\n\r\n<p>Ci sono stati elaborati lapidi lungo le pareti del composto, qualcosa che non ho mai visto in un tempio buddista. Mi &egrave; stato detto che la maggior parte dei thailandesi vengono cremati e le loro ceneri commistione in stupa di cemento intorno al tempio. Ho visto targhe nome nei templi, quindi se una persona non ha figli a pregare per loro avranno le preghiere dei monaci. Non avevo mai visto memoriali<br />\r\nmonaci monksrevered venerati<br />\r\nmonaci venerati<br />\r\ncome questi, ciascuna dedicata ad un particolare individuo.</p>\r\n\r\n<p>Forse era il mio stato d&#39;animo - beh, probabilmente era il mio stato d&#39;animo - ma non &egrave; riuscito a trovare la mia pace qui. Ho camminato lungo la strada per Villaggio dei pescatori, che &egrave; sicuramente una zona turistica. Tra i bar, i negozi T-shirt, e un sacco di tat con elefanti di serie e Buddha si pu&ograve; essere in grado di trovare un sussurro della citt&agrave; di pescatori, ma non ho visto.</p>\r\n\r\n<p>Circa cinque chilometri pi&ugrave; in basso la strada &egrave; Wat Phra Yai, pi&ugrave; comunemente conosciuto come il Big Buddha Temple. Big Buddha merita una voce tutta sua, in modo che sar&agrave; accanto.</p>\r\n\r\n<p>Nel frattempo, ecco la leggenda della torta Good Wife:</p>\r\n\r\n<p>C&#39;era una volta, c&#39;era una povera coppia che vive in Cina imperiale. Si amavano e vivevano in un piccolo villaggio. Improvvisamente, una misteriosa malattia si diffuse attraverso il loro villaggio, e il padre del marito divenne molto malato.</p>\r\n\r\n<p>La coppia ha trascorso tutti i loro soldi per curare il padre dell&#39;uomo, ma era ancora malato. La moglie si venduto come schiavo in cambio di denaro<br />\r\ntempio edificio buildingtemple<br />\r\ncostruzione del tempio<br />\r\nper comprare le medicine per il padre-in-law. Una volta che il marito imparato a conoscere ci&ograve; che la sua moglie ha fatto, ha fatto una torta piena di wintermelon zuccherato e mandorla. Ha dedicato questo dolce alla moglie, che non avrebbe mai potuto dimenticare, e lo ha venduto per la strada. La sua torta &egrave; diventato cos&igrave; popolare che &egrave; stato in grado di guadagnare abbastanza soldi per comprare la moglie schiena.</p>\r\n', 'Non doveva a Rain', 'Non dovrebbe piovere a Koh Samui in questo periodo dell\'anno.', NULL, NULL, 0);
