(474, 339, 'en', 'File a claim', '<p>Dear customers, we understand your worries and highly appreciate your contact with our team to file a claim in case you have one. Therefore, to file a claim you need to email us with the below information:</p>\r\n\r\n<ul>\r\n	<li>Your name and transaction reference along with a description of your disputes.</li>\r\n	<li>You may also call us to file or check the status of an existing dispute.</li>\r\n	<li>Note: Claim&nbsp;resolutions can take from 24 to 48 hours to be handled and resolved.</li>\r\n</ul>\r\n\r\n<h3>Avoiding Disputes</h3>\r\n\r\n<p>We take all measures required to ensure that any inconveniences are resolved&nbsp;within a timely manner. In case a claim has been filed by a customer we would ensure that it is resolved within 48 hours.</p>\r\n\r\n<h3>Detecting Fraud and preventing fraudulent transactions</h3>\r\n\r\n<p>We have implemented extreme measures to detect and prevent fraud. Our built in risk analysis brings suspicious orders to our attentions for further investigation. Below&nbsp;we share some steps we take into preventing and detecting fraud.</p>\r\n\r\n<ol>\r\n	<li>Verifying IP address</li>\r\n	<li>Calling the phone number on the order</li>\r\n	<li>Verify billing and shipping address for the payment method used</li>\r\n	<li>Investigate on AVS ( Address verification ) or CVV verification failures</li>\r\n	<li>Special attention to high value orders.</li>\r\n</ol>', '', '', '2021-04-20 04:15:28', '2021-04-20 04:15:28', 0),
(475, 340, 'en', 'Last minute deals', '', '', '', '2021-04-20 04:16:04', '2021-04-20 04:17:52', 0),
(476, 341, 'en', 'Add your business', '', '', '', '2021-04-20 04:23:12', '2021-04-20 04:23:12', 0),
(477, 342, 'en', 'Careers and Jobs', '<h5>OUR MISSION</h5>\r\n\r\n<h1>Create a world where anyone can belong anywhere</h1>\r\n\r\n<p>It&rsquo;s an audacious, incredibly rewarding mission that our increasingly diverse team is dedicated to achieving.</p>\r\n\r\n<p>The main drive behind establishing&nbsp;was our wish to develop the concept of traveling easily, comfortably and elegantly. This is why we have always strived to provide innovative online traveling solutions to travelers around the world, and Middle Eastern travelers especially. We pride ourselves on being the first Saudi website that provides comprehensive and high-quality services in the travel and tourism sector.</p>\r\n\r\n<p>Exciting challenges lie ahead&mdash;new regions, technologies, and businesses. Guided by our four core values, we&rsquo;ll meet these challenges creatively and with the support of our global community. Join us!<br />\r\n<br />\r\nto join us please find our email on contact page and send your portfolio cv or furher details we are open to hire collaborate and join hands with people like you.&nbsp;<br />\r\n<br />\r\nThanks</p>\r\n', '', '', '2021-04-20 04:27:12', '2021-04-20 22:55:52', 0),
