(40, 'Rendezvous Hotels', '', 'Rendezvous-Hotels', '<p>Rendezvous Hotel Singapore is located in the Arts and Heritage District, within 3 km (0.2 mi) of the Singapore National Museum, Singapore Art Museum, and Singapore Management University. The Dhoby Ghaut MRT (Mass Rapid Transit) station is a five-minute walk, and Orchard Road shops are a 10-to-15-minute walk. Hotel Features. The exterior of the building combines history and sophistication, while the interior offers an art-infused experience and a unique aesthetic. The hotel offers an outdoor pool, and a fitness center. Public areas and all guestrooms are nonsmoking. Straits Cafe@Rendezvous offers buffet and a la carte dining. Room service is available around the clock. A lobby bar and a gourmet food court are also on site. The hotel offers a concierge desk, a multilingual staff, and business services. Guestrooms. The air-conditioned guestrooms feature cable TV, pay movies, and in-room safes. Wireless and wired high-speed Internet access are available for a surcharge. Minibars and coffee/tea makers are also included. Bathrooms offer shower/tub combinations, handheld showers, and telephones. Wake-up calls are provided upon request</p>', 'Guestrooms.\r\nThe air-conditioned guestrooms feature cable TV, pay movies, and in-room safes. Wireless and wired high-speed Internet access are available for a surcharge. Minibars and coffee/tea makers are also included. Bathrooms offer shower/tub combinations, handheld showers, and telephones. Wake-up calls are provided upon request.', 'The exterior of the building combines history and sophistication, while the interior offers an art-infused experience and a unique aesthetic. The hotel offers an outdoor pool, and a fitness center. Public areas and all guestrooms are nonsmoking. Straits Cafe@Rendezvous offers buffet and a la carte dining. Room service is available around the clock. A lobby bar and a gourmet food court are also on site. The hotel offers a concierge desk, a multilingual staff, and business services.\r\nrs, and telephones. Wake-up calls are provided upon request.', 'another mazing hotel from Singapore suggested for new couples ', '2', 0, 'yes', 0, 0, 6, 98, '4', 75, 0, '', '', 'Rendezvous Hotel Singapore by Far East Hospitality Singapore', '', '1.354313975537631', '103.81743274072267', ' Arts and Heritage District, the art-inspired Rendezvous Hotel Singapore is 5-minute walk from Dhoby Ghaut and Bras Basah MRT...', 'Rendezvous Hotel Singapore by Far East Hospitality, Singapore, Singapore, hotel, Hotels', 'Singapore\'s Arts and Heritage District, the art-inspired Rendezvous Hotel Singapore is 5-minute walk from Dhoby Ghaut and Bras Basah MRT...', '62,63,64,66,71,182,183,184,186,187,188,189,192,194,195,196', '28,29,136,138', 0, 0, '12:00 PM', '12:00 PM', 'Room service, Car hire, 24-hour front desk, Express check-in/check-out, Currency exchange, Ticket service, Luggage storage, Concierge service, Babysitting/child services, Laundry, Dry cleaning, Ironing service, Meeting/banquet facilities, Business centre, Fax/photocopying, VIP room facilities', 'Yes', 1, NULL, 0, 100, 0, 2, 'booking@rezdeven.com', '+123 456 789', 'http://www.rezden.com', 'forever', 1, 0, 1, 0, NULL, '75043_1.jpg', 'hotels', NULL, 10, 5, 2, 1),
(39, 'Swissotel Le Plaza Basel', '1000', 'Swissotel-Le-Plaza-Basel', '<p>This business hotel is connected to the Congress Center Basel and is only a 15-minute walk away from the centre. It offers elegant rooms, fine cuisine and up-to-date fitness facilities. All rooms have recently been renovated and feature air-conditioning, wired and wireless internet access, an LCD satellite TV, as well as tea and coffee making facilities. At restaurant Grill25 you can enjoy a wide range of steaks and fresh fish from the grill. Also vegetarian dishes are available. Shops, hairdressers and a pharmacy are located right next to the Swissotel Le Plaza Basel. The Swissotel Le Plaza Basel is approximately 15 minutes by taxi from the airport, 10 minutes by public transport from the train station and 5 minutes&#39; walk from the musical theatre.</p>', 'This business hotel is connected to the Congress Center Basel and is only a 15-minute walk away from the centre. It offers elegant rooms, fine cuisine and up-to-date fitness facilities.\r\n\r\nAll rooms have recently been renovated and feature air-conditioning, wired and wireless internet access, an LCD satellite TV, as well as tea and coffee making facilities.\r\n\r\nAt restaurant Grill25 you can enjoy a wide range of steaks and fresh fish from the grill. Also vegetarian dishes are available.\r\n\r\n', '', 'One of the best hotel in Switzerland we like', '4', 5, 'no', 0, 0, 1, 98, '4', 90, 0, '', '', 'Swissôtel Le Plaza Basel, Messeplatz, Basle, Swiss', '', '47.56378', '7.600789999999961', 'This business hotel is connected to the Congress Center Basel and is only a 15-minute walk away from the centre.', 'Swissotel Le Plaza Basel, Basel, Switzerland, R:Basel-City, hotel, Hotels', 'This business hotel is connected to the Congress Center Basel and is only a 15-minute walk away from the centre.', '62,63,64,66,71,78,182,183,184,186,187,188,189,190,192,193,194,195,196', '28,29,136,137', 12, 50, '12 AM', '04:00 PM', 'Room service, Car hire, 24-hour front desk, Express check-in/check-out, Currency exchange, Ticket service, Luggage storage, Concierge service, Babysitting/child services, Laundry, Dry cleaning, Ironing service, Meeting/banquet facilities, Business centre, Fax/photocopying, VIP room facilities', 'Yes', 12, '30,31,32,33,34,38', 0, 10, 0, 10, '', '', '', '', 1, 0, 0, 1, NULL, '588989_2.jpg', 'hotels', NULL, 0, 0, 0, 0),
(38, 'Hyatt Regency Perth', '', 'Hyatt-Regency-Perth', '<p>This 5-star luxury hotel offers a 25-metre heated pool and a tennis court minutes from the banks of Swan River and Perth&rsquo;s city centre. A free city shuttle bus is provided. Hyatt Regency Perth Hotel provides large rooms that with views of the river or the city. Some rooms include free access the hotel&rsquo;s fitness centre and sauna. Guests can enjoy superb cuisine at any of the 5 dining outlets at the property including Cafe Restaurant, Joe&rsquo;s Oriental Diner with its spectacular open kitchen or the sumptuous Conservatory Lounge. Hyatt Regency Perth is 20 minutes&#39; drive from Perth international and Domestic Airport.</p>', 'This 5-star luxury hotel offers a 25-metre heated pool and a tennis court minutes from the banks of Swan River and Perth’s city centre. A free city shuttle bus is provided.\r\n\r\nHyatt Regency Perth Hotel provides large rooms that with views of the river or the city. Some rooms include free access the hotel’s fitness centre and sauna.\r\n\r\nGuests can enjoy superb cuisine at any of the 5 dining outlets at the property including Cafe Restaurant, Joe’s Oriental Diner with its spectacular open kitchen or the sumptuous Conservatory Lounge.\r\n\r\nHyatt Regency Perth is 20 minutes\' drive from Perth international and Domestic Airport.', 'This 5-star luxury hotel offers a 25-metre heated pool and a tennis court minutes from the banks of Swan River and Perth’s city centre. A free city shuttle bus is provided.\r\n\r\nHyatt Regency Perth Hotel provides large rooms that with views of the river or the city. Some rooms include free access the hotel’s fitness centre and sauna.\r\n\r\nGuests can enjoy superb cuisine at any of the 5 dining outlets at the property including Cafe Restaurant, Joe’s Oriental Diner with its spectacular open kitchen or the sumptuous Conservatory Lounge.\r\n\r\nHyatt Regency Perth is 20 minutes\' drive from Perth international and Domestic Airport.', '', '3', 