(37, 'Islamabad Marriott Hotel', '15', 'Islamabad-Marriott-Hotel', '<p>The 5-star Islamabad Marriott Hotel provides high speed wireless internet, an indoor pool and a fitness centre. Pampering spa treatments with separate male and female lounges are also available. Room service is provided 24 hours. The modern air-conditioned rooms are all equipped with a 42-inch flat-screen TV, a personal safe and tea/coffee making facilities. En suite bathrooms come with hot-water showers, bathrobes and free toiletries. Islamabad Marriott Hotel is about 20 km from both Islamabad Airport and Rawalpindi Station. Daewoo Bus Station is 25 km away. On-site parking and valet parking are free. Guests can visit the beauty salon, browse the on-site bookstore, or rent cars to explore the area. The hotel also provides a florist, daily newspapers and a tour desk. Continental buffet spreads are offered at Nadia, while Chinese cuisine is served at Dynasty. Other dining options include The Royal Elephant Thai restaurant, Jason&#39;s Steak House, Dumpukht Mughlai Restaurant and Sakura Japanes</p>', 'Guests can visit the beauty salon, browse the on-site bookstore, or rent cars to explore the area. The hotel also provides a florist, daily newspapers and a tour desk.\r\n\r\nContinental buffet spreads are offered at Nadia, while Chinese cuisine is served at Dynasty. Other dining options include The Royal Elephant Thai restaurant, Jason\'s Steak House, Dumpukht Mughlai Restaurant and Sakura Japanes', 'Guests can visit the beauty salon, browse the on-site bookstore, or rent cars to explore the area. The hotel also provides a florist, daily newspapers and a tour desk.\r\n', 'this is really 5 star hotel amazing service must visit', '5', 3, 'yes', 0, 0, 1, 98, '2714', 90, 0, '', '', 'Islamabad Marriott Hotel, Islamabad, Pakistan', '', '33.7293882', '73.09314610000001', 'The 5-star Islamabad Marriott Hotel provides high speed wireless internet, an indoor pool and a fitness centre.', 'Islamabad Marriott Hotel, Islāmābād, Pakistan, hotel, Hotels', 'The 5-star Islamabad Marriott Hotel provides high speed wireless internet, an indoor pool and a fitness centre.', '62,63,64,71,78,182,183,186,188,189,190,192,195,196', '28,29,136,138', 50, 12, '12:00 PM', '02:00 PM', 'When booking more than 9 rooms, different policies and additional supplements may apply. All children are welcome. Free! One child under 4 years stays free of charge when using existing beds.  \r\nThe maximum number of extra beds/children\'s cots permitted in a room is 1. Cancellation and prepayment policies vary according to room type. Please enter the dates of your stay and check the conditions of your required room.', 'Yes', 1, '29,30,32,33,34,39', 0, 10, 0, 5, '', '', '', 'forever', 1, 0, 1, 1, NULL, '94178_4.jpg', 'hotels', NULL, 0, 0, 0, 0),
(36, 'Rose Rayhaan Rotana', '2', 'Rose-Rayhaan-Rotana', '<p>Occupying the world&rsquo;s second tallest hotel, the Rose Rayhaan by Rotana offers convenient accommodation surrounded by several restaurants and caf&eacute;s. Financial Centre Metro Station is 2 minutes&#39; walk. Rose Rayhaan is a 333-metre tall, 72-storey building providing a variety of modern, spacious rooms and suites that include LCD TVs and feature stunning city views. Rose Rayhaan&rsquo;s swimming pool is situated on the 4th floor of the hotel. Other facilities include a hot tub, massage rooms, sauna and steam rooms. The largest shopping centre in the world, Dubai Mall, is 1.5 km from this alcohol-free hotel. Dubai Exhibition Centre, the Mall of the Emirates and the Burjuman Shopping Mall are also within a 10 minute drive from the property. We speak your language! Hotel Rooms: 462, Hotel Chain: Rotana.</p>', 'The largest shopping centre in the world, Dubai Mall, is 1.5 km from this alcohol-free hotel. Dubai Exhibition Centre, the Mall of the Emirates and the Burjuman Shopping Mall are also within a 10 minute drive from the property.\r\n\r\nWe speak your language! Hotel Rooms: 462, Hotel Chain: Rotana.', 'The largest shopping centre in the world, Dubai Mall, is 1.5 km from this alcohol-free hotel. Dubai Exhibition Centre, the Mall of the Emirates and the Burjuman Shopping Mall are also within a 10 minute drive from the property.\r\n\r\nWe speak your language! Hotel Rooms: 462, Hotel Chain: Rotana.', '', '2', 5, 'yes', 0, 0, 3, 98, '9404', 120, 0, '', '', 'Rose Rayhaan by Rotana - Trade Centre - Dubai - United Arab Emirates', '', '25.211667', '55.276388999999995', 'Occupying the world’s second tallest hotel, the Rose Rayhaan by Rotana offers convenient accommodation surrounded by several restaurants and cafés', 'Rose Rayhaan by Rotana - Dubai, Dubai, UAE, D:Trade Centre 2, R:Dubai Emirate, hotel, Hotels', 'Rose Rayhaan by Rotana - Dubai, Dubai, Emiratos Árabes Unidos, D: Trade Centre 2, R: Dubai Emirato, hotel, Hoteles', '62,63,64,66,71,186,187,188,189,190,192,193,194,195', '28,29,136,138', 0, 0, '12:00 PM', '12:00 PM', 'When booking more than 9 rooms, different policies and additional supplements may apply. All children are welcome. Free! One child under 4 years stays free of charge when using existing beds.  \r\nThe maximum number of extra beds/children\'s cots permitted in a room is 1. Cancellation and prepayment policies vary according to room type. Please enter the dates of your stay and check the conditions of your required room.', 'Yes', 7, NULL, 0, 0, 0, 0, 'book@rayhaan.com', '023568987', 'www.roserayhan.com', 'forever', 1, 1, 1, 1, NULL, '596771_5.jpg', 'hotels', NULL, 0, 0, 0, 0),
(34, 'Malmaison Manchester', '10', 'Malmaison-Manchester', '<p>Opposite Manchester Piccadilly Station, this beautifully converted Victorian warehouse has boutique bedrooms and a sumptuous spa. In Manchester&rsquo;s vibrant centre, the hotel also features a brasserie and fitness centre. The chic rooms have luxurious beds and intimate mood lighting. Rooms also feature a plasma-screen TV and high-speed internet access, and the modern bathrooms have power showers and exclusive toiletries.</p>', 'Serving a modern British menu and French specialities, the Brasserie offers fine dining by candlelight. At the stylish Mal Bar, creative cocktails are mixed from fresh fruit, quality spirits and champagnes.\r\n\r\nThe impressive Malmaison Manchester features the elegant Le Petit Spa, offering a range of indulgent treatments and therapies. There is also a fully equipped fitness suite with a relaxing sauna.\r\n\r\n', 'Situated on Piccadilly, Malmaison Manchester Hotel is 150 metres from Piccadilly Gardens. The Arndale Centre is a 10-minute walk away, and Old Trafford can be reached in 10 minutes by car.\r\n\r\nWe speak your language! Hotel Rooms: 167, Hotel Chain: Malmaison.', 'good environment for couple trip!', '3', 3, 'yes', 0, 0, 16, 98, '9404', 66, 0, '', '', 'Malmaison Manchester, Manchester, United Kingdom', '', '53.4807593', '-2.2426305000000184', 'Hotel Malmaison Manchester', 'Malmaison Manchester, Manchester, UK, D:Manchester City Centre, hotel, Hotels', 'Opposite Manchester Piccadilly Station, this beautifully converted Victorian warehouse has boutique bedrooms and a sumptuous spa.', '64,66,71,78,182,183,184,186,187,188,190,192,193,195,196', '28,29,136,138', 22, 10, '12:00 PM', '12:00 PM', 'When booking more than 9 rooms, different policies and additional supplements may apply. All children are welcome. Free! One child under 4 years stays free of charge when using existing beds.  \r\nThe maximum number of extra beds/children\'s cots permitted in a room is 1. Cancellatio