(33, 'Oasis Beach Tower', '1', 'Oasis-Beach-Tower', '<p>This sophisticated beachfront property with its iconic exterior, features 180 luxury serviced and self-catering apartments. The spacious apartments each have a fully equipped kitchen, living room and dining area plus 2, 3 or 4 ensuite bedrooms. Guests may enjoy stunning views over The Palm Jumeirah and Dubai Marina, restaurants, a swimming pool deck just steps from Jumeirah beach and access to the private beach at JA Jebel Ali Golf Resort.</p>', 'The luxurious JA Oasis Beach Tower is located on the famous Jumeirah Beach in Dubai, with great views over The Palm Jumeirah, Arabian Gulf and Dubai Marina. Our 2, 3 and 4-bedroom luxury hotel apartments in Jumeirah Beach, Dubai give you the ideal starting point to explore the true potential of Dubai.', 'Sophisticated, exciting, dynamic, luxurious and welcoming - an endless array of words can be summoned to describe the modern appeal of the JA Oasis Beach Tower apartment accommodation in Jumeirah Beach. With its stately exuberance, the JA Oasis Beach Tower introduces and continuously provides you with an unrivaled quality of life, no matter how long your stay in Dubai.', 'One of the amazing hotels we have at our website suggest for everyone must book and enjoy the life at this place.', '4', 4, 'yes', 0, 0, 1, 98, '9404', 120, 0, '', '', 'JA Oasis Beach Tower - Dubai - United Arab Emirates', '', '25.2048493', '55.270782800000006', 'JA Oasis Beach Tower - phptravels.com - Deals & Discounts for Hotel Reservations from Luxury Hotels to Budget Accommodations', 'JA Oasis Beach Tower, Beach Tower, Oasis Tower', 'JA Oasis Beach Tower one the great and famous hotels on beach of dubai just visit now dont waste your time.. ', '62,63,64,66,71,78,182,183,186,188,189,190,192,193,195', '28,29,136,138', 50, 12, '02:00 PM', '02:00 PM', 'When booking more than 9 rooms, different policies and additional supplements may apply. All children are welcome. Free! One child under 4 years stays free of charge when using existing beds.  \r\nThe maximum number of extra beds/children\'s cots permitted in a room is 1. Cancellation and prepayment policies vary according to room type. Please enter the dates of your stay and check the conditions of your required room.', 'Yes', 9, NULL, 0, 0, 0, 0, 'info@oasis.com', '05668443269', 'www.osasishotel.com', 'forever', 1, 1, 1, 1, NULL, '964202_7.jpg', 'hotels', NULL, 0, 0, 0, 0),
(32, 'Jumeirah Beach Hotel', '20', 'Jumeirah-Beach-Hotel', '<p>UMEIRAH BEACH HOTEL - PREMIUM FAMILY LIFESTYLE DESTINATION With its striking wave-like design, Jumeirah Beach Hotel&#39;s five-star resort is one of Dubai&rsquo;s most instantly recognisable structures. Happily for our guests, the Jumeirah Beach Hotel in Dubai is equally famed for its amazing value and sheer wealth of options to enjoying your stay. All the hotel&rsquo;s 617 rooms, suites and villas are luxuriously furnished and provide spectacular views of the Arabian Gulf. And once you&rsquo;ve finished taking in the view, you can choose from the widest array of leisure facilities around one of the best family hotels in Dubai, including a scuba diving centre, five swimming pools, Sinbad&rsquo;s Kids Club, The Hub for teens and complimentary, unlimited access to the Wild Wadi Water Park. You&rsquo;ll find everything you&rsquo;re looking for and much more at Jumeirah Beach Hotel in Dubai.</p>', 'The property has connecting/adjoining rooms, which are subject to availability and can be requested by contacting the property using the number on the booking confirmation.', 'Talise Spa offers a menu of indulgent delights. The Aromatherapy Associates range of spa treatments utilises natural oils and fragrances to stimulate the senses and increase the wellbeing of mind, body and soul; whilst signature body sessions relax and rejuvenate.', 'Its a great hotel with amazing features and economic price suggested for every level of person', '5', 4, 'yes', 0, 0, 1, 102, '9404', 93, 0, '', '', 'Jumeirah Beach Hotel - Jumeirah - Dubai - United Arab Emirates', '', '25.1417633', '55.190799200000015', 'jumeirah Beach Hotel - Deals & Discounts for Hotel Reservations from Luxury Hotels to Budget Accommodations', 'Hilton Dubai Jumeirah Residence, Dubai, UAE, D:Jumeirah Beach Residence, R:Dubai Emirate, hotel, Hotels', 'Located on The Walk near Dubai Marina and steps away from numerous beachfront cafés, Hilton Dubai Jumeirah Residences features an outdoor swimming pool and...', '63,64,66,71,78,182,186,187,188,189,190,192,193,196', '28,29,136,138', 10, 12, '02:00 PM', '12:00 PM', 'When booking more than 9 rooms, different policies and additional supplements may apply. All children are welcome. Free! One child under 4 years stays free of charge when using existing beds.  \r\nThe maximum number of extra beds/children\'s cots permitted in a room is 1. Cancellation and prepayment policies vary according to room type. Please enter the dates of your stay and check the conditions of your required room.', 'Yes', 2, NULL, 0, 0, 0, 0, 'book@jumerah.com', '09715567789', 'www.jumerah.com', 'forever', 1, 1, 1, 1, NULL, '164074_1.jpg', 'hotels', NULL, 0, 0, 0, 0),
(31, 'Madinah Moevenpick Hotel', '6', 'Madinah-Moevenpick-Hotel', '<p>This luxury hotel features 3 restaurants. Guests are served a complimentary breakfast each morning. Complimentary wireless and wired high-speed Internet access is available in public areas and a computer station is located on site. This 5-star hotel features business amenities including a 24-hour business center and small meeting rooms. The staff can provide concierge services, wedding services, and tour assistance. Additional amenities include multilingual staff, gift shops/news stands, and laundry facilities. Onsite parking is complimentary.</p>', 'The 206 air-conditioned guestrooms at Madinah Moevenpick Hotel include laptop-compatible safes and minibars. Pillow menus are available. Guests can use the in-room complimentary wireless and wired high-speed Internet access. ', '36-inch plasma TVs are equipped with satellite channels. All accommodations provide desks, complimentary newspapers, and direct-dial phones. Bathrooms offer bathrobes, slippers, and complimentary toiletries. In addition, a turndown service is offered nightly, housekeeping is available daily, and amenities available on request include in-room massages.', 'Very great hotel for living with family special for peace and prayer times.', '2', 3, 'yes', 0, 0, 1, 98, '9404', 99, 0, '', '', 'Mövenpick Hotel Anwar Al Madinah, Madinah, Al Madinah Province, Saudi Arabia', '', '24.5246542', '39.56918410000003', 'Madinah Moevenpick Hotel - Hotels.com - Deals & Discounts for Hotel Reservations from Luxury Hotels to Budget Accommodations', 'Madinah Moevenpick Hotel,Hotels.com, ,Deals & Discounts, for Hotel,', 'Madinah Moevenpick Hotel - Hotels.com - Deals & Discounts for Hotel Reservations from Luxury Hotels to Budget Accommodations', '62,64,66,71,184,186,187,188,189,190,192,193,194,196', '28,29,136,138', 16, 20, '03:00 PM', '02:00 PM', 'We have included all charges provided to us by this hotel. However, charges can vary, for example, based on length of stay or the room you book.\r\n\r\nWhen booking more than 9 rooms, different policies and additional supplements may apply. All children are welcome. Free! One child under 4 years stays free of charge when using existing beds.  \r\nThe maximum number of extra beds/children\'s cots permitted in a room is 1. Cancellation and prepayment policies vary according to room type. Please enter the dates of your stay and check the conditions of your required room.\r\n', 'Yes', 4, NULL, 0, 0, 0, 0, 'info@moevenpick.com', '0966566974321', 'www.moevenpick.com', 'forever', 1, 1, 1, 1, NULL, '603302_10.jpg', 'hotels', NULL, 0, 0, 0, 0),
(30, 'Grand Plaza Apartments', '8', 'Grand-Plaza-Apartments', '<p>These luxurious, stylish apartments are situated just a 5-minute walk from Hyde Park and Notting Hill. Each apartment offers free Wi-Fi, modern, open-plan kitchens and laundry facilities. All of Grand Plaza Serviced Apartments feature a living area with large, comfortable sofas, flat-screen satellite TV/DVD players, and a dining area. Each modern kitchen area is fully equipped with amenities, including a fridge, a hob, and a microwave. Some apartments include an electric oven. There is also a breakfast room on site. Bathrooms offer contemporary, tiled decor with showers/baths, and luxury washbowls and toiletries. Bayswater Tube Station and Whiteley&rsquo;s shopping centre are less than 5 minutes&#39; walk from Grand Plaza Serviced Apartments. Paddington Train Station and Portobello Market are 15 minutes&#39; walk away. Westfield Shopping Centre can be reached in 15 minutes by Tube. We speak your language! Apartments: 198</p>', 'Bathrooms offer contemporary, tiled decor with showers/baths, and luxury washbowls and toiletries.\r\nBayswater Tube Station and Whiteley’s shopping centre are less than 5 minutes\' walk from Grand Plaza Serviced Apartments. Paddington Train Station and Portobello Market are 15 minutes\' walk away.', 'Vending machine (drinks), Vending machine (snacks), 24-hour front desk, Express check-in/check-out, Luggage storage, Laundry, Dry cleaning, Daily maid service, Fax/photocopying', 'Classic hotel use full for casual meetings.', '4', 4, 'yes', 1420758000, 1452294000, 1, 99, '9', 80, 0, '', '', 'Grand Plaza Apartments, South Highlander Way, Howell, MI, United States', '', '42.60948519999999', '-83.95387920000002', 'Grand Plaza Serviced Apartments (London, England) - Condominium Reviews - TripAdvisor', 'Grand Plaza Serviced Apartments, London, England, reviews, hotel, resort, inn, reservation, deal', 'Grand Plaza Serviced Apartments, London: See 973 traveler reviews, 361 candid photos, and great deals for Grand Plaza Serviced Apartments, ranked #64 of 568 specialty lodging in London', '63,64,66,71,182,184,186,187,188,190,192,193,194,195,196', '28,136,137,138', 1, 1, '02:00 PM', '02:00 AM', 'Free! All children under 4 years stay free of charge when using existing beds.\r\n\r\nWhen booking more than 9 rooms, different policies and additional supplements may apply. All children are welcome. Free! One child under 4 years stays free of charge when using existing beds.  \r\nThe maximum number of extra beds/children\'s cots permitted in a room is 1. Cancellation and prepayment policies vary according to room type. Please enter the dates of your stay and check the conditions of your required room.', 'Yes', 1, NULL, 0, 0, 0, 0, 'info@grandplaze.com', '09715568946325', 'www.grandplaze.com', '', 1, 1, 1, 1, NULL, '450256_9.jpg', 'hotels', NULL, 0, 0, 0, 0),
(28, 'Alzer Hotel Istanbul', '9', 'Alzer-Hotel-Istanbul', '<p>Along with stunning views of the Blue Mosque and Hagia Sophia from its rooftop terrace, this special category hotel offers personalised service and free wireless internet access in the heart of Sultanahmet. The historic townhouse Alzer Hotel is over 100 years old and has been fully restored with great attention to detail. The clean and comfortable guest rooms offer modern amenities, including air conditioning. Start each day with a rich breakfast served on Alzer&#39;s charming terrace, whilst admiring views of the Blue Mosque and Marmara Sea. Traditional Turkish cuisine is served in the evenings. Enjoy a stroll around the historic neighbourhood before returning to Alzer Hotel for peace and relaxation. Alzer&#39;s friendly staff is available 24 hours a day to help you with any information you may need to make the most of your stay.</p>', 'Alzer Hotel, is the only hotel located at the center of the historical hippodrome!\n\nThe Hippodrome, today named Sultanahmet Square, dates from the 3rd century AD. With a seating capacity of 30,000, it was used for sporting and political events, and decorated with obelisks and monuments. \n\nThe 3500-year old Obelisk, Istanbul\'s oldest monument, was brought from Egypt and installed by the Emperor Theodosius I in 390 AD.', 'Transfers\nAirport shuttle (available on request) *\nParking\nNearby parking *\nOffsite\nArea shuttle *', NULL, '4', 3, 'yes', 0, 0, 1, 98, '9', 85, 0, NULL, NULL, 'Alzer Hotel, Fatih, Istanbul, Turkey', NULL, '41.020169', '28.93386399999997', 'Alzer hotel', 'alzer hotel, turkia hotels, instambul hotels, hotels in istanbuk', 'Along with stunning views of the Blue Mosque and Hagia Sophia from its rooftop terrace, this special category hotel offers personalised service and free wireless internet access in the heart of Sultanahmet.', '63,64,66,71,78,182,184,186,187,188,190,192,193,194,196', '28,29,136,138', 0, 0, '03:00 PM', '04:00 PM', 'Alzer Hotel accepts these cards and reserves the right to pre-authorise your card prior to arrival.\r\n\r\nWhen booking more than 9 rooms, different policies and additional supplements may apply. All children are welcome. Free! One child under 4 years stays free of charge when using existing beds.  \r\nThe maximum number of extra beds/children\'s cots permitted in a room is 1. Cancellation and prepayment policies vary according to room type. Please enter the dates of your stay and check the conditions of your required room.', 'Yes', 3, NULL, 0, 0, 0, 0, 'info@alzerhotel.com', '0789456325', 'www.alzerhotel.com', 'forever', 1, 1, 1, 1, NULL, '678222_12.jpg', 'hotels', NULL, 0, 0, 0, 0),
(29, 'Tria Hotel Istanbul Special', '25', 'Tria-Hotel-Istanbul-Special', '<p>The Hotel Tria Istanbul is an intimate, style hotel, elegantly decorated and recently opened in Sultanahmet, boasting views of the Marmara Sea and the Asian Side. Crafted from a traditional Ottoman edifice, its wooden facade reflects the nobility and charm of historical Istanbul, whilst its deluxe and standard rooms are comfortably furnished with modern amenities. This special class hotel is a short walk from the most significant monuments of ancient imperial Byzantium, such as the splendid Hagia Sophia, Hippodrome and Basilica Cistern, as well as Ottoman masterpieces like Topkapi Palace and the Blue Mosque.</p>', 'This special class hotel is a short walk from the most significant monuments of ancient imperial Byzantium, such as the splendid Hagia Sophia, Hippodrome and Basilica Cistern, as well as Ottoman masterpieces like Topkapi Palace and the Blue Mosque.', 'This special class hotel is a short walk from the most significant monuments of ancient imperial Byzantium, such as ', 'We found this hotel is very amazing from front desk to bedroom and so on.', '5', 4, 'no', 1420758000, 1452294000, 1, 98, '9', 50, 0, '', '', 'Tria Hotel, Istanbul, Turkey', '', '41.0082376', '28.97835889999999', 'Tria Hotel Istanbul-Special Category', 'Tria Hotel Istanbul-Special Category, Istanbul, Turkey, D:Fatih, hotel, Hotels', 'The Hotel Tria Istanbul is an intimate, style hotel, elegantly decorated and recently opened in Sultanahmet, boasting views of the Marmara Sea and the...', '62,63,64,66,71,78,186,187,188,189,190,192,193,194,195,196', NULL, 1, 1, '12:00 PM', '12:00 PM', 'When booking more than 9 rooms, different policies and additional supplements may apply. All children are welcome. Free! One child under 4 years stays free of charge when using existing beds.  \r\nThe maximum number of extra beds/children\'s cots permitted in a room is 1. Cancellation and prepayment policies vary according to room type. Please enter the dates of your stay and check the conditions of your required room.', 'Yes', 2, NULL, 0, 0, 0, 0, 'info@triahotel.com', '09756654236', 'www.triahotel.com', '', 1, 1, 1, 1, NULL, '2198_11.jpg', 'hotels', NULL, 0, 0, 0, 0);
