(45, 39, 'Advantage Room (Single/Double)', '150.00', 0, '<p>All rooms have recently been renovated and feature air-conditioning, wired and wireless internet access, an LCD satellite TV, as well as tea and coffee making facilities.</p>\r\n', 4, 2, 1, '140,141,142,143,144,147,148,149,151,156,158,159,160,161,162,164,166,171,172,174', 1, 106, 1, 45, 1399209428, 3, 'Yes', '4.jpg', '0.00', '0.00', 0),
(46, 39, 'Premier Room', '200.00', 0, '<p>This spacious and fully air-conditioned room features a seating area, a working area, a flat-screen TV, a coffee maker and a marble bathroom with shower/tub combination.</p>\r\n', 3, 3, 1, '140,141,142,143,144,147,148,149,150,151,152,153,156,157,158,159,160,161,162,164,166,171,172,174', 2, 121, 0, 0, 1399209618, 2, 'Yes', '3.jpg', '0.00', '0.00', 0),
