INSERT INTO `pt_tours` (`tour_id`, `tour_title`, `discount`, `tour_slug`, `tour_desc`, `tour_stars`, `tour_is_featured`, `tour_featured_from`, `tour_featured_to`, `tour_owned_by`, `tour_type`, `tour_location`, `tour_latitude`, `tour_longitude`, `tour_mapaddress`, `tour_basic_price`, `tour_basic_discount`, `tour_max_adults`, `tour_max_child`, `tour_max_infant`, `tour_adult_price`, `tour_child_price`, `tour_infant_price`, `adult_status`, `child_status`, `infant_status`, `tour_days`, `tour_nights`, `tour_hours`, `tour_meta_title`, `tour_meta_keywords`, `tour_meta_desc`, `tour_amenities`, `tour_exclusions`, `tour_payment_opt`, `tour_privacy`, `tour_status`, `tour_order`, `tour_related`, `tour_comm_fixed`, `tour_comm_percentage`, `tour_tax_fixed`, `tour_tax_percentage`, `tour_email`, `tour_phone`, `tour_website`, `tour_fulladdress`, `tour_featured_forever`, `tour_created_at`, `thumbnail_image`, `module`) VALUES
(24, 'Sheraton Trip', '25', 'Sheraton-Trip', '<p>Experience hospitality at the city, from its stunning to vibrant culture, architecture and exquisite cuisines.</p>\r\n\r\n<p>Take a weekend trip on the occasion&nbsp;and create a memorable experience with your loved one. If you are a sun and sea lover, this paradise offers you an array of splendid sandy beaches, where you can spend time relaxing or go on a refreshing yacht experience. And if you are a history lover, explore the birthplace of many civilizations, empires, historic figures and legends together with diverse mixture of many different ethnic origins.<br />\r\n&nbsp;</p>\r\n\r\n<hr />\r\n<p><u><strong>Day 1</strong></u><br />\r\n<span style=\"font-family:arial,helvetica,sans-serif\">Arrive to the city&nbsp;and transfer to your hotel. Check in and spend the day at leisure.<br />\r\n<br />\r\n<u><strong>Day 2</strong></u><br />\r\nAfter breakfast, go on the Boshphorus cruise and the Spice market tour. Enjoy the traditional excursion along the waterway separating Europe and Asia. The shore is lined with old wooden villas, palaces of marble, fortresses and small fishing villages. Witness major highlights whilst sailing such as the Dolmabah&ccedil;e Palace, the parks and pavilions of the Yildiz Palace. Visit the colorful Spice Market to buy local spices and shop for souvenirs.<br />\r\n<br />\r\n<u><strong>Day 3</strong></u><br />\r\nBegin your day with a delicious breakfast and go on your city tour on seat in coach basis, the heart of the Imperial Center from where the Byzantine and Ottoman Empires once ruled. Explore the Hippodrome, a beautiful park known as the Byzantine chariot racetrack &ndash; a stadium capable of holding 100,000 people. There are three great monuments in the Hippodrome, the Egyptian Obelisk of 1500 BC, the Serpentine Column from the Temple of Apollo at Delphi and the German Fountain of Wilhelm II. Later visit the Blue Mosque, which faces Hagia Sophia and features six towering minarets and spectacular interior covered by overwhelmingly blue Iznik tiles.<br />\r\n<br />\r\n<u><strong>Day 4</strong></u><br />\r\nAfter breakfast, check out from your hotel and spend the day shopping and exploring the city on your own. In the evening, transfer to the airport and board your flight and return home with great memories of your holiday.</span></p>\r\n', 5, 'yes', 0, 0, 1, 197, '9404', '21.8768446', '-159.4646715', 'Sheraton Kauai Resort, Hoonani Road, Koloa, HI, United States', 400, 0, 8, 5, 6, 200, 100, 50, 1, 1, 1, 13, 12, 0, 'Sheraton Kauai Resort Trip', 'Sheraton Kauai Resort, Sheraton Kauai Resort, Sheraton Kauai Resort, ', 'ravelOnline accommodation and special offers for the Sheraton Kauai Resort, Hawaii. Amazing Deals, Instant Quotes backed by Personalised Service.', '203,205,207,211,212,213,217,218,219,220,221,222,226,227,228,230,232,235,236,237,240,241,242,244', '250,251,252,254,255,256,257,258,259,260,261,262,263,264', '28,29,136,138', 'Prices include return economy-class flights from on Qatar Airways. Prices are quoted on a twin-sharing basis in a standard room with inclusions listed above. Additional options are available upon request. Departures are fixed for 23 September 2015, no amendments or changes will be possible. Prices are correct at the time of publication and are subject to change without notice depending on travel dates and availability. Easy monthly payment plans are available from select participating banks through Musafir Holidays retail outlets and are subject to approval. All photos and videos shown are illustrative. Actual services may differ. Terms apply.       ', 'Yes', 1, '28,29,32,33,34,35', 0, 10, 0, 5, '', '', '', '', 'forever', 1405707490, '9.jpg', 'tours'),
