(28, 'Day Visit of Petra from Oman', '15', 'Day-Visit-of-Petra-from-Oman', '<p>Experience hospitality at the city, from its stunning to vibrant culture, architecture and exquisite cuisines.</p>\r\n\r\n<p>Take a weekend trip on the occasion&nbsp;and create a memorable experience with your loved one. If you are a sun and sea lover, this paradise offers you an array of splendid sandy beaches, where you can spend time relaxing or go on a refreshing yacht experience. And if you are a history lover, explore the birthplace of many civilizations, empires, historic figures and legends together with diverse mixture of many different ethnic origins.<br />\r\n&nbsp;</p>\r\n\r\n<hr />\r\n<p><u><strong>Day 1</strong></u><br />\r\n<span style=\"font-family:arial,helvetica,sans-serif\">Arrive to the city&nbsp;and transfer to your hotel. Check in and spend the day at leisure.<br />\r\n<br />\r\n<u><strong>Day 2</strong></u><br />\r\nAfter breakfast, go on the Boshphorus cruise and the Spice market tour. Enjoy the traditional excursion along the waterway separating Europe and Asia. The shore is lined with old wooden villas, palaces of marble, fortresses and small fishing villages. Witness major highlights whilst sailing such as the Dolmabah&ccedil;e Palace, the parks and pavilions of the Yildiz Palace. Visit the colorful Spice Market to buy local spices and shop for souvenirs.<br />\r\n<br />\r\n<u><strong>Day 3</strong></u><br />\r\nBegin your day with a delicious breakfast and go on your city tour on seat in coach basis, the heart of the Imperial Center from where the Byzantine and Ottoman Empires once ruled. Explore the Hippodrome, a beautiful park known as the Byzantine chariot racetrack &ndash; a stadium capable of holding 100,000 people. There are three great monuments in the Hippodrome, the Egyptian Obelisk of 1500 BC, the Serpentine Column from the Temple of Apollo at Delphi and the German Fountain of Wilhelm II. Later visit the Blue Mosque, which faces Hagia Sophia and features six towering minarets and spectacular interior covered by overwhelmingly blue Iznik tiles.<br />\r\n<br />\r\n<u><strong>Day 4</strong></u><br />\r\nAfter breakfast, check out from your hotel and spend the day shopping and exploring the city on your own. In the evening, transfer to the airport and board your flight and return home with great memories of your holiday.</span></p>\r\n', 0, 'yes', 0, 0, 1, 200, '16', '32.5473468', '35.85254609999993', 'Petra, Irbid, Habaka, Jordan', 450, 0, 5, 3, 1, 66, 20, 5, 1, 1, 1, 1, 1, 0, 'Full Day Visit of Petra from Oman', 'hotseller, Full Day Visit of Petra - from Amman, Amman tour, Jordan tour', 'Full Day Visit of Petra - from Amman. Morning departure via the desert highway to Petra. Enter the first part of that impressive, infamous fissure known as the Siq and bear witness to the sophistication of these people who dug for water..', '203,204,206,208,210,212,214,216,217,218,219,220,222,224,225,227,229,231,233,235,237,238,239,241', '254,255,256,257,258,259,260,261', '28,29,136,138', 'Prices include return economy-class flights from on Qatar Airways. Prices are quoted on a twin-sharing basis in a standard room with inclusions listed above. Additional options are available upon request. Departures are fixed for 23 September 2015, no amendments or changes will be possible. Prices are correct at the time of publication and are subject to change without notice depending on travel dates and availability. Easy monthly payment plans are available from select participating banks through Musafir Holidays retail outlets and are subject to approval. All photos and videos shown are illustrative. Actual services may differ. Terms apply.       ', 'Yes', 3, '24,26,30,33,34,36', 0, 10, 0, 10, '', '', '', '', 'forever', 1405869398, 'petra.jpg', 'tours'),
