(36, 'Spectaculars Of The Nile 3 Nights', '', 'Spectaculars-Of-The-Nile-3-Nights', '<p>Experience hospitality at the city, from its stunning to vibrant culture, architecture and exquisite cuisines.</p>\r\n\r\n<p>Take a weekend trip on the occasion and create a memorable experience with your loved one. If you are a sun and sea lover, this paradise offers you an array of splendid sandy beaches, where you can spend time relaxing or go on a refreshing yacht experience. And if you are a history lover, explore the birthplace of many civilizations, empires, historic figures and legends together with diverse mixture of many different ethnic origins.</p>\r\n\r\n<p><br />\r\nDay 1<br />\r\nArrive to the city and transfer to your hotel. Check in and spend the day at leisure.</p>\r\n\r\n<p>Day 2<br />\r\nAfter breakfast, go on the Boshphorus cruise and the Spice market tour. Enjoy the traditional excursion along the waterway separating Europe and Asia. The shore is lined with old wooden villas, palaces of marble, fortresses and small fishing villages. Witness major highlights whilst sailing such as the Dolmabah&ccedil;e Palace, the parks and pavilions of the Yildiz Palace. Visit the colorful Spice Market to buy local spices and shop for souvenirs.</p>\r\n\r\n<p>Day 3<br />\r\nBegin your day with a delicious breakfast and go on your city tour on seat in coach basis, the heart of the Imperial Center from where the Byzantine and Ottoman Empires once ruled. Explore the Hippodrome, a beautiful park known as the Byzantine chariot racetrack &ndash; a stadium capable of holding 100,000 people. There are three great monuments in the Hippodrome, the Egyptian Obelisk of 1500 BC, the Serpentine Column from the Temple of Apollo at Delphi and the German Fountain of Wilhelm II. Later visit the Blue Mosque, which faces Hagia Sophia and features six towering minarets and spectacular interior covered by overwhelmingly blue Iznik tiles.</p>\r\n\r\n<p>Day 4<br />\r\nAfter breakfast, check out from your hotel and spend the day shopping and exploring the city on your own. In the evening, transfer to the airport and board your flight and return home with great memories of your holiday.</p>\r\n', 4, 'no', 0, 0, 1, 187, '10', '30.06589679999999', '31.33702059999996', 'Nile Egypt, Al Manteqah Al Oula, Cairo Governorate, Egypt', 282, 0, 10, 5, 2, 150, 30, 10, 1, 1, 1, 2, 1, 2, 'Universal Studios Japan Day Pass', 'touchpoint, Universal Studios Japan® Day Pass + Osaka Overnight and Train from Tokyo, Tokyo tour, Japan tour', 'Universal Studios Japan® Day Pass + Osaka Overnight and Train from Tokyo. Take the Shinkansen from Tokyo to Osaka. Enjoy exciting rides and shows at Universal Studios Japan with your 1 Day Pass. Enjoy overnight accommodation at a hotel in Osaka..', '209,211,212,213,217,219,221,222,223,226,227,228,230,231,232,233,236,238,240,241,243,244', '250,252,254,255,256,257,258,259,261', '28,29,136,138', 'Prices include return economy-class flights from on Qatar Airways. Prices are quoted on a twin-sharing basis in a standard room with inclusions listed above. Additional options are available upon request. Departures are fixed for 23 September 2015, no amendments or changes will be possible. Prices are correct at the time of publication and are subject to change without notice depending on travel dates and availability. Easy monthly payment plans are available from select participating banks through Musafir Holidays retail outlets and are subject to approval. All photos and videos shown are illustrative. Actual services may differ. Terms apply.                                               ', 'Yes', 10, '24,26,28,29,30,32,33,34,35', 0, 25, 0, 10, '', '', '', '', '', 1405976149, '15.jpg', 'tours');
